INSERT INTO `pays` VALUES ('AD',42.5462,1.60155,'Andorre','AND',20,'??','U+1F1E6 U+1F1E9',0,5,99.83992874607436,'Andorre, nichée dans les Pyrénées entre la France et l\'Espagne, est une principauté enclavée dans une vallée montagneuse. La géographie d\'Andorre offre des paysages spectaculaires avec des vallées verdoyantes, des forêts denses et des sommets enneigés. La culture andorrane est un mélange de traditions catalanes, espagnoles et françaises, reflétant son emplacement géographique. La population andorrane est multilingue, avec le catalan comme langue officielle. Politiquement, Andorre est une coprincipauté avec deux coprinces, l\'évêque d\'Urgell en Espagne et le président de la République française. Sur le plan économique, le tourisme et le commerce sont des piliers essentiels, attirant des visiteurs pour le ski en hiver, la randonnée en été et les activités de plein air tout au long de l\'année. Le pays a également développé un secteur financier important. Andorre maintient une économie stable et prospère tout en préservant son environnement naturel.','Pas de la Casa, un paradis du shopping : Pas de la Casa, une station de ski andorrane, est également connue pour être un paradis du shopping, en particulier pour les produits détaxés. Les visiteurs affluent vers cette ville frontalière pour profiter des tarifs avantageux sur une gamme de produits.','La Vallée d\'Incles : La Vallée d\'Incles est une superbe vallée glacière dans les montagnes andorranes. C\'est un lieu prisé pour la randonnée en été et le ski de fond en hiver. Les paysages alpins préservés en font une destination naturelle idéale.','Pas de la Casa Circuit : Andorre abrite également le Pas de la Casa Circuit, un circuit automobile de montagne utilisé pour des événements de rallye et de course automobile. L\'emplacement offre des vues panoramiques exceptionnelles sur les montagnes environnantes.'),('AE',23.4241,53.8478,'Émirats arabes unis','ARE',784,'??','U+1F1E6 U+1F1EA',0,4,40.022213701179446,'Les Émirats arabes unis (EAU), situés sur la péninsule arabique, sont un ensemble de sept émirats, dont les plus connus sont Dubaï et Abu Dhabi. Géographiquement, ils se caractérisent par des déserts étendus et des côtes bordées par le golfe Persique et la mer d\'Arabie. La culture des Émirats arabes unis est profondément enracinée dans l\'islam, mais ces dernières décennies ont également vu une influence cosmopolite croissante en raison de la migration internationale. Sur le plan politique, les Émirats arabes unis sont une fédération de monarchies absolues, avec chaque émirat dirigé par un monarque héréditaire. Sur le plan économique, le pays a connu une croissance spectaculaire grâce à l\'exploitation pétrolière, mais s\'est également diversifié avec succès dans des secteurs tels que le tourisme, le commerce, l\'immobilier et l\'industrie. Dubaï, en particulier, est devenue une plaque tournante mondiale pour les affaires, le tourisme et les infrastructures futuristes.','Île de Palm Jumeirah : L\'île artificielle de Palm Jumeirah à Dubaï est une merveille d\'ingénierie qui a pris la forme d\'un palmier. Avec ses complexes hôteliers de luxe, ses résidences et ses plages privées, Palm Jumeirah est une destination exclusive prisée par les visiteurs du monde entier.','Centre Commercial Gigantesque : À côté du Burj Khalifa se trouve le Dubai Mall, l\'un des plus grands centres commerciaux du monde. En plus de ses nombreuses boutiques de luxe, le mall abrite également des attractions telles que l\'aquarium de Dubaï et une patinoire intérieure.','La Plus Haute Structure du Monde : Les Émirats arabes unis abritent le Burj Khalifa à Dubaï, la plus haute structure du monde, mesurant plus de 828 mètres. Outre son impressionnante hauteur, le Burj Khalifa est également réputé pour son design architectural avant-gardiste et offre une vue panoramique spectaculaire sur la ville.'),('AG',17.0608,-61.7964,'Antigua-et-Barbuda','ATG',28,'??','U+1F1E6 U+1F1EC',0,2,0.5912853410386344,'Antigua-et-Barbuda, nichées dans les Caraïbes, sont des joyaux insulaires aux plages de sable blanc et aux eaux cristallines. La culture antiguane-barbudienne, influencée par les héritages africain, britannique et autochtone, se manifeste dans la musique, la danse et les festivals. En tant que monarchie constitutionnelle, ces îles ont une économie axée sur le tourisme, les services financiers et l\'agriculture. Les visiteurs sont attirés par les activités nautiques, les forts historiques et la chaleur de l\'hospitalité locale.','Le Nelson\'s Dockyard : Le Nelson\'s Dockyard à Antigua est un site historique maritime, datant de l\'époque coloniale britannique. Des projets de préservation ont été entrepris pour maintenir ces quais et bâtiments, faisant revivre l\'histoire maritime de la région.','Les Plages de sable rose à Barbuda : Les plages de sable rose de Barbuda sont parmi les plus belles des Caraïbes. Des initiatives écologiques sont en cours pour préserver la beauté naturelle de ces plages, tout en protégeant les tortues qui les fréquentent.','Le Carnaval d\'Antigua : Le Carnaval d\'Antigua est une célébration exubérante avec des défilés, des costumes élaborés et de la musique entraînante. Des projets culturels visent à préserver cette tradition festive, célébrant l\'histoire et la diversité d\'Antigua-et-Barbuda.'),('AL',41.1533,20.1683,'Albanie','ALB',8,'??','U+1F1E6 U+1F1F1',0,5,82.88978867501932,NULL,NULL,NULL,NULL),('AM',40.0691,45.0382,'Arménie','ARM',51,'??','U+1F1E6 U+1F1F2',0,4,12.6750904253452,'L\'Arménie, nichée dans le Caucase du Sud, est un pays montagneux au riche patrimoine historique. Ses frontières partagées avec la Turquie, la Géorgie, l\'Azerbaïdjan et l\'Iran témoignent de sa position stratégique. La culture arménienne, imprégnée par le christianisme depuis l\'an 301, se reflète dans ses églises anciennes, ses traditions artisanales et ses festivités religieuses. Politiquement, l\'Arménie est une république démocratique indépendante depuis la dissolution de l\'Union soviétique en 1991. Le pays a connu des défis, notamment des conflits territoriaux avec l\'Azerbaïdjan, mais s\'efforce de renforcer sa stabilité politique. Sur le plan économique, l\'Arménie a diversifié ses secteurs, notamment l\'informatique et les technologies, malgré des défis économiques. Le tourisme, axé sur le patrimoine culturel et les paysages naturels, gagne également en importance. Malgré ses défis, l\'Arménie continue de cultiver son identité unique et de contribuer à la richesse culturelle et historique de la région.','Le mont Ararat : Le mont Ararat, une montagne emblématique, a une importance culturelle et symbolique profonde pour l\'Arménie. Bien que le mont Ararat soit visible depuis la capitale, Erevan, il est actuellement situé en Turquie. Selon la tradition biblique, c\'est sur le mont Ararat que l\'arche de Noé se serait échouée.','L\'Église de Sainte-Hripsimé : Cette église, située dans la ville d\'Etchmiadzin, est l\'un des exemples les plus anciens et les mieux préservés de l\'architecture arménienne médiévale. Elle a été construite au VIIe siècle et est dédiée à Sainte Hripsimé, une martyre chrétienne. L\'église fait partie du site du patrimoine mondial de l\'UNESCO.','Le cognac arménien : L\'Arménie est réputée pour son cognac de haute qualité. La distillerie d\'Ararat produit du cognac arménien depuis 1887. Winston Churchill était un grand amateur de ce cognac, et il est dit qu\'il aurait reçu une livraison régulière de cognac arménien pendant de nombreuses années.'),('AO',-11.2027,17.8739,'Angola','AGO',24,'??','U+1F1E6 U+1F1F4',0,1,14.706089175032536,'L\'Angola, situé sur la côte atlantique de l\'Afrique australe, est un pays riche en ressources naturelles et en diversité culturelle. Géographiquement, il offre un paysage varié, allant de vastes plaines aux hauts plateaux et aux zones côtières. Le fleuve Kwanza traverse le pays et a une influence significative sur son économie. La culture angolaise est diverse, reflétant l\'héritage de plusieurs groupes ethniques tels que les Ovimbundu, les Bakongo, et les Ovambo. La musique, la danse, et l\'art traditionnel jouent un rôle central dans la vie culturelle du pays. L\'Angola a également une histoire complexe en raison de la colonisation portugaise, suivie de nombreuses années de guerre civile, qui ont pris fin en 2002. Politiquement, l\'Angola est une république multipartite avec un président élu et un parlement. Depuis la fin de la guerre civile, le pays a connu une période de reconstruction et de développement économique, tiré en grande partie par l\'industrie pétrolière, bien que des défis subsistent en termes de gouvernance, de lutte contre la corruption et de diversification économique. L\'économie angolaise est fortement dépendante du pétrole, qui représente une part importante de ses exportations. Cependant, le pays cherche à diversifier ses sources de revenus en développant d\'autres secteurs tels que l\'agriculture, les mines, et les énergies renouvelables. Malgré les défis persistants, l\'Angola travaille à renforcer sa stabilité politique et à améliorer les conditions de vie de sa population, tout en préservant sa riche diversité culturelle.','Les Chutes de Kalandula : Les Chutes de Kalandula, situées dans la province de Malanje, sont parmi les plus grandes chutes d\'eau d\'Afrique. Le fleuve Lucala crée ce spectacle majestueux en cascade, offrant des vues spectaculaires et une expérience naturelle inoubliable.','La Forteresse de São Miguel : À Luanda, la Forteresse de São Miguel, construite au XVIIe siècle, témoigne de l\'histoire coloniale de l\'Angola. Ce site historique a été utilisé comme prison pendant la période coloniale portugaise et abrite maintenant un musée qui retrace l\'histoire du pays.','La Musique Kuduro : L\'Angola a donné naissance au genre musical dynamique appelé Kuduro. Mélange de hip-hop, de musique électronique et de rythmes africains, le Kuduro est une expression culturelle moderne qui a gagné en popularité à l\'échelle internationale. Les artistes angolais contribuent significativement à la scène musicale africaine.'),('AR',-38.4161,-63.6167,'Argentine','ARG',32,'??','U+1F1E6 U+1F1F7',0,3,35.50517767249157,'L\'Argentine, le deuxième plus grand pays d\'Amérique du Sud, est une terre de contrastes, offrant des paysages allant des vastes plaines de la pampa aux sommets des Andes. La culture argentine est profondément marquée par le tango, le football et la passion pour la cuisine, en particulier les délicieux steaks. En tant que république fédérale, l\'Argentine a traversé des périodes politiques complexes. Son économie, diversifiée entre l\'agriculture, l\'industrie et les services, contribue à sa position influente sur la scène régionale.','Le Glacier Perito Moreno : Le Glacier Perito Moreno en Argentine est l\'une des merveilles naturelles les plus impressionnantes, en constante évolution. Des mesures de préservation de l\'environnement sont mises en place pour protéger cet immense glacier et son écosystème unique.','Le Tango argentin : Le tango, danse passionnée originaire d\'Argentine, est un élément central de la culture argentine. Des initiatives culturelles visent à préserver et promouvoir cette forme d\'expression artistique, symbolisant l\'âme musicale du pays.','Le Train des Nuages : Le Train des Nuages, reliant l\'Argentine au Chili à travers les Andes, est un exploit d\'ingénierie. Des projets de préservation garantissent le maintien de cette ligne ferroviaire spectaculaire, offrant aux voyageurs une expérience mémorable à travers des paysages époustouflants.'),('AS',-14.271,-170.132,'Samoa américaines','ASM',16,'??','U+1F1E6 U+1F1F8',0,6,33.407623910724766,'Les Samoa américaines sont un territoire non incorporé des États-Unis situé dans l\'océan Pacifique, au sud de l\'équateur. Composé d\'un groupe d\'îles, cet archipel offre des paysages tropicaux magnifiques, avec des plages de sable blanc, des lagons cristallins et des collines verdoyantes. La culture samoane est profondément enracinée dans les traditions polynésiennes, avec des influences américaines évidentes en raison de son statut de territoire des États-Unis. Les habitants des Samoa américaines sont connus pour leur hospitalité chaleureuse et leur attachement aux coutumes locales. Politiquement, le territoire est administré par les États-Unis, avec un gouverneur et une législature locale. L\'économie repose principalement sur l\'industrie du thon, le tourisme et les transferts financiers en provenance des États-Unis. Les défis comprennent la vulnérabilité aux catastrophes naturelles telles que les cyclones, ainsi que la nécessité de maintenir un équilibre culturel entre les influences américaines et les traditions samoanes.','La pêche sportive : Les Samoa américaines sont renommées pour offrir d\'excellentes opportunités de pêche sportive. Les eaux autour des îles abondent en poissons tels que le thon, le mahi-mahi et le marlin. Des tournois de pêche attirent des amateurs de pêche du monde entier.','Le parc national des Samoa américaines : Ce parc national est le seul aux États-Unis situé dans l\'hémisphère sud. Il englobe des terres et des mers, avec des récifs coralliens, des plages, des forêts tropicales et des sites culturels. Il offre une riche biodiversité marine et terrestre.','La culture fa\'a Samoa : Les habitants des Samoa américaines préservent fièrement leur culture fa\'a Samoa, qui se reflète dans la danse, la musique, les tatouages traditionnels (malu pour les femmes et pe\'a pour les hommes) et la coutume du tissage de nattes.'),('AT',47.5162,14.5501,'Autriche','AUT',40,'??','U+1F1E6 U+1F1F9',0,5,60.52258960951361,NULL,NULL,NULL,NULL),('AU',-25.2744,133.775,'Australie','AUS',36,'??','U+1F1E6 U+1F1FA',0,6,2.3900793887582417,'L\'Australie, située en Océanie, est un vaste pays-continent reconnu pour sa diversité géographique, sa faune unique et son mode de vie décontracté. Canberra est la capitale politique, mais Sydney et Melbourne sont des centres culturels et économiques importants. L\'Australie est célèbre pour ses paysages variés, des plages dorées aux déserts rouges, en passant par les forêts tropicales. Politiquement, c\'est une monarchie constitutionnelle avec un système parlementaire. L\'économie repose sur l\'exploitation minière, l\'agriculture, le tourisme et les services. La population australienne, composée de diverses origines, contribue à une culture dynamique avec des influences aborigènes, européennes et asiatiques. L\'Australie est également connue pour ses sports, sa scène artistique, et ses sites emblématiques tels que l\'Opéra de Sydney et l\'Ayers Rock. Malgré sa prospérité, le pays doit faire face à des enjeux environnementaux tels que les changements climatiques et la préservation de la Grande Barrière de corail.','La Grande Barrière de Corail : La Grande Barrière de Corail, située au large de la côte nord-est de l\'Australie, est le plus grand récif corallien du monde. Cet écosystème marin extraordinaire abrite une diversité incroyable de vie marine, des coraux colorés aux poissons tropicaux en passant par les tortues de mer. C\'est un site classé au patrimoine mondial de l\'UNESCO.','Uluru (Ayers Rock) : Uluru, également connu sous le nom d\'Ayers Rock, est un monolithe emblématique situé au cœur de l\'Australie, dans le parc national d\'Uluru-Kata Tjuta. Considéré comme sacré par les peuples autochtones Anangu, Uluru est non seulement une merveille géologique, mais aussi un lieu spirituel profondément significatif.','La Faune Unique : L\'Australie abrite une faune extraordinaire, souvent caractérisée par ses espèces uniques. Des kangourous et koalas aux ornithorynques et aux wombats, la diversité animale du pays est fascinante. L\'emblématique kangourou est même représenté sur le blason national.'),('AW',12.5211,-69.9683,'Aruba','ABW',533,'??','U+1F1E6 U+1F1FC',0,2,30.382631188614884,'Aruba, une île des Caraïbes faisant partie du royaume des Pays-Bas, est connue pour ses plages de sable blanc, ses eaux cristallines et son climat ensoleillé. Géographiquement située dans la mer des Caraïbes au large de la côte du Venezuela, Aruba offre des paysages désertiques, des formations rocheuses uniques et une diversité écologique. La culture arubaine est influencée par les héritages autochtones amérindiens, africains, européens et sud-américains. Les habitants accueillants célèbrent leurs traditions à travers la musique, la danse et les festivals colorés. Politiquement, Aruba fait partie du royaume des Pays-Bas, avec un statut d\'autonomie depuis 1986. Sur le plan économique, le tourisme est le principal moteur, attirant des visiteurs du monde entier avec ses stations balnéaires de luxe, ses activités nautiques et son ambiance décontractée. Aruba s\'efforce également de promouvoir le développement durable et de diversifier son économie pour assurer une stabilité à long terme.','Les plages de sable blanc : Aruba est réputée pour ses magnifiques plages de sable blanc et ses eaux cristallines. Eagle Beach, souvent classée parmi les plus belles plages du monde, attire les visiteurs avec ses étendues de sable fin et ses divi-divi, des arbres caractéristiques courbés par les vents.','L\'architecture colorée d\'Oranjestad : La capitale d\'Aruba, Oranjestad, est caractérisée par son architecture colorée aux tons pastel. Les bâtiments historiques aux façades vives, tels que le Fort Zoutman et le moulin à vent Bon Bini, ajoutent une atmosphère charmante à la ville.','La fête du carnaval d\'Aruba : Le carnaval d\'Aruba est l\'un des plus grands et des plus longs carnavals des Caraïbes, se déroulant pendant plusieurs semaines entre janvier et mars. Les festivités comprennent des défilés, des danses, des costumes colorés et des concours.'),('AZ',40.1431,47.5769,'Azerbaïdjan','AZE',31,'??','U+1F1E6 U+1F1FF',0,4,44.74292085016418,'L\'Azerbaïdjan, situé à la croisée des continents asiatique et européen, est un pays riche en histoire et en diversité culturelle. Les paysages comprennent des montagnes imposantes du Caucase, des plaines fertiles et la côte de la mer Caspienne. La culture azerbaïdjanaise est imprégnée d\'influences turques et perses, reflétant son histoire mouvementée. En tant que république présidentielle, l\'Azerbaïdjan a évolué depuis son indépendance de l\'Union soviétique, développant son économie grâce aux ressources énergétiques, à l\'industrie pétrochimique et au tourisme.','Les Tapis d\'Azerbaïdjan : L\'art du tapis en Azerbaïdjan remonte à des siècles. Les tapis azerbaïdjanais sont célèbres pour leurs motifs élaborés et leurs couleurs vibrantes. Des programmes de préservation visent à sauvegarder cet art traditionnel, avec des initiatives éducatives pour transmettre les compétences de génération en génération.','La vieille ville de Bakou : La vieille ville de Bakou, inscrite au patrimoine mondial de l\'UNESCO, est un labyrinthe de ruelles pittoresques et de bâtiments historiques. Des projets de restauration ont été entrepris pour préserver ce joyau architectural, permettant aux visiteurs de plonger dans l\'histoire fascinante de l\'Azerbaïdjan.','La mer Caspienne : L\'Azerbaïdjan borde la mer Caspienne, le plus grand lac intérieur du monde. Des initiatives environnementales sont en place pour protéger la biodiversité de cette région, abritant une faune unique et des écosystèmes côtiers.'),('BA',43.9159,17.6791,'Bosnie-Herzégovine','BIH',70,'??','U+1F1E7 U+1F1E6',0,5,32.56671375834077,'La Bosnie-Herzégovine, nichée au cœur des Balkans, est un pays aux multiples facettes, témoignant de son passé complexe. Ses paysages variés comprennent des montagnes majestueuses, des rivières pittoresques et des villes historiques. La richesse culturelle de la Bosnie-Herzégovine découle de ses influences ottomanes, austro-hongroises et slaves. En tant que république parlementaire, elle a traversé des périodes de changements politiques. L\'économie du pays se développe, avec des secteurs tels que le tourisme, l\'industrie et l\'agriculture jouant un rôle clé.','Le Pont de Mostar : Le Pont de Mostar, un site emblématique de l\'architecture ottomane, a été reconstruit après la guerre. Des projets de préservation architecturale maintiennent l\'intégrité de ce pont historique, symbole de la réconciliation à Mostar.','Sarajevo, la capitale : Sarajevo, la capitale de la Bosnie-Herzégovine, est un carrefour culturel. Des projets de restauration ont été entrepris pour préserver les quartiers historiques, les mosquées et les édifices datant de l\'Empire austro-hongrois.','Les pyramides bosniaques : Les pyramides bosniaques, situées près de Visoko, sont un sujet de débat. Des projets archéologiques et de préservation sont en cours pour explorer ces formations, tandis que la controverse entoure leur origine.'),('BB',13.1939,-59.5432,'Barbade','BRB',52,'??','U+1F1E7 U+1F1E7',0,2,28.604809314575803,'La Barbade, située dans les Caraïbes, est une île paradisiaque d\'environ 432 km². Géographiquement, elle se trouve à l\'est de l\'archipel des Antilles, avec des plages de sable blanc et une mer turquoise. La culture barbadienne est influencée par ses racines africaines, britanniques et caribéennes, se manifestant dans la musique, la danse et la cuisine. Sur le plan politique, la Barbade est une monarchie parlementaire indépendante, membre du Commonwealth. Elle a récemment pris la décision historique de devenir une république en novembre 2021, mettant fin à ses liens avec la monarchie britannique. Sur le plan économique, le tourisme est un secteur clé, avec ses magnifiques stations balnéaires attirant des visiteurs du monde entier. L\'île a également développé des secteurs tels que la finance offshore et l\'industrie légère pour diversifier son économie.','Pont du Singe : L\'île de la Barbade abrite un pont étonnant appelé \"Le Pont du Singe\" (Monkey Jump), situé à la réserve naturelle de Welchman Hall Gully. La légende raconte qu\'un singe aurait sauté d\'une branche à l\'autre, créant ainsi une ouverture dans le pont naturel. Cette formation géologique unique est un site pittoresque et une attraction touristique populaire.','Création du Rhum de la Barbade : La Barbade est souvent considérée comme le berceau du rhum. En 1703, un orage a endommagé une cargaison de sucre, laissée à l\'air libre. Pour éviter de perdre la récolte, les habitants ont décidé de distiller le jus fermenté de sucre, donnant ainsi naissance au rhum. Aujourd\'hui, la Barbade est réputée pour ses distilleries de rhum, dont la célèbre Mount Gay Rum, l\'une des plus anciennes du monde.','Crabe Volant de la Barbade : La Barbade abrite une espèce unique de crabes appelée \"crabe volant\" ou \"crabe de cocotier\". Ces crabes terrestres se déplacent en groupe la nuit et sont connus pour grimper dans les arbres, utilisant leurs pinces pour se balancer d\'une branche à l\'autre. Ce spectacle étonnant est particulièrement visible pendant la saison de reproduction.'),('BD',23.685,90.3563,'Bangladesh','BGD',50,'??','U+1F1E7 U+1F1E9',0,4,45.32390837122119,'Bangladesh, situated in South Asia, is a densely populated country with a rich cultural heritage and diverse landscapes. Dhaka, the capital, is a bustling city that reflects the country\'s economic and administrative center. Bangladesh is known for the Ganges Delta, lush greenery, and the world\'s largest river delta. The Sundarbans, a UNESCO World Heritage Site, is home to the Bengal tiger. Politically, Bangladesh is a parliamentary democracy. The economy relies heavily on agriculture, textiles, and the garment industry, making it one of the world\'s largest textile exporters. The population, predominantly Bengali, contributes to a vibrant cultural scene with traditional music, dance, and festivals. Despite economic progress, challenges such as natural disasters and poverty persist. Bangladesh is making strides in areas like microfinance and sustainable development, attracting attention for its resilience and commitment to progress.','Les Sundarbans : Les Sundarbans, le plus grand delta du monde, s\'étendent à travers le Bangladesh et l\'Inde. Cette région est célèbre pour ses mangroves luxuriantes et abrite une faune unique, y compris le tigre du Bengale. Les Sundarbans sont classés au patrimoine mondial de l\'UNESCO et représentent l\'un des écosystèmes les plus riches en biodiversité.','Le Bengali et la Poésie : Le Bengali, la langue officielle du Bangladesh, est l\'une des langues les plus parlées au monde. Le pays a une riche tradition littéraire, avec des poètes renommés tels que Rabindranath Tagore, le premier Asiatique à recevoir le prix Nobel de littérature en 1913.','Le Festival de la Mousson : Le Bangladesh est marqué par des saisons distinctes, dont la mousson qui apporte des pluies abondantes. Le Festival de la Mousson, également connu sous le nom de Pohela Boishakh, célèbre le Nouvel An bengali. Les gens portent des vêtements traditionnels, participent à des défilés et festivités, marquant le début de la saison de croissance.'),('BE',50.5039,4.46994,'Belgique','BEL',56,'??','U+1F1E7 U+1F1EA',0,5,40.80511698574305,'La Belgique, nichée au cœur de l\'Europe occidentale, est un pays aux multiples facettes. Géographiquement, elle partage ses frontières avec la France, l\'Allemagne, les Pays-Bas et le Luxembourg, offrant un mélange de paysages allant des Ardennes vallonnées au nord aux plaines flamandes fertiles. La Belgique est caractérisée par une riche diversité culturelle et linguistique, avec trois communautés principales: flamande, wallonne et germanophone. La culture belge se distingue par son art, sa cuisine délicieuse, ses festivals animés et son patrimoine architectural, notamment à Bruxelles, la capitale de l\'Union européenne. Politiquement, la Belgique est une monarchie constitutionnelle avec un système fédéral complexe, reflétant sa diversité linguistique et culturelle. Sur le plan économique, le pays est un centre financier et logistique majeur, avec une économie diversifiée comprenant des secteurs tels que la chimie, la technologie, l\'industrie automobile et le chocolat, qui est une exportation emblématique. La Belgique est également le siège de nombreuses institutions de l\'Union européenne, renforçant son rôle dans les affaires internationales. Malgré les défis liés à la gouvernance complexe, la Belgique continue de prospérer en tant que nation multiculturelle et dynamique au cœur de l\'Europe.','La Grand-Place de Bruxelles : La Grand-Place, située au cœur de Bruxelles, est une place historique inscrite au patrimoine mondial de l\'UNESCO. Entourée par des bâtiments somptueux datant du XVIIe siècle, la Grand-Place est un exemple exceptionnel de l\'architecture baroque et gothique. Elle est le site de nombreux événements publics, marchés et festivals tout au long de l\'année.','La Bière Belge : La Belgique est célèbre pour sa tradition brassicole, produisant une incroyable variété de bières. Des bières trappistes aux bières d\'abbaye, en passant par les bières fruitées, le pays offre une large gamme de saveurs. Les brasseries belges, certaines ayant une histoire vieille de plusieurs siècles, invitent les visiteurs à déguster et à découvrir la diversité de la bière belge.','Les Processions du Saint-Sang de Bruges : Chaque année, la ville médiévale de Bruges accueille un événement religieux et culturel unique, connu sous le nom de \"Processions du Saint-Sang\". Cette procession, qui a lieu le jour de l\'Ascension, commémore la relique sacrée présumée contenir le sang du Christ. La relique est portée à travers les rues de la ville dans une procession solennelle impliquant des centaines de participants en costumes médiévaux.'),('BF',12.2383,-1.56159,'Burkina Faso','BFA',854,'??','U+1F1E7 U+1F1EB',4,1,68.05386288841615,NULL,NULL,NULL,NULL),('BG',42.7339,25.4858,'Bulgarie','BGR',100,'??','U+1F1E7 U+1F1EC',0,5,17.853966558216108,'La Bulgarie, située dans le sud-est de l\'Europe, est un pays aux charmes variés. Sur le plan géographique, elle offre des paysages diversifiés, comprenant des montagnes majestueuses, des vallées fertiles, et des rives le long de la mer Noire. La culture bulgare est imprégnée d\'une riche histoire, avec des influences thraces, byzantines et ottomanes. La musique, la danse et les festivals folkloriques jouent un rôle important dans la préservation de l\'identité culturelle. Politiquement, la Bulgarie est une république parlementaire, membre de l\'Union européenne depuis 2007. Elle a connu des transitions politiques et économiques depuis la fin du communisme en 1989. L\'économie bulgare est en croissance, avec des secteurs tels que le tourisme, l\'agriculture, l\'industrie légère et les technologies de l\'information contribuant à son développement. Bien que le pays ait fait des progrès significatifs depuis son adhésion à l\'UE, il fait toujours face à des défis liés à la corruption et au développement économique régional.','Patrimoine Mondial de l\'UNESCO : Le Monastère de Rila, fondé au Xe siècle, est le plus grand monastère orthodoxe de Bulgarie et un site classé au patrimoine mondial de l\'UNESCO. Niché dans les montagnes de Rila, il est renommé pour ses fresques colorées, son architecture médiévale et son ambiance spirituelle.','Festival de la Rose : La Bulgarie est l\'un des plus grands producteurs mondiaux d\'huile de rose, extraite des pétales de la rose de Kazanlak. Chaque année en juin, la ville de Kazanlak célèbre la récolte des roses avec un festival traditionnel. Les visiteurs peuvent participer à la cueillette des roses et apprendre le processus d\'extraction de l\'huile.','Les Tombeaux de Thracie : La Bulgarie est riche en sites archéologiques, notamment les tombeaux de la civilisation thrace. Le complexe de tombeaux de Thracie à Kazanlak, également inscrit au patrimoine mondial de l\'UNESCO, présente des fresques exceptionnelles et des objets funéraires de grande valeur.'),('BH',25.9304,50.6378,'Bahreïn','BHR',48,'??','U+1F1E7 U+1F1ED',0,4,85.1082471991966,'Bahreïn, un petit royaume insulaire situé dans le golfe Persique, est connu pour son mélange de modernité et de tradition. Géographiquement, l\'archipel de Bahreïn se compose de 33 îles, dont les plus grandes sont Bahreïn, Muharraq, et Hawar. La culture de Bahreïn est influencée par l\'islam, la péninsule arabique et des siècles de commerce et de contacts culturels. La population est diversifiée, avec une majorité de Bahreïnis, mais aussi une communauté expatriée importante. Politiquement, Bahreïn est un royaume constitutionnel avec un roi et un parlement. Sur le plan économique, le pays a historiquement dépendu du pétrole, mais il a travaillé à diversifier son économie en développant des secteurs tels que la finance, le tourisme et les technologies de l\'information. Bahreïn a également été un centre commercial important dans la région. Malgré sa prospérité économique, Bahreïn a connu des tensions politiques internes, en particulier liées aux droits de l\'homme et à la représentation politique. Le pays cherche à équilibrer sa modernisation avec le respect des traditions et des valeurs culturelles.','L\'archéologie à Qal\'at al-Bahrain : Qal\'at al-Bahrain, également connu sous le nom de Fort de Bahreïn, est un site archéologique majeur qui remonte à l\'Antiquité. Il témoigne de l\'histoire riche de Bahreïn, avec des vestiges remontant à différentes époques, dont des ruines d\'un fort portugais.','La perle de Bahreïn : Historiquement, Bahreïn était réputé pour ses perles de qualité exceptionnelle. Bien que l\'industrie perlière ait décliné au fil des ans, la perle reste un symbole culturel important. Le musée de la perle de Bahreïn met en valeur cette histoire perlière.','Le pont du Roi Fahd : Le pont du Roi Fahd, reliant Bahreïn à l\'Arabie saoudite, est l\'un des plus longs ponts du monde, couvrant environ 25 kilomètres. Il facilite les déplacements entre les deux pays et est un symbole de la coopération régionale.'),('BI',-3.37306,29.9189,'Burundi','BDI',108,'??','U+1F1E7 U+1F1EE',0,1,71.97933939469917,'Le Burundi, un petit pays enclavé d\'Afrique de l\'Est, est caractérisé par ses collines verdoyantes et ses lacs pittoresques. La culture burundaise est profondément enracinée dans les traditions africaines, avec des influences historiques issues de la colonisation allemande et belge. La population burundaise est principalement composée de Hutus et de Tutsis, coexistants dans un paysage ethniquement diversifié. Politiquement, le Burundi est une république présidentielle multipartite, ayant connu des périodes d\'instabilité politique, notamment pendant la guerre civile qui a pris fin en 2006. Sur le plan économique, l\'agriculture occupe une place prépondérante, avec la culture du café et du thé en tant que principales sources de revenus. Cependant, le pays fait face à des défis tels que la pauvreté, les tensions ethniques persistantes et des problèmes liés à la gouvernance. Le Burundi travaille à renforcer sa stabilité politique et à promouvoir le développement socio-économique pour améliorer les conditions de vie de sa population.','Le lac Tanganyika : Le Burundi partage le lac Tanganyika, l\'un des plus grands lacs d\'eau douce au monde, avec la Tanzanie, la République démocratique du Congo, et la Zambie. Le lac Tanganyika est réputé pour ses eaux cristallines et sa biodiversité unique.','La colline de Gishora : La colline de Gishora est célèbre pour ses tambours royaux sacrés. Ces tambours ont une signification culturelle et spirituelle importante, étant utilisés lors de cérémonies royales et rituelles. La colline de Gishora est un site historique et culturel majeur au Burundi.','Le marché central de Bujumbura : Le marché central de Bujumbura, la capitale du Burundi, offre une expérience vibrante et animée. Les marchands vendent une variété de produits locaux, des fruits et légumes aux tissus colorés. C\'est un endroit où les habitants et les visiteurs se rencontrent pour échanger et découvrir la vie quotidienne burundaise.'),('BJ',9.30769,2.31583,'Bénin','BEN',204,'??','U+1F1E7 U+1F1EF',4,1,4.571958449270538,'Le Bénin, situé en Afrique de l\'Ouest, est caractérisé par une diversité géographique allant des plaines côtières aux collines du centre du pays. La culture béninoise est riche et imprégnée de traditions vaudou, qui coexistent harmonieusement avec l\'influence des religions africaines, chrétiennes et musulmanes. Politiquement, le Bénin est une démocratie multipartite, ayant connu une transition pacifique vers un régime démocratique dans les années 1990. Le pays est salué pour ses efforts en faveur de la stabilité politique et de la bonne gouvernance. Sur le plan économique, l\'agriculture joue un rôle essentiel dans l\'économie béninoise, avec une diversification croissante vers le secteur des services. Des défis subsistent, tels que la pauvreté et l\'accès limité à l\'éducation, mais le Bénin travaille à renforcer son développement économique et social.','Le berceau du vaudou : Le Bénin est souvent considéré comme le berceau du vaudou, une religion animiste qui a évolué à partir des traditions religieuses africaines. Les adeptes du vaudou croient en un Dieu suprême et en une multitude de divinités intermédiaires. Le vaudou joue un rôle important dans la culture béninoise, avec des festivals et des cérémonies qui lui sont dédiés.','La biodiversité du parc national de la Pendjari : Le parc national de la Pendjari, situé dans le nord du Bénin, est reconnu pour sa biodiversité exceptionnelle. Il abrite une variété d\'animaux sauvages, notamment des éléphants, des lions, des léopards et des antilopes. Le parc est un lieu prisé pour le safari et l\'observation de la faune.','Les palais royaux d\'Abomey : Abomey, ancienne capitale du royaume du Dahomey (actuel Bénin), abrite les palais royaux d\'Abomey, classés au patrimoine mondial de l\'UNESCO. Ces palais témoignent de l\'histoire riche et complexe de la région, marquée par la puissance du royaume du Dahomey au cours des XVIIe et XIXe siècles.'),('BM',32.3214,-64.7574,'Bermudes','BMU',60,'??','U+1F1E7 U+1F1F2',0,2,6.921777135619686,'Les Bermudes, situées dans l\'océan Atlantique, sont un territoire britannique d\'outre-mer réputé pour ses plages de sable rose et ses eaux cristallines. Bien que géographiquement petites, elles ont une influence économique significative en tant que centre financier international. Les Bermudes, avec leur charme insulaire, offrent une culture mêlant traditions britanniques et influences locales. Le climat agréable et la diversité marine font de cet archipel un lieu prisé pour la voile et la plongée.','Le Triangle des Bermudes : Les Bermudes sont célèbres pour le mystérieux Triangle des Bermudes, une région de l\'océan Atlantique associée à des disparitions mystérieuses. Bien que de nombreuses théories existent, le mystère persiste. Les scientifiques mènent des recherches pour comprendre les phénomènes inhabituels, ajoutant une dimension intrigante à cette région.','La Baie de Horseshoe : La Baie de Horseshoe, avec son sable rose distinctif, est l\'une des plages emblématiques des Bermudes. Malgré son apparence paradisiaque, des efforts de préservation environnementale sont déployés pour maintenir la beauté naturelle de cette baie. Des initiatives éducatives sensibilisent également les visiteurs à la protection des écosystèmes marins.','L\'architecture colorée de St. George : La ville de St. George, classée au patrimoine mondial de l\'UNESCO, est connue pour son architecture coloniale colorée. Des projets de restauration ont été entrepris pour préserver ces bâtiments historiques, transportant les visiteurs dans le temps pour découvrir le riche passé des Bermudes.'),('BN',4.53528,114.728,'Brunei','BRN',96,'??','U+1F1E7 U+1F1F3',0,4,20.893013403651317,'Le Brunei, situé sur l\'île de Bornéo en Asie du Sud-Est, est un petit État souverain enclavé par la Malaisie. Ce sultanat est connu pour sa richesse en ressources naturelles, en particulier le pétrole et le gaz naturel. Géographiquement, le Brunei offre des forêts tropicales, des plages immaculées et une diversité écologique. La culture bruneienne est influencée par les traditions malaises, islamiques et la royauté héréditaire. La majorité de la population est musulmane, et la pratique de l\'islam a une influence significative sur la vie quotidienne et la culture. Politiquement, le Brunei est une monarchie absolue dirigée par le sultan Hassanal Bolkiah depuis 1967. Sur le plan économique, le secteur de l\'énergie, en particulier le pétrole et le gaz, domine l\'économie, faisant du Brunei l\'un des pays les plus riches d\'Asie. Le gouvernement travaille également à diversifier l\'économie en développant d\'autres secteurs tels que le tourisme, l\'agriculture et les industries manufacturières. Malgré sa prospérité économique, le Brunei fait face à des enjeux tels que la dépendance aux ressources énergétiques et la nécessité de promouvoir la diversification économique pour assurer une croissance à long terme.','Le Kampong Ayer : Le Kampong Ayer, situé dans la capitale Bandar Seri Begawan, est l\'un des plus grands villages flottants du monde. Il est construit sur pilotis au-dessus de la rivière Brunei et offre un aperçu unique de la vie traditionnelle dans cette région.','Le Palais du Sultan Omar Ali Saifuddien : Ce magnifique palais royal est l\'un des sites emblématiques de Brunei. Doté d\'une architecture islamique et de dômes dorés, le palais est entouré de jardins luxuriants et d\'un lagon artificiel.','La richesse pétrolière : Brunei est l\'un des plus grands producteurs de pétrole au monde. Les revenus pétroliers ont contribué de manière significative à l\'économie du pays et ont permis d\'assurer un niveau de vie élevé pour ses citoyens.'),('BO',-16.2902,-63.5887,'Bolivie','BOL',68,'??','U+1F1E7 U+1F1F4',0,3,83.69973868476202,'La Bolivie, située en Amérique du Sud, est un pays enclavé connu pour ses hautes altitudes, ses paysages variés allant des Andes aux plaines de l\'Amazonie. La culture bolivienne est influencée par les civilisations anciennes telles que les Incas. En tant que république démocratique, la Bolivie a vécu des périodes de changements politiques et sociaux. Son économie repose sur l\'agriculture, les ressources naturelles et le tourisme, attirant les voyageurs avec ses festivals colorés et ses sites archéologiques.','Le Salar d\'Uyuni : Le Salar d\'Uyuni, le plus grand désert de sel du monde en Bolivie, est une merveille naturelle étincelante. Malgré sa robustesse, des initiatives écologiques sont en place pour minimiser l\'impact environnemental du tourisme croissant dans cette région unique.','La Fête de l\'Inti Raymi : La Bolivie célèbre la Fête de l\'Inti Raymi, un événement coloré honorant le dieu soleil inca. Des danses vibrantes, des costumes traditionnels et des rituels ancestraux font partie de cette célébration culturelle. Des projets de préservation veillent à la transmission de ces pratiques culturelles.','Les Missions jésuites : Les Missions jésuites de Chiquitos en Bolivie représentent un trésor d\'architecture baroque. Des efforts de restauration ont été entrepris pour préserver ces églises du XVIIIe siècle, offrant aux visiteurs une plongée dans l\'histoire religieuse et artistique de la région.'),('BR',-14.235,-51.9253,'Brésil','BRA',76,'??','U+1F1E7 U+1F1F7',0,3,55.81965628622068,'Le Brésil, le plus grand pays d\'Amérique du Sud, est une nation aux multiples facettes, caractérisée par une diversité géographique, culturelle et ethnique remarquable. Les vastes forêts amazoniennes, les plages exotiques, les hauts plateaux, et les grandes métropoles comme Rio de Janeiro et São Paulo contribuent à la variété des paysages. Culturellement, le Brésil est influencé par ses racines autochtones, africaines, européennes et d\'autres origines immigrantes, créant une mosaïque unique de traditions, de danses, et de musiques, avec le carnaval de Rio comme manifestation emblématique. Politiquement, le Brésil est une république fédérative démocratique. Sur le plan économique, il possède l\'une des économies les plus importantes du monde, avec des secteurs tels que l\'agriculture, l\'industrie, et les services. Cependant, le pays fait face à des défis tels que des inégalités sociales, des problèmes environnementaux liés à la déforestation en Amazonie, et des questions de gouvernance. Malgré ces défis, le Brésil reste un acteur majeur sur la scène mondiale, avec une influence culturelle, économique et environnementale significative.','L\'Amazonie, poumon de la Terre : Le Brésil abrite la plus grande partie de l\'Amazonie, la plus grande forêt tropicale du monde. Souvent surnommée \"le poumon de la Terre\", l\'Amazonie est d\'une importance cruciale pour la biodiversité mondiale et la régulation climatique.','Le Carnaval de Rio de Janeiro : Le Carnaval de Rio est l\'un des plus grands et des plus célèbres carnavals du monde. Chaque année, des millions de personnes participent aux festivités, avec des défilés colorés, des danses, des costumes extravagants et une énergie festive unique.','Le Christ Rédempteur : L\'emblématique statue du Christ Rédempteur, perchée au sommet du mont du Corcovado à Rio de Janeiro, est l\'une des Sept Merveilles du Monde Moderne. Elle offre une vue panoramique spectaculaire sur la ville et est un site touristique majeur.'),('BS',25.0343,-77.3963,'Bahamas','BHS',44,'??','U+1F1E7 U+1F1F8',0,2,27.99906845018181,'Les Bahamas, un archipel paradisiaque situé dans l\'océan Atlantique, offrent un paysage tropical de plages de sable blanc, de lagunes turquoises et de récifs coralliens. Géographiquement, cet ensemble d\'îles se trouve au nord de Cuba et de la Floride. La culture des Bahamas est influencée par une combinaison d\'héritages africains, britanniques et autochtones, ce qui se reflète dans la musique, la danse, l\'artisanat et la cuisine. Politiquement, les Bahamas sont une monarchie parlementaire indépendante, membre du Commonwealth. L\'économie repose principalement sur le tourisme, avec des visiteurs attirés par les plages idylliques, la plongée sous-marine et les activités nautiques. Les services financiers offshore constituent également une part importante de l\'économie bahaméenne. Cependant, le pays est confronté à des défis tels que la vulnérabilité aux ouragans et la nécessité de maintenir une gestion durable de son écosystème marin.','Les Plages de Sable Rose : Les Bahamas sont réputées pour leurs plages de sable rose, un phénomène naturel dû à la présence de minuscules fragments de coraux et de coquillages mélangés au sable blanc. Harbour Island est particulièrement célèbre pour ses plages de sable rose.','Les Exumas et les Pigs nageurs : L\'archipel des Exumas abrite une attraction unique, les célèbres \"Pigs nageurs\". Sur l\'île de Big Major Cay, des cochons sauvages vivent sur la plage et se sont habitués à nager dans les eaux environnantes. C\'est devenu une attraction populaire pour les visiteurs.','L\'Île de Nassau : Nassau, la capitale des Bahamas, est située sur l\'île de New Providence. La ville est imprégnée d\'histoire pirate et coloniale, avec des sites tels que le Fort Fincastle, le Queen\'s Staircase, et le célèbre marché de la paille.'),('BT',27.5142,90.4336,'Bhoutan','BTN',64,'??','U+1F1E7 U+1F1F9',0,4,72.53637646561151,'Le Bhoutan, niché dans l\'Himalaya oriental, est un royaume montagneux qui offre une expérience unique sur le plan géographique, culturel et politique. Géographiquement, le pays est caractérisé par des vallées profondes, des pics enneigés et des forêts denses. La culture bhoutanaise est fortement influencée par le bouddhisme, avec des monastères majestueux, des danses sacrées et une architecture traditionnelle distincte appelée dzong. Sur le plan politique, le Bhoutan est une monarchie constitutionnelle, marquée par le concept de \"Bonheur National Brut\" (BNB), une mesure du bien-être et de la prospérité au-delà du PIB. Le pays a adopté une approche résolument écologique, préservant son environnement naturel et favorisant le développement durable. L\'économie bhoutanaise est dominée par l\'agriculture, le tourisme éco-responsable et l\'exploitation durable des ressources naturelles. Bien que relativement isolé, le Bhoutan continue d\'attirer l\'attention pour son engagement envers la préservation culturelle et environnementale, ainsi que pour sa perspective unique sur le progrès et le bonheur.','Le Festival de Paro Tsechu : Les festivals tels que le Paro Tsechu sont des événements culturels majeurs au Bhoutan. Le Tsechu de Paro célèbre la naissance du fondateur du bouddhisme au Bhoutan, Guru Rinpoche. Les habitants se réunissent pour des danses masquées, des performances artistiques et des cérémonies religieuses colorées.','Les Dzongs, forteresses monastiques : Les dzongs sont des structures architecturales emblématiques du Bhoutan. Ces forteresses monastiques servent de centres religieux, administratifs et sociaux. Le dzong de Paro, par exemple, est particulièrement impressionnant avec ses murs massifs, ses tours et ses peintures murales détaillées.','L\'Indice de Bonheur National Brut : Le Bhoutan est célèbre pour avoir introduit l\'Indice de Bonheur National Brut (IBNB) en tant que mesure du bien-être national, allant au-delà du simple PIB. Cet indice prend en compte des facteurs tels que le bonheur, la santé, l\'éducation, et la protection de l\'environnement pour évaluer le progrès du pays.'),('BW',-22.3285,24.6849,'Botswana','BWA',72,'??','U+1F1E7 U+1F1FC',0,1,78.68468005087662,'Le Botswana, joyau de l\'Afrique australe, fascine par ses vastes paysages désertiques du Kalahari et le majestueux delta de l\'Okavango. Politiquement stable depuis son indépendance en 1966, le pays affiche une démocratie florissante et une économie prospère, notamment grâce à l\'exploitation minière des diamants, au tourisme et à l\'agriculture. La richesse culturelle, dominée par le groupe ethnique Tswana, contribue à l\'unicité du Botswana. Célèbre pour sa politique de préservation de la faune, le Botswana attire les amateurs de safari, offrant une expérience inoubliable au cœur de la nature sauvage africaine, tout en incarnant un modèle de développement réussi sur le continent.','Le Delta de l\'Okavango : Le Delta de l\'Okavango est le plus grand delta intérieur du monde, une oasis luxuriante au cœur du désert du Kalahari. Chaque année, les inondations saisonnières transforment le paysage, créant des voies navigables et attirant une abondance de vie sauvage. Les visiteurs peuvent explorer cette région unique en pirogue mokoro pour une expérience exceptionnelle de safari aquatique.','La Migration des Éléphants de Chobe : Le Parc national de Chobe est réputé pour abriter l\'une des plus grandes populations d\'éléphants d\'Afrique. Chaque année, des milliers d\'éléphants parcourent des centaines de kilomètres à la recherche de nourriture et d\'eau. Les rives du fleuve Chobe offrent des spectacles impressionnants de ces majestueux géants de la savane.','Les San Bushmen et le Kalahari : Les San Bushmen, peuple autochtone du Botswana, ont une histoire riche et une connexion profonde avec le désert du Kalahari. Les visiteurs peuvent participer à des excursions guidées avec les San pour en apprendre davantage sur leurs traditions de chasse, leurs compétences de survie, et leur connaissance intime du désert.'),('BY',53.7098,27.9534,'Biélorussie','BLR',112,'??','U+1F1E7 U+1F1FE',0,5,75.81427393091309,'La Biélorussie, un pays enclavé en Europe de l\'Est, est caractérisée par ses vastes étendues de forêts, ses lacs pittoresques et son histoire marquée par diverses influences culturelles. Minsk, la capitale, conserve des éléments architecturaux soviétiques tout en exhibant une modernité croissante. Politiquement, la Biélorussie est souvent associée à une gouvernance autoritaire. L\'économie du pays repose principalement sur l\'industrie manufacturière, l\'agriculture et les services. La population biélorusse, majoritairement composée de Biélorusses ethniques, témoigne d\'une identité nationale forte. Ces dernières années, la Biélorussie a attiré l\'attention internationale en raison de développements politiques et de manifestations populaires, reflétant les enjeux complexes auxquels le pays est confronté.','Le Château de Mir : Le Château de Mir, classé au patrimoine mondial de l\'UNESCO, est une merveille architecturale située à Mir. Construit au XVIe siècle, le château est un exemple de l\'architecture féodale biélorusse avec des influences gothiques, Renaissance et baroques. Il a survécu à travers les siècles, témoignant de l\'histoire mouvementée de la région.','Les Marais de Białowieża : La Biélorussie partage avec la Pologne la forêt de Białowieża, la plus grande forêt ancienne d\'Europe et un site classé au patrimoine mondial de l\'UNESCO. Cette région abrite une faune diversifiée, y compris le bison d\'Europe, une espèce emblématique qui a été préservée avec succès dans la forêt.','Le Mémorial de l\'Holocauste à Minsk : Le Mémorial de l\'Holocauste à Minsk commémore les victimes juives du régime nazi. Il se compose de sculptures émouvantes et de plaques commémoratives, rappelant les horreurs de la Seconde Guerre mondiale. C\'est un lieu poignant qui invite à la réflexion sur l\'histoire douloureuse de la région.'),('BZ',17.1899,-88.4977,'Belize','BLZ',84,'??','U+1F1E7 U+1F1FF',0,2,43.01733257530009,'Le Belize, situé en Amérique centrale sur la côte est de la mer des Caraïbes, partage ses frontières avec le Mexique au nord, le Guatemala à l\'ouest et le sud. Géographiquement, le Belize offre une diversité de paysages, allant de la forêt tropicale humide à la côte parsemée de récifs coralliens le long de la deuxième plus grande barrière de corail du monde. Culturellement, le pays est le résultat d\'un mélange fascinant d\'influences mayas, créoles, garifunas, mennonites et britanniques. Cette diversité se reflète dans la langue, la cuisine, la musique et les traditions artistiques. Politiquement, le Belize est une monarchie parlementaire avec la reine du Royaume-Uni comme chef d\'État, mais il est également membre du Commonwealth. Sur le plan économique, le tourisme joue un rôle essentiel, attirant des visiteurs avec ses sites archéologiques mayas, ses réserves naturelles et ses plages. L\'agriculture, la pêche et l\'industrie pétrolière contribuent également à l\'économie du Belize. Le pays accorde une grande importance à la préservation de son environnement naturel unique.','La Grande Barrière de Corail du Belize : Le Belize abrite la deuxième plus grande barrière de corail au monde, après celle de l\'Australie. Cette merveille naturelle attire les plongeurs du monde entier avec ses eaux cristallines, sa vie marine colorée et ses formations de corail spectaculaires.','La diversité culturelle : Malgré sa petite taille, le Belize est incroyablement diversifié sur le plan culturel. La population est composée de différentes communautés, notamment des Mayas, des Créoles, des Garifunas, des Mestizos et des Mennonites, chacune apportant ses propres traditions, langues et coutumes au mélange culturel du pays.','Actun Tunichil Muknal (ATM) : L\'ATM est une grotte sacrée maya dans le réseau des grottes du Belize. Utilisée à des fins cérémonielles par les anciens Mayas, elle renferme des artefacts et des restes humains cristallisés, offrant aux visiteurs une plongée fascinante dans l\'histoire et la spiritualité de cette civilisation'),('CA',56.1304,-106.347,'Canada','CAN',124,'??','U+1F1E8 U+1F1E6',0,2,87.64384415712566,'Le Canada, le deuxième plus grand pays du monde, est connu pour ses vastes paysages, des forêts boréales à l\'Arctique en passant par les montagnes majestueuses et les plaines infinies. La culture canadienne est caractérisée par sa diversité, reflétant l\'influence des peuples autochtones, des colons européens et des vagues d\'immigrants. En tant que monarchie constitutionnelle, le Canada a une stabilité politique remarquable. Son économie prospère repose sur les ressources naturelles, l\'industrie, la technologie et les services.','Les parcs nationaux du Canada : Le Canada abrite des parcs nationaux spectaculaires, dont Banff et Jasper. Des efforts de conservation environnementale visent à préserver la beauté naturelle de ces espaces, offrant aux visiteurs des paysages variés et préservés.','La Ville historique de Québec : La Ville historique de Québec, un site du patrimoine mondial de l\'UNESCO, est un trésor d\'histoire et d\'architecture. Des projets de restauration préservent les rues pavées, les fortifications et les bâtiments historiques.','La tradition des Premières Nations : Les traditions des Premières Nations au Canada, incluant l\'art, la musique et les rituels, sont des éléments essentiels de la culture canadienne. Des initiatives éducatives et culturelles cherchent à préserver et célébrer ces riches héritages.'),('CD',-4.03833,21.7587,'Congo (RDC)','COD',180,'??','U+1F1E8 U+1F1E9',4,1,9.167226133092516,'La République démocratique du Congo (RDC), située en Afrique centrale, est un pays vaste et diversifié, renfermant des richesses naturelles et une histoire complexe. Kinshasa, la capitale, reflète l\'énergie de la vie urbaine africaine. Le pays est traversé par le fleuve Congo, abritant une partie de la forêt équatoriale et le parc national de Virunga. Politiquement, la RDC est une république en transition, marquée par des défis liés à la stabilité. L\'économie repose sur l\'agriculture, l\'exploitation minière et l\'industrie pétrolière. La population congolaise est constituée de nombreuses ethnies, chacune contribuant à la richesse culturelle du pays. La RDC est également connue pour sa musique, son art, ses danses traditionnelles, mais fait face à des défis tels que les conflits armés et la pauvreté. Malgré ces enjeux, la RDC conserve un potentiel considérable en tant que nation riche en ressources et culturellement diversifiée.','Le Fleuve Congo : Le Congo est traversé par le deuxième plus grand fleuve du monde, le fleuve Congo. Il offre non seulement une voie cruciale pour le transport fluvial, mais également des paysages spectaculaires. Les chutes de Boyoma, également connues sous le nom de chutes Wagenia, sont une série impressionnante de chutes situées sur le fleuve.','Le Parc National des Virunga : Le Parc National des Virunga est le plus ancien parc national d\'Afrique, célèbre pour sa diversité biologique exceptionnelle, y compris les gorilles de montagne. Le parc a été déclaré site du patrimoine mondial de l\'UNESCO et est le foyer du lac volcanique le plus profond d\'Afrique, le lac Kivu.','La Musique Congolaise : La RDC est renommée pour sa scène musicale dynamique, en particulier la rumba congolaise et le soukous. Des artistes légendaires tels que Franco Luambo et Tabu Ley Rochereau ont contribué à populariser la musique congolaise, qui a influencé de nombreux genres musicaux africains.'),('CF',6.61111,20.9394,'République centrafricaine','CAF',140,'??','U+1F1E8 U+1F1EB',3,1,82.90460126745012,'La République centrafricaine (RCA), située au cœur de l\'Afrique, est caractérisée par sa position géographique enclavée et sa diversité géographique, allant des forêts denses aux savanes. La culture de la RCA est marquée par la richesse de ses traditions, avec une diversité ethnique comprenant des groupes tels que les Banda, Gbaya, et les Peuls. Sur le plan politique, la RCA a connu des périodes d\'instabilité et de conflits, mais elle aspire à la stabilité et à la démocratie. L\'économie est largement basée sur l\'agriculture, bien que le pays soit doté de ressources minières importantes. Les défis tels que la pauvreté, les tensions ethniques et les problèmes de gouvernance ont été des aspects complexes de son histoire récente. La communauté internationale soutient les efforts visant à restaurer la stabilité et le développement en RCA, soulignant l\'importance de la coopération internationale pour relever les défis socio-économiques et politiques.','La Forêt Équatoriale : La République centrafricaine abrite l\'une des plus vastes étendues de forêt équatoriale en Afrique. Cette forêt dense et diversifiée abrite une riche biodiversité, y compris des espèces emblématiques telles que les éléphants de forêt, les gorilles, et une variété de singes et d\'oiseaux. Pour les amateurs de nature et d\'aventure, explorer la forêt équatoriale offre une expérience unique au cœur de la biodiversité africaine.','Le Parc National de Bamingui-Bangoran : Ce parc national, situé dans le nord du pays, est l\'un des parcs les moins fréquentés mais les plus remarquables de la République centrafricaine. Il offre une occasion exceptionnelle d\'observer la faune sauvage, y compris des éléphants, des lions, des girafes et une variété d\'antilopes. Les vastes paysages et la tranquillité du parc en font un lieu idéal pour les amateurs de safari à la recherche d\'une expérience authentique.','La Cathédrale Notre-Dame de l\'Immaculée Conception : À Bangui, la capitale, se trouve la cathédrale Notre-Dame de l\'Immaculée Conception, un exemple impressionnant de l\'architecture catholique. Construite en 1891, la cathédrale est un lieu de culte important et un site touristique notable. Sa façade imposante, ses vitraux colorés et son histoire font de la cathédrale un lieu d\'intérêt culturel et religieux.'),('CG',-0.228021,15.8277,'Congo (République)','COG',178,'??','U+1F1E8 U+1F1EC',0,1,87.02133101133754,'La République du Congo, située en Afrique centrale, est caractérisée par une topographie diversifiée comprenant des forêts équatoriales, des plaines côtières et des massifs montagneux. La culture congolaise est riche et diversifiée, reflétant l\'héritage des nombreuses ethnies présentes, notamment les Bantous, les Pygmées et les Mbochis. La musique congolaise, en particulier la rumba et le soukous, est renommée à l\'échelle internationale. Politiquement, le pays est une république multipartite, bien que son histoire ait été marquée par des périodes d\'instabilité. Sur le plan économique, le Congo dépend fortement des ressources naturelles, en particulier du pétrole, du bois et des minéraux. Cependant, la diversification économique est un défi, tout comme la lutte contre la pauvreté et la promotion du développement durable. Malgré ces défis, le Congo joue un rôle clé dans la région et continue de travailler à renforcer sa stabilité politique et à stimuler son développement socio-économique.','La diversité ethnique et culturelle : La République du Congo est caractérisée par une riche diversité ethnique, avec plus de 60 groupes ethniques différents. Chaque groupe a ses propres traditions, langues et coutumes, contribuant à la mosaïque culturelle du pays.','Le fleuve Congo : Le Congo est traversé par le fleuve Congo, le deuxième plus long fleuve d\'Afrique. Il est un élément crucial de la vie quotidienne, de la biodiversité et du transport dans la région. Les célèbres chutes de Boyoma, également appelées chutes de Stanley, sont une caractéristique notable du fleuve.','Le Chemin de fer Congo-Océan : Le Congo possède un chemin de fer historique appelé le Chemin de fer Congo-Océan, construit pendant la période coloniale française. Il relie la ville côtière de Pointe-Noire à Brazzaville à l\'intérieur des terres, offrant une perspective unique sur le paysage congolais.'),('CH',46.8182,8.22751,'Suisse','CHE',756,'??','U+1F1E8 U+1F1ED',0,5,86.39285432770183,'La Suisse, située au cœur de l\'Europe, est un pays montagneux renommé pour sa stabilité politique, son système financier solide et ses paysages pittoresques. Enclavée entre la France, l\'Allemagne, l\'Italie et l\'Autriche, la Suisse ne fait pas partie de l\'Union européenne mais entretient des relations étroites avec celle-ci. Sa diversité culturelle se reflète dans ses quatre langues officielles : l\'allemand, le français, l\'italien et le romanche. Les villes suisses, telles que Zurich, Genève et Berne, sont des centres économiques dynamiques, tandis que les Alpes offrent des opportunités pour le tourisme et les sports d\'hiver. Politiquement neutre depuis le 19e siècle, la Suisse est réputée pour son rôle de médiateur dans les affaires internationales. Son économie prospère repose sur la finance, la haute technologie, l\'industrie pharmaceutique et la fabrication de précision, contribuant à en faire l\'une des économies les plus prospères au monde.','Le Pont de la Chapelle : À Lucerne, le Pont de la Chapelle (Kapellbrücke) est un pont en bois datant du XIVe siècle. Il est l\'un des plus anciens ponts en bois d\'Europe et est orné d\'une tour médiévale. Ce pont pittoresque est devenu un symbole emblématique de la ville et offre une vue magnifique sur le lac des Quatre-Cantons.','Les Horlogers de Genève : La Suisse est célèbre pour son industrie horlogère de renommée mondiale. À Genève, vous pouvez visiter le Musée Patek Philippe pour découvrir l\'histoire fascinante de l\'horlogerie suisse. Ce musée abrite une collection exceptionnelle de montres et de garde-temps, témoignant du savoir-faire artisanal et de l\'innovation qui ont fait la renommée de l\'horlogerie suisse.','Les Bains Thermaux de Vals : Les Bains Thermaux de Vals, conçus par l\'architecte suisse Peter Zumthor, sont une œuvre d\'art architecturale et une destination thermale unique. Nichés au cœur des Alpes suisses, ces bains thermaux modernes sont construits en utilisant des pierres locales. L\'expérience de se baigner dans ces eaux thermales tout en admirant le paysage montagneux est à la fois relaxante et inspirante.'),('CI',7.53999,-5.54708,'Côte d´Ivoire','CIV',384,'??','U+1F1E8 U+1F1EE',4,1,70.90028167786103,NULL,NULL,NULL,NULL),('CL',-35.6751,-71.543,'Chili','CHL',152,'??','U+1F1E8 U+1F1F1',0,3,95.32284847956416,'Le Chili, un pays d\'Amérique du Sud, s\'étend le long de la côte ouest du continent, bordé par l\'océan Pacifique à l\'ouest, les Andes à l\'est, le désert d\'Atacama au nord et la Patagonie au sud. Géographiquement diversifié, le Chili offre une variété de paysages allant des montagnes majestueuses aux vastes déserts et aux fjords spectaculaires. La culture chilienne est influencée par un mélange de traditions indigènes, espagnoles et européennes. Politiquement, le Chili est une république présidentielle démocratique. Le pays a connu des périodes d\'instabilité politique, notamment sous la dictature militaire de Pinochet, qui a pris fin en 1990. Sur le plan économique, le Chili possède l\'une des économies les plus stables d\'Amérique du Sud, avec une forte dépendance aux exportations, en particulier le cuivre. Le pays fait face à des défis tels que les inégalités sociales et la nécessité de diversifier son économie. Le Chili est également reconnu pour ses progrès dans les énergies renouvelables et la préservation de l\'environnement. Malgré les défis, le Chili demeure un acteur clé sur la scène régionale et internationale.','La Cordillère des Andes : Le Chili est le pays le plus étroit du monde, s\'étendant sur une grande partie de la côte ouest de l\'Amérique du Sud. Une caractéristique remarquable est la présence de la Cordillère des Andes qui traverse le pays, offrant des paysages montagneux spectaculaires et abritant le point le plus élevé d\'Amérique du Sud, l\'Aconcagua.','L\'île de Pâques : Le Chili est le pays d\'origine de l\'île de Pâques, située dans le Pacifique Sud. Célèbre pour ses mystérieuses statues de pierre monolithiques appelées Moaï, l\'île de Pâques est un site archéologique fascinant et un lieu d\'une grande importance culturelle.','Le désert d\'Atacama : Le désert d\'Atacama, l\'un des déserts les plus arides du monde, se trouve au nord du Chili. Ses vastes étendues de sel, de canyons et de formations rocheuses offrent un paysage unique. Il abrite également des observatoires astronomiques de renommée mondiale en raison de ses conditions atmosphériques idéales.'),('CM',7.36972,12.3547,'Cameroun','CMR',120,'??','U+1F1E8 U+1F1F2',4,1,63.91340043760222,NULL,NULL,NULL,NULL),('CN',35.8617,104.195,'China','CHN',156,'??','U+1F1E8 U+1F1F3',0,4,33.59845982268309,NULL,NULL,NULL,NULL),('CO',4.57087,-74.2973,'Colombie','COL',170,'??','U+1F1E8 U+1F1F4',2,3,76.25210087397332,'La Colombie, située en Amérique du Sud, est un pays aux paysages variés, allant des plages tropicales de la mer des Caraïbes aux pics enneigés des Andes et à la forêt amazonienne. Géographiquement diversifiée, la Colombie offre une riche biodiversité. Culturellement, le pays est le résultat de l\'influence indigène, espagnole et africaine, créant une mosaïque de traditions, de musique, de danse et de coutumes. La salsa et la cumbia sont des genres musicaux populaires en Colombie. Politiquement, la Colombie est une république présidentielle, ayant surmonté des décennies de conflits internes avec les groupes rebelles. Le pays a connu une période de stabilité politique et économique croissante au cours des dernières années. Sur le plan économique, la Colombie dispose de ressources naturelles abondantes, telles que le café, le pétrole et l\'émergence de secteurs tels que le tourisme. Cependant, des défis subsistent, notamment en matière d\'inégalités sociales et de développement régional. La Colombie continue de travailler à consolider ses succès et à renforcer son rôle en tant que leader régional en Amérique du Sud.','La Ciudad Perdida (Cité Perdue) : La Ciudad Perdida est une ancienne cité précolombienne cachée dans la jungle de la Sierra Nevada de Santa Marta. Datant d\'environ 800 après J.-C., elle est plus ancienne que la cité de Machu Picchu au Pérou. La Ciudad Perdida offre une expérience de trekking aventureuse pour les visiteurs.','Le Carnaval de Barranquilla : Le Carnaval de Barranquilla est l\'un des plus grands et des plus colorés d\'Amérique latine. Il célèbre la diversité culturelle de la Colombie avec des danses, des défilés de costumes traditionnels, de la musique et des festivités animées. Il a été reconnu par l\'UNESCO comme un chef-d\'œuvre du patrimoine oral et immatériel de l\'humanité.','La Cumbia : La cumbia est un genre musical et une danse traditionnels de la Colombie, originaire de la région côtière. Mêlant des influences indigènes, africaines et espagnoles, la cumbia est un élément essentiel de la musique colombienne, caractérisée par des rythmes enjoués et des mélodies entraînantes.'),('CR',9.74892,-83.7534,'Costa Rica','CRI',188,'??','U+1F1E8 U+1F1F7',0,2,80.46512797518179,'Le Costa Rica, situé en Amérique centrale, est un petit pays aux caractéristiques géographiques diverses, comprenant des plages tropicales, des forêts luxuriantes, des montagnes et des volcans. Réputé pour sa biodiversité exceptionnelle, le pays abrite une variété d\'écosystèmes, des parcs nationaux et des réserves naturelles. Sur le plan culturel, le Costa Rica se distingue par sa population chaleureuse et accueillante, son attachement à la démocratie et son absence d\'armée depuis plusieurs décennies. La \"Pura Vida\" (la vie pure) est une expression emblématique qui reflète l\'approche décontractée et optimiste des habitants. Sur le plan politique, le Costa Rica est une démocratie stable avec une longue tradition de paix. Sur le plan économique, le tourisme joue un rôle clé, attirant les visiteurs avec ses plages, ses parcs nationaux et son écotourisme. L\'agriculture, l\'électronique et les services contribuent également à l\'économie, faisant du Costa Rica l\'une des nations les plus prospères d\'Amérique centrale.','Parc National de Corcovado : Le Costa Rica abrite le Parc National de Corcovado, souvent considéré comme l\'une des réserves biologiques les plus diversifiées au monde. Cette réserve tropicale est le foyer d\'une variété impressionnante de plantes, d\'oiseaux, de mammifères et d\'amphibiens, dont certaines espèces sont endémiques à la région.','Politique d\'Énergie Renouvelable : Le Costa Rica est un pionnier en matière de durabilité environnementale. En 2017, le pays a fonctionné pendant 300 jours consécutifs en utilisant uniquement de l\'énergie renouvelable, principalement l\'hydroélectricité, la géothermie, l\'énergie éolienne et solaire. Cette politique en faveur des énergies propres est un exemple dans le monde entier.','Volcans Actifs : Le Costa Rica possède plusieurs volcans actifs, dont l\'Arenal, le Poás et le Turrialba. Ces volcans offrent des opportunités uniques d\'observation de la nature et d\'aventures géothermiques. Certains sites proposent même des bains thermaux alimentés par l\'activité volcanique.'),('CU',21.5218,-77.7812,'Cuba','CUB',192,'??','U+1F1E8 U+1F1FA',0,2,73.56934032735354,NULL,NULL,NULL,NULL),('CV',16.0021,-24.0132,'Cap-Vert','CPV',132,'??','U+1F1E8 U+1F1FB',0,1,26.45132078458678,NULL,NULL,NULL,NULL),('CY',35.1264,33.4299,'Chypre','CYP',196,'??','U+1F1E8 U+1F1FE',0,5,11.5485860142378,NULL,NULL,NULL,NULL),('CZ',49.8175,15.473,'République tchèque','CZE',203,'??','U+1F1E8 U+1F1FF',0,5,78.38897079079315,'La République tchèque, située en Europe centrale, est caractérisée par un riche patrimoine historique et une beauté architecturale. Géographiquement, le pays est composé de montagnes, de plaines et de rivières, avec des villes pittoresques et des châteaux médiévaux bien préservés. La culture tchèque est imprégnée de l\'héritage artistique et intellectuel de personnalités telles que Franz Kafka et Antonín Dvořák. Prague, la capitale, est célèbre pour son architecture baroque, ses ruelles pavées et son pont Charles emblématique. Politiquement, la République tchèque est une république parlementaire avec une histoire démocratique robuste depuis la Révolution de velours en 1989. Sur le plan économique, le pays a connu une transition réussie vers une économie de marché, avec des secteurs tels que l\'industrie automobile, l\'ingénierie et le tourisme contribuant de manière significative. La République tchèque est également membre de l\'Union européenne depuis 2004.','Le Pont Charles : Le Pont Charles, situé à Prague, est l\'un des ponts les plus emblématiques d\'Europe. Construit au XIVe siècle par l\'empereur Charles IV, le pont est orné de statues baroques et offre une vue magnifique sur la rivière Vltava et le château de Prague.','La Bière Tchèque : La République tchèque est célèbre pour sa tradition brassicole. Les Tchèques sont parmi les plus grands consommateurs de bière au monde, et la bière tchèque, en particulier la pilsner, est appréciée pour sa qualité et sa fraîcheur. Les brasseries tchèques ont une longue histoire remontant à des siècles.',' Château de Český Krumlov : Český Krumlov, inscrit au patrimoine mondial de l\'UNESCO, abrite l\'un des châteaux les plus impressionnants de la République tchèque. Ce château médiéval bien préservé attire les visiteurs avec son architecture gothique, Renaissance et baroque, ainsi qu\'avec ses jardins pittoresques.'),('DE',51.1657,10.4515,'Allemagne','DEU',276,'??','U+1F1E9 U+1F1EA',0,5,57.299098984616904,'L\'Allemagne, située au cœur de l\'Europe, est une nation influente sur le plan économique, politique et culturel. Géographiquement, le pays offre une diversité de paysages, allant des Alpes dans le sud aux vastes plaines du nord. C\'est la plus grande économie de l\'Union européenne et est mondialement reconnue pour son expertise dans les domaines de l\'ingénierie, de la technologie et de l\'industrie automobile. La culture allemande est marquée par une riche histoire littéraire, artistique et philosophique, avec des figures emblématiques telles que Goethe, Beethoven et Nietzsche. Les traditions culturelles, y compris la fête de la bière Oktoberfest et la musique classique, jouent un rôle essentiel dans la vie quotidienne. Politiquement, l\'Allemagne est une république fédérale avec un système parlementaire. Angela Merkel, qui a occupé le poste de chancelière pendant une grande partie du 21e siècle, a été une figure clé sur la scène internationale avant de quitter ses fonctions en 2021. L\'Allemagne a joué un rôle central dans la construction européenne, favorisant la coopération économique et politique au sein de l\'Union européenne. Malgré les défis, le pays a également fait face à des questions telles que la réunification après la chute du mur de Berlin en 1989, symbolisant son engagement envers la démocratie et les droits de l\'homme. En résumé, l\'Allemagne est une nation qui allie une histoire culturelle riche à une puissance économique et politique, contribuant de manière significative à la scène mondiale.','La Porte de Brandebourg à Berlin : L\'Allemagne est célèbre pour son histoire riche, et la Porte de Brandebourg à Berlin en est un symbole emblématique. Construite au XVIIIe siècle, elle était autrefois un symbole de division entre Berlin Est et Ouest pendant la guerre froide. Aujourd\'hui, elle représente l\'unité et la paix après la réunification de l\'Allemagne en 1990.','La Route Romantique (Romantische Straße) : La Route Romantique est une célèbre route touristique qui traverse le sud de l\'Allemagne, reliant des villes pittoresques comme Würzburg et Füssen. Bordée de châteaux, de villages médiévaux et de paysages bucoliques, cette route offre une expérience immersive dans le charme romantique de l\'Allemagne.','La Forêt Noire (Schwarzwald) : La Forêt Noire est une région montagneuse et boisée du sud-ouest de l\'Allemagne. Célèbre pour ses montagnes, ses lacs, ses forêts denses et ses charmants villages, la Forêt Noire est un paradis pour les amoureux de la nature et les randonneurs.'),('DJ',11.8251,42.5903,'Djibouti','DJI',262,'??','U+1F1E9 U+1F1EF',0,1,51.328585624069525,'Djibouti, situé dans la corne de l\'Afrique, est caractérisé par une position géostratégique clé, bordé par l\'Éthiopie, l\'Érythrée et la Somalie. La géographie de Djibouti est dominée par des déserts et des plateaux, avec un accès à la mer Rouge et au golfe d\'Aden. La culture djiboutienne est influencée par une variété de groupes ethniques, y compris les Afars et les Issas, ainsi que par des influences arabes et françaises. La diversité culturelle se reflète dans la musique, la danse et les coutumes locales. Politiquement, Djibouti est une république avec un système multipartite. Le pays abrite des bases militaires étrangères en raison de sa situation géostratégique. Sur le plan économique, Djibouti est un hub logistique crucial en raison de son port, servant de passerelle pour les échanges commerciaux dans la région. Le secteur des services, en particulier les services portuaires et de transport, joue un rôle essentiel dans son économie en croissance constante.','Île de Moucha : L\'île de Moucha est l\'une des nombreuses îles de Djibouti. Elle est réputée pour ses plages de sable blanc, ses eaux cristallines et sa tranquillité. L\'île attire les visiteurs en quête de détente, de plongée en apnée et de sports nautiques.','Lac Assal : Djibouti abrite le lac Assal, qui est le point le plus bas de l\'Afrique et le troisième plus bas du monde, après la mer Morte et le lac Asal au Turkménistan. Le lac Assal est également l\'un des lacs les plus salés de la planète.','Base Militaire Internationale : En raison de sa position stratégique, Djibouti accueille des bases militaires étrangères, dont la plus notable est la Base aérienne de Camp Lemonnier, utilisée par les forces américaines. La France, le Japon, l\'Italie et d\'autres pays ont également des présences militaires à Djibouti.'),('DK',56.2639,9.50179,'Danemark','DNK',208,'??','U+1F1E9 U+1F1F0',0,5,84.7456342398614,NULL,NULL,NULL,NULL),('DM',15.415,-61.371,'Dominique','DMA',212,'??','U+1F1E9 U+1F1F2',0,2,69.74241740046294,NULL,NULL,NULL,NULL),('DO',18.7357,-70.1627,'République dominicaine','DOM',214,'??','U+1F1E9 U+1F1F4',0,2,94.475187356095,NULL,NULL,NULL,NULL),('DZ',28.0339,1.65963,'Algérie','DZA',12,'??','U+1F1E9 U+1F1FF',4,1,63.1486876524507,'L\'Algérie, le plus grand pays d\'Afrique et du monde arabe, occupe la majeure partie du Maghreb. Géographiquement, elle est bordée par la mer Méditerranée au nord, partageant des frontières avec la Tunisie, la Libye, le Niger, le Mali, la Mauritanie, le Sahara occidental et le Maroc. Son paysage varie du littoral méditerranéen aux vastes étendues désertiques du Sahara. Sur le plan culturel, l\'Algérie est imprégnée d\'une riche histoire berbère, arabe et méditerranéenne, avec des influences françaises et ottomanes. Sa population diversifiée contribue à une mosaïque culturelle dynamique, reflétée dans l\'art, la littérature et la musique. Politiquement, l\'Algérie est une république multipartite. Son histoire récente a été marquée par l\'indépendance de la France en 1962 et des années de guerre civile dans les années 1990. Économiquement, l\'Algérie dépend largement des exportations de pétrole et de gaz, ce qui a façonné son développement économique. Le pays cherche actuellement à diversifier son économie et à promouvoir d\'autres secteurs tels que l\'agriculture et le tourisme.','Le Sahara Algérien : L\'Algérie abrite une partie significative du Sahara, le plus grand désert chaud du monde. Le désert algérien offre non seulement des paysages à couper le souffle avec ses dunes de sable impressionnantes, mais il est également le lieu où l\'on trouve des gravures rupestres préhistoriques, témoignant de la vie ancienne dans la région.','La Casbah d\'Alger : La Casbah d\'Alger est un site du patrimoine mondial de l\'UNESCO. Cette vieille ville méditerranéenne a une histoire riche remontant à des siècles, et ses ruelles étroites, ses marchés animés et ses bâtiments historiques offrent une immersion dans le passé culturel de l\'Algérie.','Timgad, la cité romaine : Fondée au 1er siècle après J.-C., Timgad est une ancienne cité romaine bien préservée située dans le nord-est de l\'Algérie. Ses ruines offrent un aperçu fascinant de l\'architecture romaine, comprenant un arc de triomphe, un théâtre, des thermes et des rues pavées.'),('EC',-1.83124,-78.1834,'Équateur','ECU',218,'??','U+1F1EA U+1F1E8',0,3,32.31787926733296,'L\'Équateur, situé sur la côte ouest de l\'Amérique du Sud, est un pays d\'une incroyable diversité géographique et culturelle. Le pays tire son nom de sa position sur l\'équateur, et il est traversé par la cordillère des Andes, abritant une partie de la forêt amazonienne à l\'est et des plages spectaculaires sur la côte ouest. Quito, la capitale, est l\'une des plus hautes du monde. La population équatorienne est composée de différentes ethnies indigènes, métisses et afro-équatoriennes, contribuant à une riche mosaïque culturelle. Politiquement, l\'Équateur est une république avec une histoire complexe marquée par divers gouvernements. L\'économie repose sur le pétrole, l\'agriculture et le tourisme, attirant les visiteurs avec ses volcans majestueux, sa biodiversité exceptionnelle et sa culture colorée.','Les Îles Galápagos et leur Faune Unique : L\'archipel des Galápagos, situé dans l\'océan Pacifique, est renommé pour sa faune extraordinaire et ses paysages volcaniques. C\'est sur ces îles que Charles Darwin a puisé son inspiration pour la théorie de l\'évolution. Les visiteurs peuvent observer des espèces uniques telles que les tortues géantes, les iguanes marins, et les albatros.','La Ligne de l\'Équateur : L\'Équateur tire son nom de la ligne équatoriale qui traverse le pays. À Mitad del Mundo, près de Quito, les visiteurs peuvent se tenir simultanément dans les hémisphères nord et sud en visitant le monument qui marque la ligne de l\'Équateur.','La Ville de Baños et ses Thermes : Baños, nichée au pied du volcan Tungurahua, est célèbre pour ses eaux thermales. Les visiteurs peuvent se détendre dans les bains publics alimentés par des sources d\'eau chaude naturelles tout en profitant de la vue sur les montagnes environnantes.'),('EE',58.5953,25.0136,'Estonie','EST',233,'??','U+1F1EA U+1F1EA',0,5,72.14333645267723,'L\'Estonie, située dans la région balte de l\'Europe du Nord, est un pays dynamique alliant modernité et traditions. Ses paysages comprennent des forêts verdoyantes, des lacs scintillants et une côte balte pittoresque. La culture estonienne, imprégnée de folklore et d\'innovation technologique, est un mélange captivant. En tant que république parlementaire, l\'Estonie a connu une transformation rapide depuis son indépendance, devenant un leader en matière de technologie. Son économie repose sur les secteurs des technologies de l\'information, de la logistique et du tourisme.','La Vieille Ville de Tallinn : La Vieille Ville de Tallinn, inscrite au patrimoine mondial de l\'UNESCO, est un trésor médiéval. Des projets de restauration ont été entrepris pour préserver ces ruelles pavées, églises et remparts, permettant aux visiteurs de remonter le temps.','La culture du chant estonienne : La tradition du chant est une partie intégrante de la culture estonienne. Des initiatives éducatives et artistiques sont en place pour préserver le chant choral, qui a joué un rôle significatif dans l\'histoire estonienne et la lutte pour l\'indépendance.','Les zones humides de Soomaa : Le parc national de Soomaa en Estonie abrite des zones humides uniques. Des efforts de conservation de la biodiversité sont déployés pour protéger ces écosystèmes fragiles, offrant aux visiteurs une expérience naturelle préservée.'),('EG',26.8206,30.8025,'Égypte','EGY',818,'??','U+1F1EA U+1F1EC',0,1,63.76304753475175,NULL,NULL,NULL,NULL),('ER',15.1794,39.7823,'Érythrée','ERI',232,'??','U+1F1EA U+1F1F7',0,1,2.3852313890915657,'L\'Érythrée, située dans la Corne de l\'Afrique, est un pays caractérisé par son histoire ancienne, son paysage côtier le long de la mer Rouge et ses hauts plateaux. Asmara, la capitale, est réputée pour son architecture italienne coloniale bien préservée. Politiquement, l\'Érythrée est un État à parti unique, marqué par des défis en matière de droits de l\'homme. L\'économie repose sur l\'agriculture, l\'élevage et quelques ressources minières. La population érythréenne est diversifiée sur le plan ethnique, mais le pays a connu des migrations importantes en raison de conflits régionaux. Malgré ses atouts culturels, ses sites archéologiques et sa géographie unique, l\'Érythrée a été confrontée à des problèmes tels que l\'isolement international et les conflits frontaliers.','Asmara, la Capitale Art Déco : Asmara, la capitale de l\'Érythrée, est célèbre pour son architecture Art Déco bien préservée. Les bâtiments colorés et élégants datent de l\'époque coloniale italienne au XXe siècle. La ville est inscrite sur la liste du patrimoine mondial de l\'UNESCO en raison de son ensemble architectural exceptionnel.','La Mer Rouge et Massawa : L\'Érythrée a un littoral magnifique le long de la Mer Rouge. La ville portuaire de Massawa est réputée pour ses anciens bâtiments ottomans et sa vieille ville pleine de charme. Les plages de la Mer Rouge offrent des opportunités de plongée et de snorkeling.','Le Mont Soira et les Paysages Montagneux : L\'Érythrée est dotée de paysages montagneux impressionnants, dont le Mont Soira, qui culmine à plus de 3 000 mètres d\'altitude. Les montagnes offrent des vues panoramiques, des sentiers de randonnée et sont le refuge de nombreuses espèces de plantes et d\'animaux.'),('ES',40.4637,-3.74922,'Espagne','ESP',724,'??','U+1F1EA U+1F1F8',0,5,20.637017414567076,'L\'Espagne, située dans le sud-ouest de l\'Europe sur la péninsule ibérique, est un pays riche en histoire, en culture et en diversité géographique. Les côtes espagnoles bordent la mer Méditerranée, l\'océan Atlantique et la mer Cantabrique, offrant une variété de paysages, des plages ensoleillées aux montagnes majestueuses. La population espagnole est caractérisée par une grande diversité régionale, chacune avec ses traditions, sa langue et sa culture spécifiques. L\'espagnol, ou castillan, est la langue officielle, mais certaines régions comme la Catalogne et le Pays basque ont leurs propres langues officielles. Sur le plan politique, l\'Espagne est une monarchie constitutionnelle avec un gouvernement parlementaire. Le pays a connu une transition démocratique après la fin du régime franquiste en 1975. Économiquement, l\'Espagne est la quatrième plus grande économie de la zone euro, avec des secteurs clés tels que le tourisme, l\'agriculture, l\'industrie automobile et le secteur des services. L\'Espagne est également connue pour ses festivals animés, sa cuisine délicieuse, son art influent, notamment les œuvres de Salvador Dalí et Pablo Picasso, et son architecture impressionnante, représentée par des monuments tels que l\'Alhambra et la Sagrada Familia.','La Tomatina de Buñol : Chaque année à Buñol, près de Valence, a lieu La Tomatina, l\'une des batailles de nourriture les plus célèbres au monde. Des milliers de personnes se réunissent pour se lancer des tomates mûres dans une ambiance festive. Cet événement insolite est devenu une tradition espagnole emblématique, attirant des visiteurs du monde entier.','La Sagrada Familia de Gaudí à Barcelone : L\'architecte Antoni Gaudí a laissé une empreinte indélébile sur Barcelone, en particulier avec la Sagrada Familia. Cette basilique, toujours en construction, est un chef-d\'œuvre de l\'architecture moderneiste. Ses tours élancées, ses sculptures détaillées et ses jeux de lumière à l\'intérieur en font une expérience architecturale unique.','Les Flamenco à Séville : Séville est le cœur du flamenco, une forme d\'art espagnol comprenant le chant, la danse et la guitare. Les visiteurs peuvent s\'immerger dans l\'atmosphère passionnée du flamenco en assistant à des spectacles dans les tablao (bars flamenco) de la ville. Le quartier de Triana à Séville est particulièrement réputé pour ses racines flamencas.'),('ET',9.145,40.4897,'Éthiopie','ETH',231,'??','U+1F1EA U+1F1F9',3,1,96.0293959789252,'L\'Éthiopie, située dans la corne de l\'Afrique, est un pays aux multiples facettes avec une histoire ancienne remontant à l\'Antiquité. Les hauts plateaux, les vallées fertiles et les déserts colorés caractérisent la géographie éthiopienne. La culture éthiopienne, influencée par des traditions séculaires, est riche en musique, en art et en cuisine. En tant que république fédérale, l\'Éthiopie a surmonté des défis historiques pour devenir un acteur clé sur la scène africaine. Son économie, en croissance, est axée sur l\'agriculture, l\'industrie légère et les infrastructures.','Lalibela et ses églises taillées dans la roche : Les églises de Lalibela, creusées dans la roche volcanique, sont un site emblématique en Éthiopie. Des projets de restauration veillent à préserver ces édifices médiévaux, inscrits au patrimoine mondial de l\'UNESCO.','La Vallée du Rift : La Vallée du Rift en Éthiopie est une région géologiquement riche. Des initiatives de préservation sont en place pour protéger cet écosystème unique, habitat de diverses espèces, dont le loup d\'Abyssinie.','Le Café éthiopien : Le café a des origines éthiopiennes, et la culture du café y est profondément enracinée. Des projets de préservation agricole et culturelle visent à préserver la tradition du café éthiopien, source de fierté nationale.'),('FI',61.9241,25.7482,'Finlande','FIN',246,'??','U+1F1EB U+1F1EE',0,5,18.235930724289204,'La Finlande, située dans le nord de l\'Europe, est un pays nordique connu pour ses vastes forêts, ses lacs scintillants et ses aurores boréales. La culture finlandaise est imprégnée de traditions scandinaves, avec une emphase sur le design, la musique et le sauna. En tant que république parlementaire, la Finlande a une histoire de neutralité et est active dans les affaires internationales. Son économie, caractérisée par l\'innovation technologique, le secteur forestier et le design, contribue à son bien-être social élevé.','Le design finlandais : La Finlande est réputée pour son design innovant, avec des marques telles que Marimekko et Iittala. Des initiatives culturelles visent à préserver et promouvoir l\'héritage du design finlandais, alliant fonctionnalité et esthétique.','Les lacs et forêts finlandais : Les lacs et forêts abondants de la Finlande sont des éléments essentiels de son paysage. Des programmes de préservation environnementale garantissent la conservation de ces écosystèmes naturels.','La tradition du sauna : Le sauna est une tradition importante en Finlande, avec plus de saunas que d\'habitants. Des projets culturels veillent à préserver cette pratique sociale, ancrée dans la vie quotidienne des Finlandais.'),('FJ',-16.5782,179.414,'Fidji','FJI',242,'??','U+1F1EB U+1F1EF',0,6,3.0914687580349565,NULL,NULL,NULL,NULL),('FM',7.42555,150.551,'Micronésie','FSM',583,'??','U+1F1EB U+1F1F2',0,6,60.74955469067167,'La Micronésie, dispersée dans l\'océan Pacifique, est un ensemble d\'îles paradisiaques riches en biodiversité marine. Les lagons turquoise, les récifs coralliens et les forêts tropicales font de la Micronésie un lieu prisé pour la plongée et l\'exploration de la nature. Les cultures autochtones micronésiennes, imprégnées de traditions maritimes, coexistent avec des influences occidentales. En tant que fédération de micronations, la Micronésie a une gouvernance unique, cherchant à préserver son environnement naturel tout en stimulant le développement durable.','Les Ruines de Nan Madol : Les ruines de Nan Madol, situées dans l\'État de Pohnpei, sont un site archéologique unique au Micronésie. Des mesures de préservation sont en place pour protéger ces structures de pierre complexe, un témoignage du génie architectural des habitants de la Micronésie ancienne.','Les Îles de la Truk Lagoon : La Truk Lagoon est renommée pour ses épaves de la Seconde Guerre mondiale immergées. Des efforts de préservation maritime veillent à protéger ces sites historiques tout en offrant aux plongeurs une expérience unique.','Les Danses traditionnelles : Les danses traditionnelles au Micronésie, telles que le \"saila\" et le \"sipak\", sont des expressions culturelles vibrantes. Des programmes éducatifs et artistiques sont en place pour préserver ces danses, qui jouent un rôle essentiel dans la transmission de l\'identité culturelle.'),('FR',46.2276,2.21375,'France','FRA',250,'??','U+1F1EB U+1F1F7',0,5,94.47337025261798,'La France, nation emblématique d\'Europe occidentale, séduit par sa diversité culturelle, son patrimoine historique et ses paysages variés. Avec Paris comme capitale, la France est reconnue pour ses monuments emblématiques tels que la Tour Eiffel, sa cuisine raffinée, ses vignobles renommés et ses régions pittoresques allant des Alpes aux plages méditerranéennes. Politiquement, c\'est une république avec une longue histoire démocratique. L\'économie française est diversifiée, englobant le secteur agricole, industriel et des services, faisant du pays l\'une des principales puissances économiques mondiales. La France demeure une influence culturelle majeure avec ses contributions aux arts, à la littérature et à la mode. Son attrait touristique est universel, attirant des visiteurs du monde entier pour découvrir son art de vivre unique et son riche héritage.','La Tour Eiffel et ses Illuminations : La Tour Eiffel à Paris est l\'un des monuments les plus emblématiques au monde. Une anecdote célèbre est que la Tour Eiffel est illuminée chaque nuit par des milliers de lumières scintillantes pendant les premières heures après le coucher du soleil. Cette pratique a débuté en 1985 pour célébrer le 100e anniversaire de la tour et est devenue une tradition appréciée.','Le Festival de Cannes : Le Festival de Cannes, qui se tient chaque année sur la Côte d\'Azur, est l\'un des événements cinématographiques les plus prestigieux au monde. Des célébrités du monde entier se réunissent pour célébrer le cinéma et découvrir de nouveaux talents. La célèbre montée des marches du Palais des Festivals est un spectacle à part entière.','Le Mont Saint-Michel : Le Mont Saint-Michel, situé en Normandie, est une merveille architecturale et naturelle. L\'anecdote intéressante est que le Mont Saint-Michel était autrefois complètement isolé à marée haute, mais un pont-passerelle a depuis été construit pour permettre un accès permanent. C\'est un site classé au patrimoine mondial de l\'UNESCO, attirant des visiteurs du monde entier.'),('GA',-0.803689,11.6094,'Gabon','GAB',266,'??','U+1F1EC U+1F1E6',0,1,90.11819026443939,'Le Gabon, situé en Afrique centrale sur la côte atlantique, est un pays caractérisé par sa diversité géographique, allant des forêts tropicales denses aux savanes et aux zones côtières. La culture gabonaise est influencée par la riche diversité ethnique, comprenant des groupes tels que les Fangs, les Bantous, les Myènè, et d\'autres. La musique et la danse jouent un rôle important dans les traditions culturelles. Politiquement, le Gabon est une république présidentielle multipartite. La stabilité politique relative du pays a contribué à son développement. Sur le plan économique, le Gabon est riche en ressources naturelles, en particulier le pétrole, qui constitue une part importante de son économie. Cependant, le pays cherche à diversifier son économie pour réduire sa dépendance à l\'égard du pétrole et promouvoir une croissance plus inclusive. Malgré des défis tels que la gestion durable des ressources naturelles et la lutte contre la pauvreté, le Gabon demeure un acteur clé en Afrique centrale, jouant un rôle dans les questions régionales et internationales.','Biodiversité exceptionnelle : Le Gabon est réputé pour sa biodiversité exceptionnelle, avec des forêts tropicales abritant une grande variété de plantes, d\'animaux et d\'oiseaux. Une partie importante du pays est couverte par le Parc national d\'Odzala-Kokoua, contribuant à la préservation de la faune et de la flore.','Le musée des Arts et Traditions du Gabon : Situé à Libreville, le musée des Arts et Traditions du Gabon est une institution culturelle qui expose des objets traditionnels, des masques, des sculptures et d\'autres artefacts qui reflètent l\'histoire et la richesse culturelle du pays.','Le delta de l\'Ogooué : Le delta de l\'Ogooué, l\'un des plus vastes deltas d\'Afrique de l\'Ouest, est une région marécageuse qui abrite une variété d\'écosystèmes aquatiques. C\'est également un habitat important pour les oiseaux migrateurs, faisant du delta une zone d\'importance écologique.'),('GB',55.3781,-3.43597,'Royaume-Uni','GBR',826,'??','U+1F1EC U+1F1E7',0,5,67.1708436377075,'Le Royaume-Uni, situé en Europe du Nord-Ouest, est composé de quatre nations distinctes : l\'Angleterre, l\'Écosse, le pays de Galles et l\'Irlande du Nord. Géographiquement, il offre une diversité de paysages, des collines verdoyantes aux hautes montagnes en passant par les plaines vallonnées. La culture britannique est riche et variée, influencée par une histoire millénaire, avec des contributions majeures dans les domaines de la littérature, de la musique, du sport et de la science. Politiquement, le Royaume-Uni est une monarchie constitutionnelle parlementaire, avec un système de gouvernement démocratique. Londres, la capitale, est un centre financier mondial et un melting-pot culturel. Sur le plan économique, le Royaume-Uni possède une économie diversifiée, allant des services financiers à l\'industrie manufacturière. Cependant, des questions telles que le Brexit ont introduit des défis politiques et économiques. Malgré cela, le Royaume-Uni reste un acteur mondial influent sur la scène politique, économique et culturelle.','Le London Eye : Le London Eye, également connu sous le nom de Millennium Wheel, est l\'une des grandes roues d\'observation les plus célèbres au monde. Situé sur la rive sud de la Tamise, il offre une vue panoramique spectaculaire sur la ville de Londres, y compris des sites emblématiques tels que le Parlement et le Big Ben.','Le Loch Ness et le monstre de Nessie : Le Loch Ness, situé en Écosse, est célèbre pour les légendes entourant le monstre de Nessie. Des observations du monstre lacustre ont été rapportées au fil des ans, bien que leur authenticité soit souvent remise en question. Le mystère entourant Nessie attire les curieux du monde entier.','La Tour de Londres : La Tour de Londres, située sur les rives de la Tamise, a une histoire qui remonte à plus de 1 000 ans. Elle a servi de forteresse, de palais royal, de prison et de trésor national. Les joyaux de la Couronne y sont exposés, attirant des millions de visiteurs chaque année.'),('GD',12.2628,-61.6042,'Grenade','GRD',308,'??','U+1F1EC U+1F1E9',0,2,65.49965046858382,'Grenade, une île située dans les Caraïbes, est le point le plus méridional du Commonwealth des Nations. Géographiquement, elle se trouve au nord du Venezuela, entourée par la mer des Caraïbes. L\'île, caractérisée par ses plages de sable blanc, ses montagnes verdoyantes et ses plantations de noix de muscade, offre un paysage tropical spectaculaire. Sur le plan culturel, Grenade reflète une fusion d\'influences africaines, françaises et britanniques, visibles dans la musique, la danse et la cuisine locale. Politiquement, Grenade est une monarchie parlementaire, membre du Commonwealth, avec un gouverneur général représentant le monarque britannique comme chef de l\'État. Depuis son indépendance en 1974, le pays a établi une stabilité politique. Économiquement, le tourisme est un secteur clé, attirant des visiteurs avec ses plages pittoresques, ses parcs nationaux et son ambiance chaleureuse. L\'agriculture, en particulier la production de noix de muscade, joue également un rôle vital dans l\'économie de Grenade.','Épice de l\'Île : Grenade est surnommée \"l\'île aux épices\" en raison de sa production importante de noix de muscade et de la richesse de ses plantations d\'épices. La noix de muscade est particulièrement importante, et Grenade est l\'un des plus grands producteurs mondiaux de cette épice prisée.','Carnaval de Grenade : Le Carnaval de Grenade est l\'un des plus animés des Caraïbes. Il a lieu chaque année en août et comprend des défilés colorés, des danses, des concours de costumes et des célébrations nocturnes. C\'est une célébration pleine d\'énergie, de musique et de culture.','Cascades d\'Annandale : Les cascades d\'Annandale, situées à proximité de St. George\'s, la capitale de Grenade, offrent un cadre naturel spectaculaire. Selon la tradition locale, si vous nagez dans la piscine naturelle en bas des chutes, vous resterez jeune.'),('GE',42.3154,43.3569,'Géorgie','GEO',268,'??','U+1F1EC U+1F1EA',0,4,25.98572450316113,'La Géorgie, située à la croisée de l\'Europe de l\'Est et de l\'Asie de l\'Ouest, est un pays montagneux au riche patrimoine culturel. Géographiquement, elle est délimitée par la mer Noire à l\'ouest, partageant des frontières avec la Russie au nord, l\'Azerbaïdjan au sud-est, l\'Arménie au sud, et la Turquie au sud-ouest. Les majestueuses chaînes de montagnes du Grand Caucase et du Petit Caucase traversent le pays. Culturellement, la Géorgie a une histoire ancienne et une identité unique, avec une langue propre, le géorgien, et des traditions artistiques, musicales et culinaires distinctives, comme le vin qvevri. Sur le plan politique, la Géorgie est une république parlementaire, travaillant à renforcer ses institutions démocratiques. Économiquement, elle s\'efforce de diversifier son économie, avec l\'agriculture, le tourisme et l\'industrie énergétique jouant des rôles importants. La Géorgie est également un carrefour stratégique pour les routes commerciales reliant l\'Europe et l\'Asie.','Berceau du Vin : La Géorgie est souvent considérée comme le berceau du vin. La tradition vinicole en Géorgie remonte à plus de 8 000 ans, ce qui en fait l\'une des plus anciennes régions viticoles au monde. Les Géorgiens ont leur propre méthode de fabrication du vin, appelée \"qvevri\", qui consiste à fermenter le vin dans de grandes jarres en argile enterrées dans le sol.','Tour de Tbilissi : La capitale de la Géorgie, Tbilissi, est réputée pour son architecture éclectique. Vous pouvez trouver une juxtaposition intéressante de bâtiments historiques, de maisons en bois traditionnelles avec des balcons en treillis appelés \"verandas\", et des structures modernes. La vieille ville de Tbilissi est également célèbre pour ses ruelles sinueuses et ses bains thermaux.','Grottes de la Ville d\'Uplistsikhe : Uplistsikhe, signifiant \"la forteresse au sommet du rocher\", est une ancienne ville troglodytique taillée dans la roche, située en Géorgie centrale. Cet ancien site datant du 1er millénaire avant notre ère était un important centre religieux, culturel et politique de l\'époque.'),('GH',7.94653,-1.02319,'Ghana','GHA',288,'??','U+1F1EC U+1F1ED',4,1,33.429674183418676,'Le Ghana, situé sur la côte ouest de l\'Afrique, est un pays doté d\'une riche histoire, d\'une diversité culturelle et d\'une économie en développement. Accra, la capitale, est un mélange dynamique de modernité et de traditions africaines. Le pays est connu pour son rôle clé dans la traite atlantique des esclaves, témoigné par les forts et châteaux côtiers. Politiquement stable, le Ghana est une république démocratique avec une économie en croissance, soutenue par l\'agriculture, l\'exploitation minière (or) et les services. La population ghanéenne, composée de divers groupes ethniques, contribue à une culture vivante marquée par la musique, la danse et l\'artisanat. Le Ghana est également réputé pour son accueil chaleureux, ses festivals culturels et son engagement envers le développement durable en Afrique de l\'Ouest.','Le Lac Volta et le Barrage d\'Akosombo : Le Ghana est le foyer du lac Volta, l\'un des plus grands lacs artificiels du monde, créé par le barrage d\'Akosombo. Outre la production d\'électricité, le lac offre des paysages pittoresques, des possibilités de pêche, et abrite l\'île Dodi, une destination prisée.','Le Festival d\'Asafotufiam : Le peuple Anlo du Ghana célèbre le Festival d\'Asafotufiam pour commémorer les ancêtres et les exploits guerriers. Les festivités incluent des danses traditionnelles, des rites religieux, et des défilés. C\'est une occasion importante pour renforcer les liens communautaires et transmettre les valeurs culturelles aux générations futures.','Le Cape Coast Castle : Le Cape Coast Castle, classé au patrimoine mondial de l\'UNESCO, est un témoignage douloureux de l\'histoire du commerce des esclaves. Construit par les Européens au XVIIe siècle, le château servait de point de départ pour de nombreux esclaves africains. Aujourd\'hui, il abrite un musée qui documente cette sombre période de l\'histoire.'),('GM',13.4432,-15.3101,'Gambie','GMB',270,'??','U+1F1EC U+1F1F2',0,1,89.19120048097446,'La Gambie, un petit pays enclavé en Afrique de l\'Ouest, est caractérisée par son étroite bande de territoire le long du fleuve Gambie. Géographiquement, elle offre des paysages de mangroves, de forêts tropicales et de plages sur l\'océan Atlantique. La Gambie a une histoire coloniale marquée par l\'influence britannique, et elle est connue pour sa stabilité politique relative. La culture gambienne est diversifiée avec une population composée de groupes ethniques variés, chacun apportant sa propre contribution à la musique, la danse et l\'artisanat. Politiquement, la Gambie est une république multipartite, ayant connu des changements politiques significatifs ces dernières années, notamment l\'élection présidentielle de 2016 qui a mis fin à un long règne autoritaire. Sur le plan économique, l\'agriculture, la pêche et le tourisme sont des secteurs importants. Bien que la Gambie ait fait des progrès, elle continue de faire face à des défis en matière de développement économique et social.','Le Fleuve Gambie : La Gambie tire son nom du fleuve Gambie, qui traverse le pays du sud au nord. Le fleuve Gambie est le principal cours d\'eau de la Gambie, et il joue un rôle important dans la vie quotidienne des habitants, offrant des opportunités de pêche, de transport et de vie sauvage.','L\'Île James : L\'île James, située à l\'embouchure du fleuve Gambie, était autrefois un important site de commerce pour les Européens pendant l\'époque coloniale. Elle abrite aujourd\'hui des vestiges historiques, y compris le fort James, qui témoigne du passé colonial de la région.','Le Festival de Kankurang : Le Festival de Kankurang est une célébration traditionnelle qui honore les esprits protecteurs et vise à éloigner les mauvais esprits. Il implique des danses, des masques et d\'autres rituels, offrant un aperçu de la riche culture et des croyances de la Gambie.'),('GN',9.94559,-9.69664,'Guinée','GIN',324,'??','U+1F1EC U+1F1F3',0,1,45.66698292798081,'La Guinée, située en Afrique de l\'Ouest, partage des frontières avec le Sénégal, le Mali, la Côte d\'Ivoire, le Libéria, la Sierra Leone et l\'Atlantique. Son relief est caractérisé par des plateaux et des montagnes, notamment le mont Nimba. La Guinée a une richesse culturelle diversifiée, avec une mosaïque d\'ethnies, telles que les Malinkés, les Peuls et les Soussous, chacune contribuant à la riche tapestry culturelle du pays. Connu pour sa musique vibrante et ses danses traditionnelles, la Guinée a également une histoire politique complexe. Depuis son indépendance en 1958, le pays a connu des périodes de stabilité et d\'instabilité politique. Sur le plan économique, la Guinée détient d\'importantes réserves de bauxite, ce qui en fait l\'un des plus grands producteurs mondiaux de ce minerai. Malgré ses ressources naturelles, le pays fait face à des défis tels que la pauvreté et le sous-développement, mais les efforts pour stimuler le développement économique sont en cours.','Les Chutes de Kambadaga : Nichées dans les montagnes de Fouta Djalon, les Chutes de Kambadaga sont parmi les plus hautes chutes d\'eau d\'Afrique de l\'Ouest. Leur accès nécessite souvent une randonnée à travers des sentiers pittoresques, offrant une expérience naturelle et immersive. Les cascades dévalent les falaises escarpées, créant un spectacle impressionnant au cœur de la Guinée.','Le Festival des Masques de Badiar : Chaque année à Badiar, dans la région de Kankan, a lieu le Festival des Masques. Cet événement coloré met en avant les danses traditionnelles, la musique, et les performances masquées. Les masques traditionnels, portés par les danseurs, représentent souvent des figures mythologiques et ancestrales. Le festival est une célébration vivante de la culture guinéenne, attirant des participants de différentes régions du pays.','Le Mont Nimba : La Guinée partage le massif du mont Nimba avec la Côte d\'Ivoire et le Liberia. Ce site est classé au patrimoine mondial de l\'UNESCO en raison de sa biodiversité exceptionnelle. Les sommets escarpés du mont Nimba abritent une variété d\'espèces végétales et animales endémiques, faisant de cette région une destination de choix pour les amateurs de nature et de randonnée.'),('GR',39.0742,21.8243,'Grèce','GRC',300,'??','U+1F1EC U+1F1F7',0,5,60.76131627034519,NULL,NULL,NULL,NULL),('GT',15.7835,-90.2308,'Guatemala','GTM',320,'??','U+1F1EC U+1F1F9',0,2,66.80563564114797,'Le Guatemala, situé en Amérique centrale, partage ses frontières avec le Mexique au nord et à l\'ouest, le Belize à l\'est, et le Honduras et le Salvador au sud-est. Géographiquement, le pays est caractérisé par ses montagnes, ses volcans actifs, ses forêts tropicales et ses rivières. Culturellement, le Guatemala a une riche histoire précolombienne avec des influences mayas profondes, visibles dans l\'architecture, l\'art et les traditions. La population guatémaltèque est également composée de divers groupes ethniques, notamment les Mayas, les Ladinos et les Garífunas. Politiquement, le Guatemala est une république démocratique avec des défis persistants en matière de droits de l\'homme et de corruption. L\'économie guatémaltèque repose sur l\'agriculture, notamment la culture du café et des bananes, ainsi que sur les industries textiles et de l\'assemblage. Le pays attire également les voyageurs avec ses sites archéologiques mayas, ses marchés colorés et ses paysages variés. Cependant, des défis socio-économiques persistent, notamment la pauvreté et l\'inégalité.','Volcan Pacaya : Le Guatemala est parsemé de volcans, mais le Pacaya est l\'un des plus actifs et des plus accessibles. Les visiteurs peuvent entreprendre une randonnée jusqu\'au sommet pour admirer les vues spectaculaires sur la vallée en contrebas et même voir la lave bouillonnante dans le cratère.','Marchés Colorés : Les marchés indigènes, tels que celui de Chichicastenango, sont des attractions populaires au Guatemala. Ces marchés animés offrent une variété de produits artisanaux, de textiles colorés et de produits locaux. Ils sont également des endroits où la culture maya traditionnelle est préservée et célébrée.','Civilisation Maya : Le Guatemala était au cœur de l\'ancienne civilisation maya, et de nombreux vestiges de cette époque sont encore visibles aujourd\'hui. Le site archéologique de Tikal, niché dans la jungle guatémaltèque, est l\'une des plus grandes cités mayas bien préservées et a été déclaré site du patrimoine mondial par l\'UNESCO.'),('GU',13.4443,144.794,'Guam','GUM',316,'??','U+1F1EC U+1F1FA',0,6,51.744232468068816,'Guam, une île située dans le Pacifique occidental, est un territoire non incorporé des États-Unis. Connue pour ses plages de sable blanc, ses récifs coralliens et son histoire militaire, Guam est le plus grand et le plus méridional des territoires des États-Unis. La ville de Hågatña est la capitale. Politiquement, Guam est un territoire non incorporé, ce qui signifie qu\'il fait partie des États-Unis, mais ses habitants ne votent pas aux élections présidentielles. L\'économie de Guam repose principalement sur le tourisme, les services militaires américains, et l\'industrie du commerce. La population de Guam est diversifiée, avec des influences autochtones chamorros, espagnoles, américaines et asiatiques. La culture chamorro, les danses traditionnelles, et la cuisine locale contribuent à l\'identité unique de l\'île.','La Culture Chamorro : Guam, île du Pacifique occidental, est le foyer du peuple Chamorro. La culture chamorro, riche en traditions, est préservée à travers la danse, la musique, l\'artisanat et la cuisine. Les danses traditionnelles, comme le « Chamorro Sirena », et les festivals reflètent l\'héritage vivant de la communauté.','La Baie de Tumon et le Snorkeling : La Baie de Tumon est réputée pour ses eaux cristallines et ses récifs coralliens colorés. Le snorkeling y est une activité prisée, offrant aux visiteurs la possibilité d\'explorer la vie marine diversifiée, y compris les coraux, les poissons tropicaux et les tortues marines.','Le Mémorial de la Paix de la Guerre du Pacifique : Guam a joué un rôle significatif pendant la Seconde Guerre mondiale en tant que site clé dans la Guerre du Pacifique. Le Mémorial de la Paix commémore les événements tragiques de l\'occupation japonaise et les batailles qui ont eu lieu sur l\'île, rendant hommage aux sacrifices et à la résilience du peuple de Guam.'),('GW',11.8037,-15.1804,'Guinée-Bissau','GNB',624,'??','U+1F1EC U+1F1FC',0,1,58.30425849026466,'La Guinée-Bissau, située sur la côte ouest de l\'Afrique, est un petit pays caractérisé par sa diversité ethnique, ses paysages côtiers et ses mangroves. Limitrophe du Sénégal au nord et de la Guinée au sud et à l\'est, le pays est traversé par plusieurs rivières, dont le fleuve Cacheu et le fleuve Geba. La population de la Guinée-Bissau est composée de divers groupes ethniques, dont les Balantes, les Fulas et les Mandingues. La langue officielle est le portugais, héritage de la colonisation portugaise. Sur le plan politique, la Guinée-Bissau a connu une instabilité avec des périodes de coup d\'État et de conflits internes depuis son indépendance en 1973. Actuellement, le pays est une république multipartite avec un système politique en transition. Sur le plan économique, l\'agriculture domine, avec la production de noix de cajou en tant que principale source de revenus. Cependant, le pays fait face à des défis tels que la pauvreté, la corruption et l\'instabilité politique, qui ont entravé son développement. La Guinée-Bissau attire les voyageurs avec ses plages préservées, sa biodiversité et sa culture riche en traditions africaines.','Les Îles Bijagós : La Guinée-Bissau abrite l\'archipel des Bijagós, un ensemble de magnifiques îles tropicales peu explorées. Les visiteurs peuvent découvrir une biodiversité exceptionnelle, des plages immaculées et des villages de pêcheurs traditionnels. L\'archipel est également un site de nidification crucial pour les tortues marines.','La Fête de l\'Indépendance : La Guinée-Bissau a obtenu son indépendance du Portugal le 24 septembre 1973. Chaque année, cette date est célébrée à travers le pays avec des défilés, des concerts, et des événements culturels. C\'est l\'occasion pour les habitants de commémorer leur histoire et leur identité nationale.','Le Cap Skirring : Cette station balnéaire située au sud de la Guinée-Bissau, près de la frontière avec le Sénégal, est réputée pour ses plages de sable doré et son atmosphère décontractée. Cap Skirring offre aux visiteurs l\'occasion de se détendre au bord de l\'océan Atlantique, de goûter à la cuisine locale, et de participer à des activités nautiques.'),('GY',4.86042,-58.9302,'Guyana','GUY',328,'??','U+1F1EC U+1F1FE',0,3,36.28859812048133,NULL,NULL,NULL,NULL),('HK',22.3964,114.109,'Hong Kong','HKG',344,'??','U+1F1ED U+1F1F0',0,4,6.530218204977194,'Hong Kong, situé sur la côte sud de la Chine, est une région administrative spéciale (RAS) jouissant d\'une autonomie considérable. Géographiquement, cette métropole dynamique est composée d\'une péninsule et de plusieurs îles. Réputée pour son impressionnant skyline, Hong Kong est un important centre financier et commercial mondial. Sa culture unique fusionne l\'influence chinoise et l\'héritage colonial britannique, créant une atmosphère cosmopolite vibrante. Politiquement, Hong Kong a été le théâtre de manifestations pro-démocratie et a fait face à des défis liés à la relation avec la Chine continentale. Sur le plan économique, la ville prospère grâce à ses secteurs financiers, des services aux exportations, en passant par le commerce et le tourisme, contribuant à en faire l\'une des économies les plus développées au monde.','Le Pic Victoria aux multiples visages : Le Pic Victoria est un incontournable à Hong Kong, offrant une vue panoramique sur la ville et le port. Ce qui rend cette expérience encore plus fascinante, c\'est le contraste entre la vue diurne et nocturne. Pendant la journée, vous pouvez admirer les gratte-ciels imposants et le panorama urbain dynamique, tandis que la nuit, la ville s\'illumine de milliers de lumières scintillantes, créant une scène urbaine spectaculaire.','Les escaliers mécaniques de Mid-levels : Hong Kong est connu pour ses ruelles en escalier et son réseau unique d\'escaliers mécaniques. Ces derniers, situés dans le quartier de Mid-levels, sont les plus longs du monde. Ils parcourent environ 800 mètres à travers une colline résidentielle, offrant aux habitants et aux visiteurs un moyen pratique de se déplacer dans la ville escarpée tout en découvrant des quartiers résidentiels pittoresques et des boutiques locales.','Le Temple Wong Tai Sin et la divination kau cim : Le Temple Wong Tai Sin est dédié au dieu de la guérison, Wong Tai Sin. Ce temple est connu pour une pratique intéressante appelée kau cim. Les visiteurs secouent un cylindre contenant des bâtonnets numérotés jusqu\'à ce qu\'un bâtonnet tombe. Chacun de ces bâtonnets a une prédiction écrite dessus, apportant des conseils sur des sujets allant de la santé aux relations. C\'est une expérience culturelle unique où les gens viennent chercher des conseils spirituels.'),('HN',15.2,-86.2419,'Honduras','HND',340,'??','U+1F1ED U+1F1F3',0,2,23.78529973680647,'Le Honduras, situé en Amérique centrale, offre une diversité de paysages allant des plages des Caraïbes aux montagnes du continent. Tegucigalpa, la capitale, et San Pedro Sula sont parmi les centres urbains importants. Le pays est doté d\'une riche histoire maya, avec des vestiges archéologiques tels que Copán. Politiquement, le Honduras est une république avec des défis socio-économiques et politiques. L\'économie repose sur l\'agriculture, les textiles, le tourisme et les remises des expatriés. La population hondurienne, composée principalement de métis, a une culture influencée par les traditions autochtones, la musique et les danses folkloriques. Malgré des enjeux de pauvreté et de violence, le Honduras attire les visiteurs avec ses plages préservées, ses parcs nationaux et son patrimoine culturel.','Les Ruines de Copán : Le site archéologique de Copán, inscrit au patrimoine mondial de l\'UNESCO, abrite les ruines d\'une ancienne cité maya. Les stèles finement sculptées, les autels et les pyramides témoignent de l\'expertise artistique et architecturale des anciens Mayas.','Les Îles de la Baie : La Baie d\'Honduras, avec ses îles de sable blanc et ses eaux cristallines, est un joyau naturel. Les îles de Roatán, Utila et Guanaja attirent les plongeurs du monde entier avec leurs récifs coralliens colorés et une vie marine diverse.','La Réserve de la Biosphère du Río Plátano : Cette réserve, également inscrite au patrimoine mondial de l\'UNESCO, est l\'une des dernières grandes étendues de forêt tropicale humide en Amérique centrale. Elle abrite une biodiversité exceptionnelle, y compris des jaguars, des singes et des toucans.'),('HR',45.1,15.2,'Croatie','HRV',191,'??','U+1F1ED U+1F1F7',0,5,99.33584714246527,'La Croatie, perchée sur les rives de la mer Adriatique, est un joyau méditerranéen offrant des plages pittoresques, des îles ensoleillées et des villes médiévales charmantes. La culture croate est influencée par l\'histoire tumultueuse de la région, avec des héritages romains, byzantins et vénitiens. En tant que république parlementaire, la Croatie a émergé comme une destination touristique prisée en Europe. Son économie, axée sur le tourisme, l\'agriculture et l\'industrie manufacturière, contribue à son développement continu.','Dubrovnik, la perle de l\'Adriatique : Dubrovnik, avec ses remparts médiévaux et ses rues de marbre, est un site du patrimoine mondial de l\'UNESCO. Des projets de préservation restauratrice sont en cours pour maintenir l\'intégrité de cette ville historique.','Le parc national des lacs de Plitvice : Le parc national des lacs de Plitvice en Croatie est renommé pour ses cascades et ses lacs turquoise. Des mesures de préservation environnementale protègent cette merveille naturelle, inscrite au patrimoine mondial de l\'UNESCO.','Le Festival de l\'été de Split : Le Festival de l\'été de Split est une célébration artistique avec des performances théâtrales, musicales et culturelles. Des initiatives culturelles visent à préserver cette tradition estivale vivante.'),('HT',18.9712,-72.2852,'Haïti','HTI',332,'??','U+1F1ED U+1F1F9',0,2,25.323339575271437,'Haïti, perle des Caraïbes sur l\'île d\'Hispaniola, est imprégnée d\'une riche histoire et d\'une culture vibrante. Ses paysages comprennent des montagnes majestueuses, des plages tropicales et des vallées verdoyantes. La culture haïtienne est influencée par des traditions africaines, européennes et autochtones, se reflétant dans sa musique, son art et ses cérémonies vaudou. En tant que république présidentielle, Haïti a traversé des défis économiques et politiques, mais la résilience du peuple haïtien demeure une caractéristique remarquable. Le tourisme, axé sur la découverte de l\'histoire et de la nature, offre aux visiteurs une expérience unique.','Les Citadelle et Palais Sans-Souci : Haïti abrite la Citadelle Laferrière et le Palais Sans-Souci, des vestiges impressionnants de l\'histoire haïtienne post-indépendance. Des initiatives de préservation et de restauration sont en cours pour maintenir ces sites historiques, reflétant la résilience et la richesse culturelle d\'Haïti.','La Fête du Carnaval : La Fête du Carnaval en Haïti est une célébration colorée avec des défilés, des danses et des costumes festifs. Des projets culturels visent à préserver cette tradition vivante, héritage de l\'influence africaine, française et autochtone dans la société haïtienne.','La biodiversité de la Forêt nationale de Macaya : La Forêt nationale de Macaya, située en Haïti, abrite une biodiversité exceptionnelle. Des efforts de conservation s\'efforcent de protéger cette réserve naturelle, habitat d\'espèces rares et endémiques.'),('HU',47.1625,19.5033,'Hongrie','HUN',348,'??','U+1F1ED U+1F1FA',0,5,28.60915952232588,'La Hongrie, nichée au cœur de l\'Europe centrale, est un pays riche en histoire et en culture. Des bains thermaux de Budapest aux vastes plaines de la Puszta, la Hongrie offre une diversité de paysages. La culture hongroise est marquée par la musique folklorique, la cuisine savoureuse et une longue tradition artistique. En tant que république parlementaire, la Hongrie a une histoire mouvementée, notamment pendant la période de l\'Empire austro-hongrois et la guerre froide. Son économie, diversifiée entre l\'agriculture, l\'industrie et les services, contribue à son influence régionale.','Le Parlement hongrois à Budapest : Le Parlement hongrois, situé à Budapest sur les rives du Danube, est un chef-d\'œuvre architectural. Des projets de restauration sont en cours pour préserver cette icône néo-gothique, symbole de l\'histoire et de la culture hongroises.','Les Bains Széchenyi : Les Bains Széchenyi à Budapest sont parmi les plus grands bains thermaux d\'Europe. Des efforts de préservation veillent à maintenir l\'authenticité de ces bains, qui sont également des lieux sociaux emblématiques.','La cuisine hongroise : La cuisine hongroise, avec des plats comme le goulasch et les chimney cakes, est une part essentielle de l\'identité nationale. Des initiatives culturelles visent à préserver ces traditions culinaires, riches en saveurs et en histoire.'),('ID',-0.789275,113.921,'Indonésie','IDN',360,'??','U+1F1EE U+1F1E9',0,4,67.07578195917958,NULL,NULL,NULL,NULL),('IE',53.4129,-8.24389,'Irlande','IRL',372,'??','U+1F1EE U+1F1EA',0,5,49.55143430228478,'L\'Irlande, située à l\'ouest de l\'Europe, est une île réputée pour sa beauté naturelle, son histoire ancienne, et sa culture riche. Dublin, la capitale, est un centre dynamique alliant modernité et tradition. L\'Irlande est caractérisée par ses paysages verdoyants, ses falaises spectaculaires, et ses lacs paisibles. Politiquement, l\'Irlande est une république démocratique. Son économie, en pleine croissance, repose sur les secteurs des technologies de l\'information, des services financiers, et de l\'agriculture. La population irlandaise, connue pour son accueil chaleureux, a une culture imprégnée de musique traditionnelle, de folklore, et de littérature, avec des écrivains tels que James Joyce et William Butler Yeats. L\'Irlande a également joué un rôle significatif dans l\'histoire mondiale, notamment avec son mouvement d\'indépendance au début du 20e siècle.','Les Falaises de Moher : Les Falaises de Moher, situées sur la côte ouest de l\'Irlande, offrent des vues spectaculaires sur l\'océan Atlantique. Elles s\'élèvent à plus de 200 mètres au-dessus de la mer et sont parmi les formations rocheuses les plus impressionnantes d\'Irlande, attirant des visiteurs du monde entier.','La Fête de la Saint-Patrick : La Saint-Patrick, le saint patron de l\'Irlande, est célébrée chaque année le 17 mars. La fête est marquée par des défilés colorés, des festivités dans tout le pays, et la tradition de porter du vert pour honorer le saint.','Le Livre de Kells : Le Livre de Kells, exposé à la Bibliothèque du Trinity College à Dublin, est un manuscrit richement enluminé qui remonte au IXe siècle. Il est considéré comme l\'un des plus beaux livres du monde, avec ses illustrations complexes et ses motifs celtiques, témoignant du riche patrimoine culturel de l\'Irlande.'),('IL',31.0461,34.8516,'Israël','ISR',376,'??','U+1F1EE U+1F1F1',0,4,46.52982870724968,'Israël, situé au Moyen-Orient sur les rives de la mer Méditerranée, est une terre sacrée pour trois grandes religions monothéistes. Ses sites historiques comprennent Jérusalem, Nazareth et la mer Morte. La culture israélienne est diversifiée, avec des influences juives, arabes et chrétiennes. En tant que république parlementaire, Israël a surmonté de nombreux défis politiques pour devenir une économie technologiquement avancée, axée sur la haute technologie, la recherche et le tourisme.','La Vieille Ville de Jérusalem : La Vieille Ville de Jérusalem, un site sacré pour plusieurs religions, est riche en histoire et en architecture. Des projets de restauration ont été entrepris pour préserver ses sites religieux, ses ruelles étroites et ses marchés animés.','La mer Morte : La mer Morte, célèbre pour sa concentration en sel, attire des visiteurs du monde entier. Des mesures environnementales sont en place pour protéger ce trésor naturel unique et son écosystème particulier.','La diversité culturelle : Israël est caractérisé par une diversité culturelle remarquable. Des initiatives éducatives et artistiques encouragent la préservation des traditions juives, chrétiennes et musulmanes qui coexistent dans ce pays.'),('IN',20.5937,78.9629,'Inde','IND',356,'??','U+1F1EE U+1F1F3',0,4,83.99484370275852,'L\'Inde, située en Asie du Sud, est un pays aux dimensions colossales, offrant une géographie variée, des montagnes de l\'Himalaya aux plages du sud. Sa culture millénaire est d\'une diversité impressionnante, influencée par les religions telles que l\'hindouisme, le bouddhisme, le jaïnisme et le sikhisme. L\'Inde est également connue pour sa richesse artistique, ses festivals colorés et ses traditions séculaires. Politiquement, l\'Inde est la plus grande démocratie du monde, avec un système parlementaire multipartite. Sur le plan économique, le pays connaît une croissance rapide, avec des secteurs tels que les technologies de l\'information, l\'industrie pharmaceutique et l\'agriculture jouant un rôle essentiel. Cependant, des défis persistent, notamment en matière de pauvreté, d\'inégalités et de pressions démographiques. L\'Inde demeure un acteur mondial influent, tant sur le plan économique que culturel.','La diversité linguistique : L\'Inde est incroyablement diversifiée sur le plan linguistique, abritant plus de 2 000 langues différentes. Hindi et l\'anglais sont les langues officielles, mais chaque État indien a sa propre langue officielle, contribuant à la riche mosaïque linguistique du pays.','Le Taj Mahal, symbole d\'amour : Le Taj Mahal, situé à Agra, est l\'un des monuments les plus emblématiques du monde et un symbole d\'amour éternel. Construit par l\'empereur moghol Shah Jahan en mémoire de son épouse bien-aimée Mumtaz Mahal, le Taj Mahal est une merveille architecturale et un site du patrimoine mondial de l\'UNESCO.','Le festival de Diwali : Diwali, également connu sous le nom de festival des lumières, est l\'une des célébrations les plus importantes en Inde. Les gens illuminent des lampes en argile, décorent leurs maisons avec des guirlandes colorées et échangent des cadeaux. Diwali symbolise la victoire de la lumière sur l\'obscurité et est célébré avec enthousiasme dans tout le pays.'),('IQ',33.2232,43.6793,'Irak','IRQ',368,'??','U+1F1EE U+1F1F6',4,4,80.38473546540806,'L\'Irak, situé au Moyen-Orient, est une terre ancienne marquée par des sites historiques emblématiques et une culture riche. Des plaines mésopotamiennes aux montagnes kurdes, l\'Irak offre une diversité géographique unique. La culture irakienne, imprégnée d\'influences arabes, kurdes et assyriennes, se manifeste dans l\'art, la musique et la cuisine. Malgré des défis politiques et sécuritaires, l\'Irak possède un héritage archéologique exceptionnel, attirant les passionnés d\'histoire et les aventuriers curieux.','Les Jardins suspendus de Babylone : Les Jardins suspendus de Babylone, l\'une des Sept Merveilles du monde antique, étaient situés en Irak. Bien que leur existence exacte soit parfois remise en question, des projets de préservation archéologique visent à explorer et comprendre cet héritage légendaire.','La Route de la Soie en Irak : L\'Irak a été un carrefour clé de la Route de la Soie, favorisant le commerce et l\'échange culturel. Des initiatives de préservation archéologique travaillent à protéger les sites liés à cette route historique, offrant un témoignage de la diversité culturelle passée.','Le Ziggurat d\'Ur : Le Ziggurat d\'Ur, une structure pyramidale ancienne, est un site archéologique impressionnant. Des efforts de préservation sont déployés pour maintenir cette construction sumérienne, témoignant de la riche histoire de la Mésopotamie.'),('IR',32.4279,53.688,'Iran','IRN',364,'??','U+1F1EE U+1F1F7',0,4,49.93914929212923,'L\'Iran, situé au carrefour de l\'Asie de l\'Ouest, est un pays d\'une histoire millénaire, célèbre pour son architecture islamique, ses tapis persans et sa cuisine raffinée. Les paysages varient du désert de Lut aux montagnes de l\'Alborz. En tant que république islamique, l\'Iran a une influence culturelle étendue dans la région. Son économie repose sur le pétrole, l\'industrie manufacturière et l\'agriculture. Malgré des défis politiques et économiques, l\'Iran conserve une identité culturelle forte et diversifiée.','Persépolis, ancienne capitale perse : Persépolis, l\'ancienne capitale de l\'Empire perse, est un site archéologique majeur. Des projets de préservation archéologique veillent à protéger les palais et les bas-reliefs qui témoignent de la grandeur de l\'histoire perse.','Ispahan et ses ponts historiques : Ispahan, avec ses magnifiques ponts, dont le Pont Khaju, est un trésor architectural en Iran. Des initiatives de restauration maintiennent la beauté de ces ponts historiques, reflets de l\'ingénierie perse.','La cérémonie du Nowruz : La célébration du Nowruz, le Nouvel An iranien, est une tradition ancienne. Des projets culturels visent à préserver cette cérémonie, qui marque le début du printemps et symbolise le renouveau.'),('IS',64.9631,-19.0208,'Islande','ISL',352,'??','U+1F1EE U+1F1F8',0,5,8.541543137786485,'L\'Islande, une île située dans l\'océan Atlantique Nord, est caractérisée par des paysages époustouflants, comprenant des glaciers, des volcans, des geysers et des champs de lave. La culture islandaise est profondément enracinée dans les sagas médiévales, la poésie et les traditions nordiques. La population islandaise, relativement petite, est connue pour son haut niveau d\'éducation et son engagement envers l\'égalité des genres. Politiquement, l\'Islande est une république parlementaire, et elle est souvent reconnue pour sa stabilité politique. Sur le plan économique, les secteurs de la pêche, du tourisme et de l\'énergie géothermique sont cruciaux. Le pays met également l\'accent sur les énergies renouvelables et la protection de l\'environnement. Bien que confrontée à des défis tels que l\'équilibre entre le tourisme et la préservation de la nature, l\'Islande continue de susciter l\'admiration pour sa beauté naturelle et sa qualité de vie élevée.','Les aurores boréales : L\'Islande est l\'un des endroits privilégiés pour observer les aurores boréales. Ces spectacles lumineux dans le ciel, causés par l\'interaction des particules solaires avec l\'atmosphère terrestre, sont particulièrement visibles pendant les mois d\'hiver.','La géothermie : L\'Islande est riche en activité géothermique en raison de son emplacement sur la dorsale médio-atlantique. Les sources d\'eau chaude, les geysers et les champs de lave offrent une expérience unique et sont souvent utilisés pour la production d\'énergie géothermique.','Les piscines géothermiques : Les piscines géothermiques, comme le Blue Lagoon, sont des attractions populaires en Islande. Ces piscines naturelles chauffées par l\'énergie géothermique offrent une expérience relaxante et sont souvent entourées de paysages spectaculaires.'),('IT',41.8719,12.5674,'Italie','ITA',380,'??','U+1F1EE U+1F1F9',0,5,92.89027088590923,'L\'Italie, située au cœur de la Méditerranée en Europe du Sud, est un pays riche en histoire, culture et beauté naturelle. Géographiquement diversifiée, elle offre des paysages allant des Alpes impressionnantes au nord aux magnifiques côtes méditerranéennes. La culture italienne est mondialement reconnue pour son art, sa musique, sa cuisine délicieuse et son mode de vie dolce vita. Sur le plan politique, l\'Italie est une république parlementaire, avec une histoire politique dynamique marquée par des moments clés tels que la Renaissance et la formation de l\'État italien unifié au XIXe siècle. Économiquement, l\'Italie est l\'une des principales économies mondiales, avec une forte présence dans l\'industrie manufacturière, la mode, l\'automobile et le tourisme. Malgré certains défis économiques, l\'Italie demeure un acteur influent sur la scène internationale, tout en préservant son héritage culturel unique.','La tour de Pise, l\'une des merveilles architecturales les plus célèbres au monde, a commencé à pencher peu de temps après le début de sa construction au XIIe siècle. Cette inclinaison était le résultat d\'un sol instable. Malgré son inclinaison apparente, la tour est restée debout pendant des siècles, devenant une attraction emblématique. Des efforts de restauration ont été entrepris pour stabiliser la tour et garantir sa sécurité.','La Cène de Léonard de Vinci : La Cène, l\'une des œuvres d\'art les plus renommées au monde, se trouve dans le réfectoire du couvent de Santa Maria delle Grazie à Milan. Peinte par Léonard de Vinci entre 1495 et 1498, cette fresque représente le dernier repas de Jésus avec ses disciples. L\'œuvre a été gravement endommagée au fil des siècles, mais des travaux de restauration ont été entrepris pour préserver cette pièce maîtresse.','Venise, la cité des canaux : La ville de Venise est célèbre pour ses canaux sinueux et ses bâtiments romantiques. Ce qui rend Venise unique, c\'est que la ville est construite sur un archipel de 118 îles reliées par plus de 400 ponts. Les canaux, y compris le Grand Canal, sont les principales artères de la ville, naviguées par des gondoles et des vaporettos, créant une atmosphère romantique et pittoresque.'),('JM',18.1096,-77.2975,'Jamaïque','JAM',388,'??','U+1F1EF U+1F1F2',0,2,38.82672808955119,'La Jamaïque, une île située dans la mer des Caraïbes, est réputée pour sa culture vibrante, ses plages de sable blanc, ses montagnes verdoyantes et son histoire musicale riche. Géographiquement, elle est la troisième plus grande île des Grandes Antilles. La population jamaïcaine est le reflet d\'une diversité ethnique, avec une majorité d\'ascendance africaine, ainsi que des influences européennes, asiatiques et indigènes. La culture jamaïcaine a eu un impact mondial, en particulier à travers le reggae, le dancehall et le ska, qui ont émergé de la scène musicale locale. Politiquement, la Jamaïque est une démocratie parlementaire indépendante, bien que faisant partie du Commonwealth. Sur le plan économique, le tourisme, l\'agriculture (notamment la production de bananes et de café) et l\'industrie minière sont des secteurs clés. La Jamaïque a également été un centre d\'activités sportives, produisant des athlètes de renom mondial, notamment dans le domaine du sprint. L\'île attire les visiteurs avec sa musique envoûtante, son atmosphère détendue et ses paysages tropicaux.','La Musique Reggae et Bob Marley : La Jamaïque est mondialement célèbre pour son influence sur la musique reggae, et le légendaire Bob Marley en est l\'icône emblématique. Les visiteurs peuvent explorer le Musée Bob Marley à Kingston pour en apprendre davantage sur la vie et l\'héritage de ce musicien emblématique, tout en découvrant les racines du reggae dans la culture jamaïcaine.','Les Plages de Sable Blanc de Negril : Negril est réputée pour ses plages paradisiaques, en particulier la célèbre Seven Mile Beach. Les visiteurs peuvent profiter du sable blanc et des eaux cristallines tout en découvrant l\'ambiance décontractée de la Jamaïque. Les couchers de soleil spectaculaires sur la mer des Caraïbes sont une expérience inoubliable.','Le Blue Mountain Coffee : Les montagnes bleues de la Jamaïque sont le berceau du célèbre café Blue Mountain, l\'un des cafés les plus prisés au monde. Les visiteurs peuvent explorer les plantations de café, découvrir le processus de production, et déguster ce café de qualité supérieure dans un cadre pittoresque en altitude.'),('JO',30.5852,36.2384,'Jordanie','JOR',400,'??','U+1F1EF U+1F1F4',0,4,15.462830863392755,NULL,NULL,NULL,NULL),('JP',36.2048,138.253,'Japon','JPN',392,'??','U+1F1EF U+1F1F5',0,4,60.83397312167471,'Le Japon, situé dans l\'est de l\'Asie, est un archipel composé de quatre îles principales. Sa géographie est marquée par des montagnes, des plaines côtières et une activité sismique significative. La culture japonaise est profondément enracinée dans la tradition, alliant l\'ancien et le moderne. Les influences du shintoïsme et du bouddhisme se manifestent dans les pratiques religieuses, les festivals et l\'architecture des temples. Sur le plan politique, le Japon est une monarchie constitutionnelle avec un système parlementaire, et il est reconnu pour sa stabilité politique. L\'économie japonaise est l\'une des plus grandes au monde, reposant sur des industries technologiques avancées, l\'automobile, et l\'exportation de produits électroniques. Malgré les défis démographiques, le Japon demeure un leader mondial en innovation et en culture populaire.','Le Mont Fuji : Le Mont Fuji est le plus haut sommet du Japon et est un symbole national. Considéré comme une montagne sacrée, le Fuji-san attire des alpinistes et des visiteurs du monde entier. Il est également une source d\'inspiration artistique et spirituelle depuis des siècles.','L\'île aux Lapins : Ōkunoshima, située dans la mer intérieure de Seto, est connue comme l\'île aux lapins. Autrefois utilisée comme site de production de gaz toxique pendant la Seconde Guerre mondiale, l\'île est aujourd\'hui un lieu paisible où les visiteurs peuvent interagir avec des lapins en liberté.','Les Cerisiers en Fleurs (Sakura) : Les cerisiers en fleurs, connus sous le nom de \"Sakura\", sont emblématiques du Japon. Chaque printemps, le pays célèbre la saison de la floraison des cerisiers avec des pique-niques sous les arbres (hanami). C\'est une tradition profondément enracinée dans la culture japonaise.'),('KE',-0.023559,37.9062,'Kenya','KEN',404,'??','U+1F1F0 U+1F1EA',0,1,57.781376091559764,NULL,NULL,NULL,NULL),('KG',41.2044,74.7661,'Kirghizstan','KGZ',417,'??','U+1F1F0 U+1F1EC',0,4,6.404964166139219,'Le Kirghizistan, situé en Asie centrale, est un pays montagneux aux paysages spectaculaires, avec les sommets des montagnes du Tian Shan couvrant une grande partie du territoire. La culture kirghize est influencée par les traditions nomades et l\'héritage turcique, reflétant une riche histoire marquée par les routes de la soie. Les yourtes, symboles de la vie nomade, sont toujours utilisées et représentent une partie importante de la culture locale. Politiquement, le Kirghizistan est une république parlementaire, bien que son histoire ait été marquée par des périodes d\'instabilité politique. Sur le plan économique, l\'agriculture, l\'élevage et les ressources minérales, notamment l\'or, jouent un rôle essentiel. Le pays est également un carrefour géopolitique stratégique en Asie centrale. Malgré des défis liés à la gouvernance et à la pauvreté, le Kirghizistan cherche à renforcer sa stabilité politique et à diversifier son économie, en mettant l\'accent sur le tourisme et les secteurs émergents.','Le lac Issyk-Koul : Le Kirghizstan abrite le lac Issyk-Koul, l\'un des plus grands lacs de montagne au monde. Le lac est entouré de paysages montagneux spectaculaires et est souvent appelé \"la perle de l\'Asie centrale\". Il joue un rôle important dans la vie des habitants, offrant des activités nautiques et des points de vue pittoresques.','Le cheval, compagnon essentiel : Les chevaux jouent un rôle essentiel dans la culture kirghize. La tradition équestre est profondément enracinée, et les compétitions équestres telles que les courses de chevaux et le kok-boru (un jeu traditionnel avec une carcasse de chèvre) sont populaires.','Le pic Pobeda : Le pic Pobeda, également connu sous le nom de Jengish Chokusu, est la montagne la plus haute du Kirghizstan. Elle culmine à plus de 7 400 mètres d\'altitude dans la chaîne de montagnes Tian Shan et est un défi pour les alpinistes expérimentés.'),('KH',12.5657,104.991,'Cambodge','KHM',116,'??','U+1F1F0 U+1F1ED',0,4,58.6806956293813,'Le Cambodge, situé en Asie du Sud-Est, est un pays imprégné d\'une riche histoire, d\'une culture ancienne et de paysages pittoresques. Phnom Penh, la capitale, témoigne de cette histoire avec ses temples bouddhistes, ses marchés animés et le palais royal. Angkor Wat, l\'un des plus grands ensembles de temples du monde, est emblématique du passé glorieux du Cambodge. Politiquement, le pays est une monarchie constitutionnelle. L\'économie cambodgienne, en croissance, dépend largement de l\'agriculture, du textile et du tourisme. La population cambodgienne, principalement khmère, contribue à une culture influencée par le bouddhisme, les danses traditionnelles et les festivals colorés. Le Cambodge, bien que marqué par des épisodes douloureux de son histoire récente, se tourne vers l\'avenir avec optimisme, attirant les visiteurs avec son patrimoine culturel, ses sites historiques et sa hospitalité chaleureuse.','Les Temples d\'Angkor : Angkor, situé près de Siem Reap, est le site archéologique le plus emblématique du Cambodge. Les temples majestueux, tels qu\'Angkor Wat et Angkor Thom, témoignent de la grandeur de l\'empire khmer au XIIe siècle. Angkor Wat est le plus grand temple religieux du monde et attire des visiteurs du monde entier.','Les Danses Traditionnelles Apsara : Les danses traditionnelles Apsara sont un aspect essentiel de la culture cambodgienne. Ces danses classiques, exécutées par des danseuses vêtues de costumes somptueux, racontent des histoires mythologiques et religieuses. Les spectacles de danse Apsara sont souvent présentés dans les restaurants et les spectacles culturels à travers le pays.','Le Lac Tonlé Sap : Le lac Tonlé Sap est le plus grand lac d\'eau douce en Asie du Sud-Est et un écosystème vital pour le Cambodge. Pendant la saison des pluies, le lac peut atteindre jusqu\'à quatre fois sa taille normale, inondant les plaines environnantes. Cela donne lieu à des villages flottants fascinants où les habitants vivent sur l\'eau.'),('KI',-3.37042,-168.734,'Kiribati','KIR',296,'??','U+1F1F0 U+1F1EE',0,6,74.1885887218533,NULL,NULL,NULL,NULL),('KM',-11.875,43.8722,'Comores','COM',174,'??','U+1F1F0 U+1F1F2',0,1,94.90085979448712,'Les Comores, un archipel volcanique situé dans l\'océan Indien, se trouvent entre Madagascar et la côte mozambicaine. Les Comores se composent de quatre îles principales, Grande Comore, Mohéli, Anjouan et Mayotte. La culture comorienne est imprégnée d\'influences africaines, arabes et malgaches, créant une identité unique. La population est majoritairement sunnite et la culture swahilie est un élément essentiel de la vie quotidienne. Politiquement, les Comores sont une république fédérale, mais ont parfois connu des périodes d\'instabilité politique et de tensions entre les îles. Sur le plan économique, l\'agriculture, la pêche et le secteur des services sont essentiels à la subsistance. Les Comores font face à des défis tels que la pauvreté, l\'accès limité aux services de base et la vulnérabilité aux catastrophes naturelles. Le tourisme, bien que sous-développé, représente un potentiel économique, grâce à la beauté naturelle de l\'archipel. Les Comores travaillent à renforcer la stabilité politique et à promouvoir un développement économique plus durable.','Le marché de Moroni : La capitale des Comores, Moroni, abrite un marché animé où les habitants vendent une variété de produits locaux tels que des fruits, des épices, des textiles et des objets artisanaux. Le marché offre une immersion colorée dans la vie quotidienne comorienne.','Le Grand Comorien : Le volcan Karthala, situé sur l\'île de Grande Comore, est l\'un des volcans les plus actifs au monde. Les visiteurs peuvent entreprendre des randonnées pour atteindre le sommet et profiter de vues spectaculaires sur le cratère.','L\'archipel des Comores : L\'archipel des Comores est composé de quatre îles principales : Grande Comore, Mohéli, Anjouan et Mayotte. Chacune de ces îles a sa propre personnalité et offre une diversité de paysages, allant des plages de sable blanc aux montagnes volcaniques.'),('KR',35.9078,127.767,'Corée du Sud','KOR',410,'??','U+1F1F0 U+1F1F7',0,4,51.93853588024018,NULL,NULL,NULL,NULL),('KW',29.3117,47.4818,'Koweït','KWT',414,'??','U+1F1F0 U+1F1FC',0,4,74.99010309110406,'Le Koweït, situé dans la partie nord-est de la péninsule arabique, est un petit pays riche en pétrole. Géographiquement, il est bordé par l\'Irak au nord et l\'Arabie saoudite au sud, avec un littoral le long du golfe Persique. La culture koweïtienne est fortement influencée par l\'islam et par l\'héritage bédouin, bien que la modernisation ait également laissé son empreinte. La population est principalement composée d\'Arabes, avec une minorité significative d\'expatriés. Politiquement, le Koweït est une monarchie constitutionnelle avec un système parlementaire. Sur le plan économique, le pays a l\'une des économies les plus prospères du monde en raison de ses vastes réserves de pétrole. Cela a permis au Koweït de développer des infrastructures modernes, des services sociaux et de maintenir un niveau de vie élevé pour ses citoyens. Cependant, le pays fait face à des défis liés à la diversification économique, à la durabilité environnementale et à la gestion des ressources non renouvelables. Malgré ces défis, le Koweït continue de jouer un rôle important sur la scène régionale en tant que nation prospère du golfe Persique.','La tour Kuwait : La Kuwait Towers, ou les Tours du Koweït, sont l\'une des icônes modernes du pays. Ces tours emblématiques, situées à Koweït City, comprennent une tour d\'eau et deux tours de restaurant. Elles offrent une vue panoramique sur la ville et le golfe Persique.','La Réserve naturelle de Boubyan : La Réserve naturelle de Boubyan, située sur l\'île de Boubyan, est un site naturel préservé. Elle abrite une variété d\'écosystèmes, des marais salants aux dunes de sable, offrant un habitat crucial pour la faune locale, y compris les oiseaux migrateurs.','Le Musée national du Koweït : Le Musée national du Koweït est un lieu culturel important qui met en valeur l\'histoire et la culture du pays. Il abrite des expositions variées, notamment des artefacts archéologiques, des expositions artistiques et des témoignages de l\'histoire récente du Koweït.'),('KY',19.5135,-80.567,'Îles Caïmans','CYM',136,'??','U+1F1F0 U+1F1FE',0,2,19.13491088816422,'Les Îles Caïmans, un territoire britannique d\'outre-mer dans les Caraïbes, sont un archipel de trois îles, Grand Cayman, Cayman Brac et Little Cayman. Géographiquement, elles offrent des plages de sable blanc, des eaux cristallines et une vie marine abondante. La culture des Îles Caïmans est diversifiée, avec des influences britanniques, africaines, et caribéennes, reflétées dans la cuisine locale, la musique et les festivals. Politiquement, les Îles Caïmans sont un territoire britannique avec un gouvernement autonome. Sur le plan économique, les Îles Caïmans sont un important centre financier international, attirant des institutions financières mondiales en raison de leur réglementation favorable. Le tourisme est également un secteur important, attirant des visiteurs pour la plongée sous-marine, les sports nautiques et la détente. Bien que prospères, les Îles Caïmans font face à des préoccupations telles que la préservation de l\'écosystème marin, la durabilité environnementale et des questions liées à la transparence financière.','La Stingray City : Les Îles Caïmans sont connues pour la Stingray City, où les visiteurs peuvent nager et interagir avec des raies pastenagues. C\'est une attraction populaire qui offre une expérience unique de proximité avec ces créatures marines amicales.','La plage de Seven Mile : La plage de Seven Mile est l\'une des plages les plus célèbres des Îles Caïmans, réputée pour ses eaux cristallines, son sable blanc et ses magnifiques couchers de soleil. C\'est un lieu idéal pour la détente, la plongée en apnée et les sports nautiques.','La diversité marine : Les Îles Caïmans offrent des opportunités exceptionnelles pour la plongée sous-marine et la plongée en apnée. Les récifs coralliens abondants et la vie marine variée attirent les amateurs de plongée du monde entier.'),('KZ',48.0196,66.9237,'Kazakhstan','KAZ',398,'??','U+1F1F0 U+1F1FF',0,4,70.70424824087344,'Le Kazakhstan, vaste pays d\'Asie centrale, est marqué par sa diversité géographique allant des vastes steppes aux hautes montagnes et aux vastes déserts. Il est le plus grand pays enclavé du monde et partage ses frontières avec la Russie, la Chine, le Kirghizistan, l\'Ouzbékistan et le Turkménistan. La culture kazakhe est profondément enracinée dans les traditions nomades, avec une influence russe et asiatique significative. La musique, la danse et l\'artisanat traditionnel reflètent cette riche héritage culturel. Politiquement, le Kazakhstan est une république présidentielle avec un système politique stable depuis son indépendance de l\'Union soviétique en 1991. Nursultan Nazarbayev, le premier président, a joué un rôle majeur dans la modernisation du pays. Depuis 2019, Kassym-Jomart Tokayev est président. Économiquement, le Kazakhstan tire ses revenus de l\'industrie pétrolière, gazière et minière, étant l\'un des principaux producteurs mondiaux de matières premières. Les efforts de diversification économique visent à promouvoir d\'autres secteurs tels que les technologies de l\'information, le tourisme et les énergies renouvelables. Le Kazakhstan joue également un rôle actif sur la scène internationale en tant que médiateur dans les conflits régionaux et en tant que promoteur de la coopération économique en Asie centrale. Malgré ses défis, le Kazakhstan continue de se développer en tant que nation émergente et influente en Eurasie.','Le Lac Balkhash : Le Kazakhstan abrite le lac Balkhash, l\'un des plus grands lacs d\'eau douce au monde. Ce lac est unique en raison de sa bifurcation : la partie occidentale est salée, tandis que la partie orientale est douce. Cette division crée une diversité écologique fascinante, avec une faune variée et des paysages pittoresques tout autour.','Le Cosmodrome de Baïkonour : Le Kazakhstan est le site du célèbre cosmodrome de Baïkonour, le plus ancien et le plus grand cosmodrome opérationnel au monde. Il a été le lieu de lancement de nombreux événements spatiaux historiques, dont le lancement du premier homme dans l\'espace par Youri Gagarine en 1961. Des visites guidées permettent aux visiteurs de découvrir l\'histoire spatiale riche du Kazakhstan.','Astana (Noursoultan) - La Capitale Futuriste : La capitale du Kazakhstan, a été renommée Noursoultan en l\'honneur du premier président Nursultan Nazarbayev. Elle est connue pour son architecture futuriste et moderne. Des bâtiments emblématiques tels que la Tour Bayterek et le Palais de la Paix et de la Réconciliation témoignent de l\'ambition du Kazakhstan pour le développement économique et culturel.'),('LA',19.8563,102.495,'Laos','LAO',418,'??','U+1F1F1 U+1F1E6',0,4,96.11651161323907,NULL,NULL,NULL,NULL),('LB',33.8547,35.8623,'Liban','LBN',422,'??','U+1F1F1 U+1F1E7',0,4,68.46981641693955,NULL,NULL,NULL,NULL),('LC',13.9094,-60.9789,'Sainte-Lucie','LCA',662,'??','U+1F1F1 U+1F1E8',0,2,53.999550318345015,NULL,NULL,NULL,NULL),('LI',47.166,9.55537,'Liechtenstein','LIE',438,'??','U+1F1F1 U+1F1EE',0,5,64.58830541427089,'Le Liechtenstein, situé en Europe centrale, est l\'une des plus petites nations du monde, enclavée entre la Suisse et l\'Autriche. Géographiquement, il est dominé par les Alpes, offrant des paysages montagneux et des vallées pittoresques. Le Liechtenstein est une principauté héréditaire avec une monarchie constitutionnelle. Culturellement, le pays est influencé par sa proximité avec l\'Autriche et la Suisse, avec une forte présence de la culture germanique. La musique, l\'art et les festivals traditionnels sont des éléments importants de la vie culturelle. Politiquement, le Liechtenstein est caractérisé par une stabilité institutionnelle et économique. Le pays est connu pour son système financier solide et son statut de paradis fiscal, attirant des entreprises internationales. L\'économie liechtensteinoise repose sur l\'industrie, les services financiers, le tourisme et l\'agriculture. Malgré sa petite taille, le Liechtenstein jouit d\'une qualité de vie élevée et demeure un exemple de réussite économique au cœur de l\'Europe.','Le Château de Vaduz : Le Château de Vaduz est la résidence officielle du prince de Liechtenstein. Perché sur une colline surplombant la capitale Vaduz, le château ne peut pas être visité à l\'intérieur, mais il est un symbole important du pays et offre une vue panoramique sur la vallée du Rhin.','Les Collections d\'Art : Le Liechtenstein abrite des collections artistiques impressionnantes. La Fondation d\'Art du Liechtenstein détient une collection d\'œuvres d\'art européennes allant du Moyen Âge au contemporain. Le musée d\'Art Moderne est un autre lieu où les amateurs d\'art peuvent apprécier des expositions temporaires.','Le Carnaval de Schaan : Le Liechtenstein célèbre son propre carnaval, appelé \"Fasching\". La ville de Schaan organise l\'un des plus grands défilés de carnaval du pays, avec des chars, des costumes, de la musique et des festivités animées qui attirent les habitants et les visiteurs.'),('LK',7.87305,80.7718,'Sri Lanka','LKA',144,'??','U+1F1F1 U+1F1F0',0,4,60.94287918968394,'Le Sri Lanka, une île tropicale située au sud de l\'Inde, est une destination exotique avec des plages paradisiaques, des montagnes verdoyantes et des sites historiques. La culture sri-lankaise est imprégnée de traditions bouddhistes, hindoues et musulmanes. En tant que république, le Sri Lanka a connu des périodes de conflit mais s\'efforce de développer son économie basée sur l\'agriculture, le tourisme et les industries émergentes. L\'hospitalité chaleureuse des Sri-Lankais ajoute une touche spéciale à l\'expérience de voyage.','Le Rocher de Sigirîya : Le Rocher de Sigirîya, une forteresse ancienne perchée au sommet d\'une roche, est un site emblématique du Sri Lanka. Des efforts de préservation ont été déployés pour maintenir cette merveille architecturale et son environnement environnant.','Les jardins de Kandy : Les Jardins royaux de Peradeniya à Kandy sont parmi les plus beaux jardins botaniques du monde. Des projets de préservation botanique sont en place pour maintenir la diversité florale et la beauté de ces jardins.','La faune sauvage à Yala : Le parc national de Yala au Sri Lanka abrite une riche diversité d\'animaux sauvages. Des efforts de conservation sont déployés pour protéger les éléphants, léopards et autres espèces qui appellent cette réserve leur foyer.'),('LS',-29.61,28.2336,'Lesotho','LSO',426,'??','U+1F1F1 U+1F1F8',0,1,10.949482778971534,'Le Lesotho, un petit royaume enclavé en Afrique australe, est connu pour ses montagnes escarpées, ses vallées fertiles et ses traditions culturelles riches. Enclavé au sein de l\'Afrique du Sud, le Lesotho a une histoire marquée par la résistance aux influences coloniales. La culture sesotho, avec ses danses traditionnelles et ses textiles colorés, reflète la fierté nationale. En tant que monarchie constitutionnelle, le Lesotho fait face à des défis économiques, mais son agriculture, son industrie textile et le tourisme montagnard contribuent à son développement.','Le royaume montagneux : Le Lesotho est entièrement constitué de montagnes, ce qui en fait le seul pays au monde dont toute l\'altitude est à plus de 1 000 mètres. Des initiatives environnementales sont en place pour protéger les écosystèmes de montagne et promouvoir le tourisme durable.','Thaba Bosiu : Thaba Bosiu, une montagne au Lesotho, est un site historique et culturel. Des projets de préservation archéologique veillent à protéger les vestiges de cette montagne, qui a joué un rôle crucial dans l\'histoire du Lesotho.','La culture du Basotho : La culture du Basotho, avec ses danses, ses chants et ses tissages traditionnels, est un élément clé de l\'identité nationale. Des initiatives éducatives visent à préserver et promouvoir ces coutumes riches et uniques.'),('LT',55.1694,23.8813,'Lituanie','LTU',440,'??','U+1F1F1 U+1F1F9',0,5,71.91877939917033,'La Lituanie, située dans la région balte de l\'Europe du Nord, est un pays aux riches traditions culturelles et à l\'histoire ancienne. Géographiquement, la Lituanie possède une côte le long de la mer Baltique, des forêts verdoyantes et des lacs pittoresques. La culture lituanienne est profondément enracinée dans le folklore, les chants traditionnels et les coutumes ancestrales. La langue lituanienne est l\'une des plus anciennes langues indo-européennes encore parlées aujourd\'hui. Politiquement, la Lituanie est une république parlementaire, membre de l\'Union européenne depuis 2004 et de l\'OTAN depuis 2004. Le pays a connu des transformations significatives depuis son indépendance de l\'Union soviétique en 1990, s\'engageant dans des réformes économiques et politiques. Sur le plan économique, la Lituanie a réussi à diversifier son économie, avec des secteurs tels que la technologie de l\'information, la logistique et le tourisme en croissance. Bien que faisant face à des défis, la Lituanie continue de jouer un rôle actif sur la scène internationale et de maintenir son identité culturelle unique.','Bunkers Enigmatiques : L\'Albanie est connue pour ses bunkers, un héritage du régime communiste de Enver Hoxha. Pendant la Guerre froide, Hoxha a fait construire des milliers de bunkers dispersés dans tout le pays pour se protéger contre une invasion étrangère. Aujourd\'hui, ces structures sont devenues des curiosités touristiques et témoignent d\'une période révolue.','La Riviera Albanaise : Le long de la mer Adriatique, est réputée pour ses plages de sable blanc, ses criques isolées et ses eaux cristallines. Cette région côtière offre non seulement des paysages magnifiques, mais aussi une atmosphère détendue et préservée.','Capitale Colorée : Tirana, la capitale de l\'Albanie, est une ville en pleine transformation. Elle se distingue par ses bâtiments colorés, ses parcs vivants et son atmosphère animée. Skanderbeg Square, au cœur de Tirana, est entouré de bâtiments historiques et de monuments symboliques.'),('LU',49.8153,6.12958,'Luxembourg','LUX',442,'??','U+1F1F1 U+1F1FA',0,5,26.74545173230157,'Le Luxembourg, petit pays enclavé en Europe occidentale, est souvent surnommé le \"pays des châteaux\" en raison de ses nombreux châteaux médiévaux dispersés à travers le pays. Avec Luxembourg-Ville comme capitale, le pays est renommé pour son mélange harmonieux de modernité et de patrimoine historique. Politiquement stable en tant que grande-duché, le Luxembourg est un centre financier majeur avec une économie prospère axée sur la banque et les services financiers. Sa population, multilingue et diversifiée, contribue à une atmosphère cosmopolite. Le Luxembourg offre également des paysages pittoresques avec ses vallées verdoyantes et ses collines, attirant les amoureux de la nature et les amateurs d\'histoire.','Les Casemates du Bock : Le Luxembourg est connu pour son passé militaire, et les Casemates du Bock en sont un exemple fascinant. Ces galeries souterraines, creusées dans le roc au cours des siècles, servaient de fortifications et de refuges militaires. Aujourd\'hui, les visiteurs peuvent explorer ces tunnels et en apprendre davantage sur l\'histoire militaire du pays.','La Vieille Ville de Luxembourg : La Vieille Ville de Luxembourg, classée au patrimoine mondial de l\'UNESCO, est un mélange charmant d\'histoire et de culture. Les ruelles pavées, les places pittoresques, et les bâtiments historiques comme la Cathédrale Notre-Dame ajoutent une atmosphère médiévale à la ville.','La Philharmonie Luxembourg : La Philharmonie Luxembourg est une salle de concert moderne et emblématique, conçue par l\'architecte Christian de Portzamparc. Inaugurée en 2005, elle est devenue un lieu majeur pour la musique classique, contemporaine et jazz au Luxembourg. La conception architecturale audacieuse de la Philharmonie en fait un site culturel unique.'),('LV',56.8796,24.6032,'Lettonie','LVA',428,'??','U+1F1F1 U+1F1FB',0,5,17.970923537361365,'La Lettonie, située dans la région balte de l\'Europe du Nord, partage ses frontières avec l\'Estonie au nord, la Russie à l\'est, la Biélorussie au sud-est, et la Lituanie au sud. Géographiquement, le pays est caractérisé par ses vastes forêts, ses lacs et sa côte le long de la mer Baltique à l\'ouest. Culturellement, la Lettonie a une riche histoire influencée par les traditions baltes, l\'occupation allemande, suédoise et russe, ainsi que son indépendance retrouvée en 1918. Sa capitale, Riga, est célèbre pour son architecture médiévale et ses quartiers Art nouveau. Politiquement, la Lettonie est une république parlementaire membre de l\'Union européenne et de l\'OTAN. Sur le plan économique, le pays a connu une transition réussie vers une économie de marché depuis la chute de l\'Union soviétique, avec une croissance soutenue et une diversification des secteurs tels que les services financiers, l\'informatique et la production alimentaire. La Lettonie s\'efforce également de préserver son environnement naturel et sa biodiversité.','Fête de la Chanson et de la Danse : La Lettonie est célèbre pour sa Fête de la Chanson et de la Danse, un événement culturel qui a lieu tous les cinq ans. Il rassemble des milliers de chanteurs, danseurs et musiciens venant de toute la Lettonie pour célébrer la culture nationale. L\'événement a une longue tradition remontant à la fin du XIXe siècle et a même été reconnu comme chef-d\'œuvre du patrimoine oral et immatériel de l\'humanité par l\'UNESCO.','Plage de Jurmala : Jurmala, une station balnéaire le long de la mer Baltique, est réputée pour sa plage de sable blanc et ses maisons en bois aux styles architecturaux variés. C\'est un lieu de détente populaire, non seulement pour les habitants de Riga, la capitale, mais aussi pour les visiteurs étrangers.','Baltic Way : En 1989, environ deux millions de personnes se sont tenues main dans la main sur une distance de 600 kilomètres à travers les trois États baltes (Lettonie, Lituanie et Estonie) pour former la \"Baltic Way\". Cette manifestation pacifique visait à protester contre l\'occupation soviétique et à réclamer l\'indépendance. Cet événement symbolique a joué un rôle important dans le processus d\'indépendance des États baltes.'),('LY',26.3351,17.2283,'Libye','LBY',434,'??','U+1F1F1 U+1F1FE',3,1,9.618265563266599,NULL,NULL,NULL,NULL),('MA',31.7917,-7.09262,'Maroc','MAR',504,'??','U+1F1F2 U+1F1E6',0,1,94.1785602776134,'Le Maroc, situé au nord-ouest de l\'Afrique, est un pays aux multiples facettes. Sur le plan géographique, il partage ses frontières avec l\'océan Atlantique à l\'ouest, la mer Méditerranée au nord, et il est voisin de l\'Algérie à l\'est. Le Maroc présente une diversité de paysages, allant des montagnes du Haut Atlas aux vastes étendues désertiques du Sahara. Culturellement, le Maroc est influencé par une histoire riche comprenant des éléments berbères, arabes, andalous et français. Cette diversité culturelle se reflète dans l\'artisanat, l\'architecture, la musique et la cuisine, notamment le célèbre couscous et le thé à la menthe. Politiquement, le Maroc est une monarchie constitutionnelle dirigée par le roi Mohammed VI. Sur le plan économique, le pays a diversifié ses secteurs, mettant l\'accent sur l\'agriculture, l\'industrie et les services. Le tourisme, avec ses villes impériales, ses médinas historiques et ses stations balnéaires, est également un moteur économique important pour le Maroc. Malgré des défis, le pays continue de travailler sur son développement économique et social.','Désert du Sahara : Une partie du Sahara traverse le sud du Maroc, offrant des paysages désertiques extraordinaires. La ville de Merzouga est particulièrement connue pour ses dunes de sable spectaculaires, où les visiteurs peuvent faire l\'expérience de balades à dos de chameau et de nuits sous les étoiles dans des camps nomades.','Médinas historiques : Le Maroc est célèbre pour ses médinas, vieilles villes historiques entourées de remparts. La médina de Fès est l\'une des plus anciennes et des mieux préservées au monde, avec ses ruelles étroites, ses souks animés et ses monuments architecturaux impressionnants.','La cuisine marocaine : La cuisine marocaine est réputée pour ses saveurs riches et variées. Des plats emblématiques tels que le couscous, le tajine et les pâtisseries comme les cornes de gazelle font partie intégrante de la culture culinaire marocaine. Les marchés locaux, les souks et les restaurants offrent une expérience gustative unique.'),('MC',43.7503,7.41284,'Monaco','MCO',492,'??','U+1F1F2 U+1F1E8',0,5,42.038007771631705,'Monaco, la perle de la Méditerranée occidentale, est un micro-État souverain reconnu pour son glamour, son luxe et son emplacement spectaculaire entre les Alpes et la mer. Niché sur la Côte d\'Azur, Monaco est le deuxième plus petit pays indépendant du monde, célèbre pour son casino emblématique à Monte-Carlo, son Grand Prix de Formule 1 et son statut de refuge fiscal. La population cosmopolite, avec une forte concentration de résidents étrangers, crée une atmosphère internationale unique. Dirigée par la famille Grimaldi depuis des siècles, la principauté bénéficie d\'une stabilité politique et d\'une prospérité économique grâce au tourisme, aux services financiers et au commerce. Monaco incarne l\'élégance méditerranéenne avec ses yachts somptueux, ses boutiques de luxe et ses événements sociaux exclusifs.','Le Grand Prix de Monaco : Le Grand Prix de Monaco est l\'une des courses automobiles les plus prestigieuses du monde. Le circuit, tracé dans les rues étroites de la Principauté, offre un défi unique aux pilotes et est également l\'un des plus glamour du calendrier de Formule 1. Les rues de Monaco se transforment en un circuit urbain spectaculaire pour cet événement annuel.','Le Palais Princier : Le Palais Princier de Monaco, perché sur le Rocher de Monaco, est la résidence officielle du prince souverain. Les visiteurs peuvent découvrir l\'histoire royale en explorant les appartements d\'État, les salons, et la cour d\'honneur. Lors de la relève de la garde, l\'atmosphère historique est palpable.','Le Casino de Monte-Carlo : Le Casino de Monte-Carlo est l\'un des établissements de jeu les plus emblématiques du monde. Construit en 1863, il incarne le glamour et l\'opulence. Les visiteurs peuvent tenter leur chance aux tables de jeu et profiter de l\'architecture somptueuse du casino, entourée de jardins luxuriants.'),('MD',47.4116,28.3699,'Moldavie','MDA',498,'??','U+1F1F2 U+1F1E9',0,5,27.654361098682845,'La Moldavie, située en Europe de l\'Est, est un petit pays enclavé entre la Roumanie à l\'ouest et l\'Ukraine à l\'est. Géographiquement, le pays est caractérisé par des collines et des plaines, traversé par le fleuve Dniestr. La Moldavie a une histoire complexe, marquée par des influences ottomanes, russes et roumaines. La culture moldave est imprégnée de traditions folkloriques, de musique et de danses populaires. La langue officielle est le roumain, et la majorité de la population est d\'origine roumaine. Cependant, la Moldavie a aussi une minorité importante de population d\'origine russe et ukrainienne, ce qui contribue à la diversité culturelle du pays. Politiquement, la Moldavie est une république parlementaire. Le pays a fait face à des défis économiques et politiques depuis son indépendance de l\'Union soviétique en 1991. Les relations avec la Russie et la question de la région séparatiste de Transnistrie demeurent des sujets délicats. Sur le plan économique, l\'agriculture joue un rôle crucial dans l\'économie moldave, avec la production de vin étant une activité importante. Le pays a également cherché à diversifier son économie en développant le secteur des technologies de l\'information et en encourageant le tourisme. Bien que la Moldavie ait des défis à relever, elle continue de travailler vers le renforcement de son identité nationale et le développement économique, tout en cherchant à renforcer ses liens avec l\'Union européenne.','Le Monastère de Căpriana : La Moldavie est riche en patrimoine culturel et religieux, et le monastère de Căpriana en est un exemple significatif. Fondé au XVème siècle, ce monastère orthodoxe est entouré de forêts pittoresques et abrite des fresques historiques, des icônes et une atmosphère spirituelle paisible.','Orheiul Vechi : Orheiul Vechi, une région historique et culturelle, présente des vestiges archéologiques remontant à l\'Antiquité. Le complexe comprend des églises rupestres, des monastères et des grottes qui témoignent de l\'histoire mouvementée de la Moldavie.','Le Dniestr : Le Dniestr est le deuxième plus long fleuve qui traverse la Moldavie, offrant des paysages bucoliques et des opportunités de loisirs en plein air. Des croisières tranquilles sur le fleuve permettent aux visiteurs d\'admirer la beauté naturelle et de découvrir des villages pittoresques le long de ses rives.'),('ME',42.7087,19.3744,'Monténégro','MNE',499,'??','U+1F1F2 U+1F1EA',0,5,12.15778525188359,NULL,NULL,NULL,NULL),('MG',-18.7669,46.8691,'Madagascar','MDG',450,'??','U+1F1F2 U+1F1EC',0,1,77.82584603673392,'Madagascar, la grande île de l\'océan Indien, est une terre d\'une biodiversité exceptionnelle et de paysages variés. Des forêts tropicales luxuriantes aux plages immaculées, Madagascar offre une aventure naturelle unique. La culture malgache, imprégnée de traditions africaines et asiatiques, se reflète dans la musique, la danse et les croyances. En tant que république semi-présidentielle, Madagascar a fait face à des défis politiques et économiques, mais son potentiel touristique, axé sur la faune et la flore uniques, attire les voyageurs du monde entier.','L\'Allée des Baobabs : L\'Allée des Baobabs à Madagascar est un site emblématique. Des projets de préservation écologique sont en cours pour protéger ces arbres emblématiques, symboles de la biodiversité unique de Madagascar.','Le Parc national de l\'Isalo : Le Parc national de l\'Isalo offre des paysages spectaculaires avec ses canyons, ses formations rocheuses et sa flore unique. Des efforts de conservation sont déployés pour protéger cet écosystème fragile et sa faune diverse.','Le Tsingy de Bemaraha : Le Tsingy de Bemaraha, un site karstique impressionnant, est inscrit au patrimoine mondial de l\'UNESCO. Des mesures de préservation géologique sont en place pour protéger ces formations calcaires uniques, créant un paysage extraordinaire.'),('MH',7.13147,171.184,'Îles Marshall','MHL',584,'??','U+1F1F2 U+1F1ED',0,6,52.65587750138331,NULL,NULL,NULL,NULL),('MK',41.6086,21.7453,'Macédoine du Nord','MKD',807,'??','U+1F1F2 U+1F1F0',0,5,29.8018524700793,'La Macédoine du Nord, située dans les Balkans, est un pays aux paysages variés, comprenant des montagnes, des lacs et des vallées pittoresques. Géographiquement, elle partage des frontières avec la Grèce, la Bulgarie, l\'Albanie et le Kosovo. La Macédoine du Nord possède une histoire complexe, marquée par les influences de différentes civilisations, notamment celles des Romains, Byzantins et Ottomans. Culturellement, le pays présente une richesse de traditions folkloriques, de musiques et de danses distinctes. Politiquement, la Macédoine du Nord est une république parlementaire, ayant obtenu son indépendance pacifiquement de l\'ex-Yougoslavie en 1991. Le pays a surmonté des défis liés à son identité nationale et a cherché à renforcer ses institutions démocratiques. Sur le plan économique, la Macédoine du Nord travaille à diversifier son économie, avec des secteurs tels que l\'industrie manufacturière, les technologies de l\'information et le tourisme en croissance. Bien que des défis subsistent, le pays aspire à renforcer sa stabilité politique et à promouvoir le développement économique.','Le Lac d\'Ohrid : La Macédoine du Nord partage le lac d\'Ohrid avec l\'Albanie. Ce lac est l\'un des plus anciens et des plus profonds d\'Europe. Il est célèbre pour ses eaux cristallines, ses monastères pittoresques sur ses rives, et sa biodiversité exceptionnelle.','Le Vieux Bazar de Skopje : La capitale, Skopje, abrite un vieux bazar qui remonte à l\'époque ottomane. Ce quartier historique est caractérisé par ses ruelles étroites, ses bazars animés, ses mosquées et ses caravansérails. Il offre un aperçu de l\'influence ottomane sur l\'architecture et la culture de la région.','La Statut d\'Alexandre le Grand : Skopje est le lieu de naissance présumé d\'Alexandre le Grand, et la ville arbore fièrement un grand nombre de statues et de monuments en son honneur. La statue équestre d\'Alexandre le Grand, située sur la place principale, est l\'une des plus grandes au monde.'),('ML',17.5707,-3.99617,'Mali','MLI',466,'??','U+1F1F2 U+1F1F1',3,1,91.04163291961108,'Le Mali, situé en Afrique de l\'Ouest, est un pays connu pour son histoire riche, ses cultures diverses et ses paysages variés. Le Mali abrite des sites historiques importants tels que Tombouctou, qui était un centre intellectuel et commercial majeur pendant l\'âge d\'or de l\'Empire du Mali. Géographiquement, le pays comprend le désert du Sahara au nord, la savane au centre et la zone boisée au sud. La culture malienne est diversifiée, influencée par les ethnies telles que les Bambaras, les Touaregs et les Peuls. La musique malienne, notamment le blues du désert, a gagné une renommée mondiale. Politiquement, le Mali est une république démocratique multipartite, bien que des périodes d\'instabilité aient marqué son histoire récente, avec des défis tels que des conflits armés et des questions liées à la gouvernance. Sur le plan économique, l\'agriculture est une activité prédominante, fournissant des moyens de subsistance à une grande partie de la population. Cependant, le Mali fait face à des défis liés à la pauvreté, à l\'accès limité à l\'éducation et aux problèmes de sécurité. Malgré ces défis, le Mali travaille à renforcer la stabilité politique et à promouvoir le développement socio-économique.','L\'Empire du Mali : Le Mali a une riche histoire remontant à l\'Empire du Mali, qui prospéra du 13e au 16e siècle. Sous le règne de Mansa Musa, l\'empire était célèbre pour sa richesse, en particulier en or, et a joué un rôle central dans le commerce transsaharien.','Le Festival au Désert : Le Festival au Désert était un événement musical et culturel majeur qui se tenait dans le désert malien près de Tombouctou. Il attirait des musiciens du monde entier, mettant en avant la diversité culturelle du Mali, mais a été interrompu en raison de l\'insécurité dans la région.','Le fleuve Niger : Le Mali est traversé par le fleuve Niger, l\'un des plus grands fleuves d\'Afrique de l\'Ouest. Le fleuve joue un rôle crucial dans la vie quotidienne des Maliens, fournissant de l\'eau pour l\'agriculture, le transport et étant souvent au cœur de la vie culturelle.'),('MM',21.914,95.9562,'Myanmar (Birmanie)','MMR',104,'??','U+1F1F2 U+1F1F2',3,4,65.80261026118194,NULL,NULL,NULL,NULL),('MN',46.8625,103.847,'Mongolie','MNG',496,'??','U+1F1F2 U+1F1F3',0,4,55.88815562044098,NULL,NULL,NULL,NULL),('MO',22.1987,113.544,'Macao','MAC',446,'??','U+1F1F2 U+1F1F4',0,4,82.03295039202362,'Macao, officiellement la Région administrative spéciale de Macao, est une région administrative spéciale de la République populaire de Chine, située sur la côte sud de la Chine, à l\'ouest de l\'estuaire de la rivière des Perles. Macao est célèbre pour son histoire en tant que colonie portugaise jusqu\'en 1999, date à laquelle elle est revenue sous souveraineté chinoise. Géographiquement, Macao est une petite péninsule et comprend également deux îles. La culture de Macao est une fusion unique de l\'influence chinoise et portugaise, reflétée dans l\'architecture, la cuisine, et les traditions locales. Politiquement, Macao jouit d\'un haut degré d\'autonomie, avec un système gouvernemental distinct comprenant un chef de l\'exécutif et une assemblée législative. Sur le plan économique, le jeu et le tourisme sont des secteurs clés, avec Macao étant l\'une des principales destinations mondiales pour les jeux de hasard. Le développement économique rapide a transformé Macao en l\'une des économies les plus prospères d\'Asie. Malgré cela, la région continue de faire face à des défis tels que la diversification économique et la gestion de l\'impact du tourisme massif.','Le Grand Prix de Macao : Macao accueille l\'un des événements de course les plus prestigieux au monde, le Grand Prix de Macao. Les courses de Formule 3, de motos et d\'autres catégories attirent des pilotes internationaux et des passionnés de sports automobiles.','Le quartier historique : Le centre historique de Macao, inscrit au patrimoine mondial de l\'UNESCO, est un mélange fascinant de sites historiques, de temples chinois, d\'églises portugaises et de rues pavées. Cela témoigne de la coexistence harmonieuse des cultures chinoise et portugaise.','Le mélange culturel : Macao, situé sur la côte sud de la Chine, a été une colonie portugaise pendant plus de 400 ans jusqu\'à sa rétrocession à la Chine en 1999. Cette influence coloniale se reflète dans l\'architecture, la cuisine et la culture, créant un mélange unique de traditions orientales et occidentales.'),('MP',17.3308,145.385,'Mariannes du Nord (Îles)','MNP',580,'??','U+1F1F2 U+1F1F5',0,6,42.500288172159614,'Les Mariannes du Nord sont un territoire insulaire situé dans l\'océan Pacifique occidental. Composé de 15 îles, cet archipel offre des paysages tropicaux variés, des plages de sable blanc aux montagnes volcaniques. La culture des Mariannes du Nord est influencée par les populations autochtones chamorros, ainsi que par les influences espagnoles, allemandes, japonaises et américaines dues à l\'histoire coloniale. La population est multiculturelle, avec un mélange de traditions ancestrales et de modernité. Politiquement, les Mariannes du Nord sont un Commonwealth associé aux États-Unis, avec un gouvernement autonome. Sur le plan économique, le tourisme, l\'industrie de la pêche et les activités liées aux bases militaires américaines sont des contributeurs essentiels. Cependant, le territoire fait face à des défis environnementaux, tels que les conséquences du changement climatique. Les Mariannes du Nord continuent de maintenir leur équilibre entre la préservation de leur riche patrimoine culturel et les opportunités de développement économique.','Le point le plus profond de l\'océan : Les Mariannes du Nord abritent la fosse des Mariannes, la partie la plus profonde de l\'océan, connue sous le nom de Challenger Deep. Cette fosse atteint des profondeurs extrêmes, dépassant 10 900 mètres, et a été explorée en 1960 par le bathyscaphe Trieste.','L\'île de Saipan et la Seconde Guerre mondiale : Saipan, l\'une des îles principales des Mariannes du Nord, a été le théâtre de combats acharnés pendant la Seconde Guerre mondiale. La bataille de Saipan en 1944 a été une victoire clé pour les Alliés et a joué un rôle stratégique dans le conflit du Pacifique.','Le Monument national de la Guerre du Pacifique : Sur l\'île de Saipan, le Monument national de la Guerre du Pacifique commémore les événements de la Seconde Guerre mondiale. Il comprend des musées, des mémoriaux et des sites historiques dédiés à la mémoire des soldats et des civils qui ont participé à la bataille de Saipan.'),('MT',35.9375,14.3754,'Malte','MLT',470,'??','U+1F1F2 U+1F1F9',0,5,66.40259275809171,NULL,NULL,NULL,NULL),('MU',-20.3484,57.5522,'Maurice (Île)','MUS',480,'??','U+1F1F2 U+1F1FA',0,1,4.512102347344255,'L\'île Maurice, située dans l\'océan Indien à l\'est du continent africain, est un petit paradis tropical réputé pour ses plages de sable blanc, ses lagons turquoises et son mélange harmonieux de cultures. Géographiquement, l\'île est entourée de récifs coralliens et est le cœur d\'un archipel comprenant Rodrigues, Agalega et Cargados Carajos Shoals. La culture mauricienne est profondément influencée par sa diversité ethnique, résultant de l\'histoire coloniale et de l\'immigration. Les habitants sont d\'origines indienne, africaine, chinoise et européenne, créant un melting-pot culturel unique. Cette diversité se reflète dans la cuisine, la musique, les festivals et la vie quotidienne de l\'île. Politiquement, l\'île Maurice est une république démocratique avec un système parlementaire. Elle a connu une stabilité politique et économique relative depuis son indépendance du Royaume-Uni en 1968. Le pays a réussi à diversifier son économie, initialement basée sur l\'agriculture sucrière, en se tournant vers le tourisme, les services financiers et les technologies émergentes. L\'économie touristique prospère de l\'île attire des visiteurs du monde entier en quête de détente, d\'aventure et de découvertes culturelles. Les plages idylliques, les parcs nationaux riches en biodiversité et les activités nautiques variées font de Maurice une destination prisée. En résumé, l\'île Maurice est une destination tropicale qui allie la beauté naturelle à une riche diversité culturelle, offrant une expérience unique où l\'hospitalité chaleureuse des Mauriciens complète les charmes naturels de l\'île.','Les Plages de Sable Blanc : L\'île Maurice est réputée pour ses plages paradisiaques de sable blanc bordées par des eaux cristallines. Des endroits tels que la plage de Trou aux Biches, la plage du Morne et la plage de Belle Mare attirent les visiteurs du monde entier pour leurs paysages idylliques et leurs activités nautiques.','Le Morne Brabant : Le Morne Brabant est une montagne emblématique située à la pointe sud-ouest de l\'île Maurice. Classé au patrimoine mondial de l\'UNESCO, cette montagne offre des sentiers de randonnée spectaculaires avec des vues panoramiques sur l\'océan Indien. Le Morne Brabant est également associé à l\'histoire de l\'esclavage et de la lutte pour la liberté.','La Capitale Port-Louis : Port-Louis, la capitale de l\'île Maurice, est un mélange dynamique de cultures, d\'histoire et de modernité. Le marché central de Port-Louis est une destination animée où l\'on peut explorer des étals colorés de fruits, légumes, épices et artisanat local. La citadelle de Fort Adelaide offre une vue panoramique sur la ville.'),('MV',3.20278,73.2207,'Maldives','MDV',462,'??','U+1F1F2 U+1F1FB',0,4,23.35273653581062,'Les Maldives, un archipel tropical dans l\'océan Indien, se composent de 26 atolls coralliens regroupant plus de 1 000 îles. Géographiquement, les Maldives sont réputées pour leurs lagons d\'eau cristalline, leurs plages de sable blanc et leurs récifs coralliens spectaculaires, faisant de cet endroit un paradis pour les amateurs de plongée. Sur le plan culturel, la population maldivienne a des influences arabes, africaines et asiatiques, reflétées dans leur artisanat, leur musique et leur cuisine, notamment le poisson et le riz. Politiquement, les Maldives sont une république présidentielle, avec une attention particulière portée aux défis liés au changement climatique en raison de leur faible élévation au-dessus du niveau de la mer. L\'économie des Maldives repose principalement sur le tourisme, les visiteurs affluent pour profiter des complexes hôteliers de luxe et des activités nautiques, mais l\'agriculture de subsistance et la pêche jouent également un rôle essentiel dans la vie des Maldiviens.','Première Réserve de Biosphère : Les Maldives abritent la plus grande réserve marine du monde, connue sous le nom de Réserve de Biosphère de l\'Atoll de Baa. Cette réserve est un site de conservation exceptionnel qui protège les récifs coralliens, les espèces marines, et sert de zone de reproduction pour plusieurs espèces de poissons.','Archipel Paradisiaque : Les Maldives sont un archipel de 26 atolls, composé de plus de 1 000 îles coralliennes au milieu de l\'océan Indien. C\'est le plus petit pays d\'Asie en termes de superficie et de population. Les Maldives sont souvent considérées comme un paradis tropical en raison de leurs plages de sable blanc, de leurs eaux cristallines et de leurs récifs coralliens spectaculaires.','Chambres sous-marines : Les Maldives sont réputées pour leurs complexes hôteliers luxueux et innovants. Certains hôtels offrent des chambres sous-marines, permettant aux visiteurs de vivre une expérience d\'hébergement unique en observant la vie marine tout en étant confortablement installés dans leur chambre subaquatique.'),('MW',-13.2543,34.3015,'Malawi','MWI',454,'??','U+1F1F2 U+1F1FC',0,1,3.227378710384833,'Le Malawi, niché dans la vallée du Rift en Afrique australe, est un pays caractérisé par ses lacs majestueux, dont le lac Malawi, et ses paysages verdoyants. La culture malawite est imprégnée de traditions tribales et de musique vibrante. En tant que république, le Malawi a surmonté des défis pour progresser vers la stabilité politique et le développement économique. L\'agriculture reste un pilier essentiel de l\'économie, avec une diversification croissante vers d\'autres secteurs tels que le tourisme et l\'énergie.','Le lac Malawi : Le lac Malawi, également appelé le \"lac des Étoiles\", est le troisième plus grand lac d\'Afrique. Des efforts de conservation sont en place pour protéger la biodiversité unique de ce lac, abritant une variété d\'espèces de poissons colorés.','La Vallée du Rift malawienne : La Vallée du Rift traverse le Malawi, offrant des paysages spectaculaires. Des projets de conservation environnementale visent à protéger cette région, caractérisée par des montagnes, des rivières et une faune diversifiée.','La culture du Malawi : La riche culture du Malawi, exprimée à travers la musique, la danse et l\'artisanat, est un aspect essentiel de l\'identité nationale. Des initiatives éducatives et artistiques cherchent à préserver et promouvoir ces traditions uniques.'),('MX',23.6345,-102.553,'Mexique','MEX',484,'??','U+1F1F2 U+1F1FD',2,2,46.07868701785681,'Le Mexique, pays d\'Amérique du Nord bordé par l\'océan Pacifique et l\'océan Atlantique, est une terre de contrastes culturels et naturels. Des plages tropicales aux sommets enneigés des volcans, le Mexique offre une variété de paysages. La culture mexicaine est mondialement célèbre pour sa cuisine épicée, sa musique mariachi, et ses traditions festives comme le Dia de los Muertos. En tant que république fédérale, le Mexique a une économie diversifiée comprenant l\'industrie, l\'agriculture et le tourisme, tout en préservant son riche patrimoine indigène.','Les pyramides de Teotihuacán : Les pyramides de Teotihuacán au Mexique, dont la Pyramide du Soleil et la Pyramide de la Lune, sont des vestiges impressionnants de la civilisation précolombienne. Des efforts de préservation archéologique sont déployés pour maintenir ces structures emblématiques, permettant aux visiteurs de remonter le temps.','La Fête des Morts : La Fête des Morts, célébrée au Mexique, est une tradition ancestrale honorant les défunts. Des rituels colorés, des autels décorés et des processions marquent cette célébration. Des projets culturels veillent à préserver cette coutume, inscrite au patrimoine immatériel de l\'UNESCO.','La Réserve de biosphère de Sian Ka\'an : La Réserve de biosphère de Sian Ka\'an, sur la côte du Yucatán, abrite une biodiversité exceptionnelle. Des initiatives de conservation sont mises en œuvre pour protéger cette réserve naturelle, comprenant des mangroves, des lagunes et des sites archéologiques mayas.'),('MY',4.21048,101.976,'Malaisie','MYS',458,'??','U+1F1F2 U+1F1FE',0,4,20.71130203149403,'La Malaisie, située en Asie du Sud-Est, est un pays diversifié sur le plan géographique, avec des régions montagneuses, des plaines côtières et une riche forêt tropicale. La culture malaisienne est un mélange fascinant d\'influences malaises, chinoises, indiennes et indigènes, créant une société multiculturelle vibrante. Le pays est également connu pour sa diversité ethnique, avec des communautés malaises, chinoises et indiennes coexistant harmonieusement. Politiquement, la Malaisie est une monarchie constitutionnelle avec un système parlementaire. Sur le plan économique, elle a réussi à diversifier ses secteurs, avec une forte présence dans l\'industrie manufacturière, l\'exploitation des ressources naturelles et le secteur des services, notamment le tourisme. Les attractions comprennent des plages pittoresques, des parcs nationaux et une cuisine délicieuse, faisant de la Malaisie une destination touristique prisée.','Les Tours Petronas : Les Tours Petronas, situées à Kuala Lumpur, sont parmi les plus hautes tours jumelles du monde. Construites en 1998, elles symbolisent le dynamisme économique de la Malaisie. Les visiteurs peuvent monter jusqu\'à la passerelle qui relie les deux tours pour une vue panoramique sur la ville.','Pays des Contrastes : La Malaisie est connue pour sa diversité culturelle et ethnique. Avec une population composée de Malais, de Chinois, d\'Indiens et d\'autres groupes ethniques, la Malaisie est un exemple de coexistence harmonieuse de différentes cultures, langues et religions.','Les Îles Perhentian : Les Îles Perhentian, situées au large de la côte nord-est de la péninsule malaisienne, sont réputées pour leurs plages de sable blanc, leurs eaux cristallines et leurs récifs coralliens. C\'est un lieu prisé pour la plongée en apnée, la plongée sous-marine et la détente tropicale.'),('MZ',-18.6657,35.5296,'Mozambique','MOZ',508,'??','U+1F1F2 U+1F1FF',4,1,65.32045217726422,'Le Mozambique, situé sur la côte est de l\'Afrique, est un pays aux paysages variés comprenant des plages magnifiques, des savanes, des forêts tropicales et des montagnes. La culture mozambicaine est influencée par les traditions africaines, portugaises et arabes. La diversité ethnique du pays se reflète dans ses langues, sa musique, ses danses et ses rites traditionnels. Politiquement, le Mozambique est une république multipartite, bien que son histoire ait été marquée par des périodes de conflits armés. Sur le plan économique, l\'agriculture, la pêche, les ressources naturelles (notamment le gaz naturel et le charbon) et le tourisme sont des secteurs clés. Le Mozambique fait face à des défis tels que la pauvreté, les inégalités et les impacts des changements climatiques, tout en travaillant à renforcer la stabilité économique et à attirer des investissements pour favoriser le développement durable. Le pays possède un potentiel touristique important en raison de ses parcs nationaux, de ses plages préservées et de son riche patrimoine culturel.','Biodiversité marine : Les eaux du Mozambique abritent certaines des plus riches biodiversités marines au monde. Les récifs coralliens de l\'archipel de Bazaruto sont particulièrement notables, offrant un habitat varié pour une multitude d\'espèces marines, y compris des dauphins, des tortues et des requins.','Gorongosa National Park : Le Gorongosa National Park, situé au cœur du Mozambique, est l\'un des parcs nationaux les plus emblématiques du pays. Il a été ravagé par la guerre civile dans les années 1980, mais des efforts de conservation considérables ont été déployés pour restaurer la faune et la flore de la région.','Île de Mozambique, site du patrimoine mondial de l\'UNESCO : L\'île de Mozambique, ancienne capitale coloniale, est classée au patrimoine mondial de l\'UNESCO. Elle abrite des vestiges architecturaux qui témoignent de l\'histoire complexe du pays, avec des influences arabes, indiennes et européennes.'),('NA',-22.9576,18.4904,'Namibie','NAM',516,'??','U+1F1F3 U+1F1E6',0,1,64.4683578652035,NULL,NULL,NULL,NULL),('NC',-20.9043,165.618,'Nouvelle-Calédonie','NCL',540,'??','U+1F1F3 U+1F1E8',0,6,26.380435867589373,'La Nouvelle-Calédonie, située dans le Pacifique Sud, est un territoire français d\'outre-mer qui se compose d\'un archipel d\'îles. Géographiquement diversifiée, elle offre des paysages allant de plages paradisiaques à des montagnes majestueuses. La culture néo-calédonienne est influencée par la diversité ethnique de sa population, comprenant des Kanaks autochtones, des Européens, des Polynésiens et des Asiatiques. La politique locale est marquée par des questions liées à l\'identité, notamment le statut politique de la Nouvelle-Calédonie vis-à-vis de la France, avec des discussions sur l\'indépendance. Sur le plan économique, le territoire bénéficie de ressources minières importantes, en particulier le nickel, mais cherche également à développer le tourisme durable comme secteur clé.','La Grande Terre et ses contrastes : La Grande Terre, la plus grande île de la Nouvelle-Calédonie, présente une diversité de paysages allant des plages de sable blanc aux montagnes accidentées. Le parc national de la Rivière Bleue, par exemple, est un site classé au patrimoine mondial de l\'UNESCO offrant des forêts tropicales, des lacs et une faune unique.','La perle du Pacifique : La Nouvelle-Calédonie est souvent surnommée la \"perle du Pacifique\" en raison de ses lagons cristallins, de ses récifs coralliens préservés et de sa biodiversité marine exceptionnelle. Le lagon, inscrit au patrimoine mondial de l\'UNESCO, offre des opportunités exceptionnelles pour la plongée et la découverte de la vie sous-marine.','L\'île des Pins et les Pins colossaux : L\'île des Pins, l\'une des îles les plus emblématiques de la Nouvelle-Calédonie, est réputée pour ses pins colonnaires, appelés \"araucarias\". Ces arbres majestueux, qui peuvent atteindre jusqu\'à 60 mètres de hauteur, confèrent à l\'île une atmosphère unique et pittoresque.'),('NE',17.6078,8.08167,'Niger','NER',562,'??','U+1F1F3 U+1F1EA',4,1,38.49710881570085,NULL,NULL,NULL,NULL),('NG',9.082,8.67528,'Nigéria','NGA',566,'??','U+1F1F3 U+1F1EC',4,1,13.344239549100623,'Le Nigeria, situé en Afrique de l\'Ouest, est le pays le plus peuplé du continent et est doté d\'une diversité géographique, culturelle et économique remarquable. Géographiquement, le Nigeria comprend des savanes, des forêts tropicales, des plaines côtières et le delta du Niger. La culture nigériane est riche et variée en raison de la multitude de groupes ethniques présents, chacun apportant ses propres traditions, langues, danses et coutumes. Politiquement, le Nigeria est une république fédérale avec une histoire marquée par des périodes de gouvernance civile et militaire. Malgré des défis, le pays est un acteur clé sur la scène africaine et joue un rôle majeur dans les organisations régionales et internationales. Sur le plan économique, le Nigeria est l\'une des plus grandes économies africaines, avec des secteurs tels que le pétrole, l\'agriculture, les télécommunications et le secteur financier jouant un rôle prépondérant. Cependant, des défis persistants tels que la pauvreté, la corruption et les inégalités nécessitent une attention continue pour favoriser un développement durable.','Nollywood : Nollywood est l\'industrie cinématographique du Nigéria, l\'une des plus prolifiques au monde. Elle produit des milliers de films chaque année, souvent à budget modeste, mais qui sont très populaires tant au niveau national qu\'international. Nollywood est un élément clé de la culture populaire nigériane.','Le Lac Chad : Une partie du lac Chad, l\'un des plus grands lacs d\'Afrique, se trouve au Nigéria. Le lac est d\'une importance vitale pour la région en fournissant de l\'eau douce, des ressources halieutiques et en soutenant les moyens de subsistance des communautés locales.','Diversité Culturelle : Le Nigéria est le pays le plus peuplé d\'Afrique, abritant une grande diversité de groupes ethniques, de langues et de cultures. Il compte plus de 250 groupes ethniques, dont les Yoruba, les Hausa, les Igbo, et de nombreux autres, chacun avec ses propres traditions, langues et pratiques culturelles.'),('NI',12.8654,-85.2072,'Nicaragua','NIC',558,'??','U+1F1F3 U+1F1EE',0,2,51.229874371765064,'Le Nicaragua, situé en Amérique centrale, est un pays caractérisé par ses paysages variés comprenant des volcans, des lacs, des plages et des forêts tropicales. La culture nicaraguayenne est influencée par les peuples autochtones, les Espagnols et les Africains, créant une riche diversité ethnique. La population nicaraguayenne est majoritairement métissée, avec une influence culturelle indigène importante. Politiquement, le Nicaragua est une république présidentielle multipartite. Le pays a connu des périodes d\'instabilité politique, notamment pendant la guerre civile dans les années 1980, mais il a depuis travaillé à renforcer la stabilité démocratique. Sur le plan économique, l\'agriculture est un secteur crucial, avec la production de café, de bananes et de bœuf. Le tourisme, axé sur la biodiversité et la culture, est également en développement. Cependant, le Nicaragua fait face à des défis tels que la pauvreté, les inégalités, la gestion des ressources naturelles et des problèmes environnementaux. Le pays cherche à promouvoir le développement économique tout en préservant son riche patrimoine naturel et culturel.','Les volcans du Nicaragua : Le pays abrite une chaîne de volcans, dont certains sont actifs. Le volcan Concepción, sur l\'île d\'Ometepe, est l\'un des plus imposants, offrant des vues spectaculaires depuis son sommet. Les volcans ajoutent une dimension géologique unique au paysage nicaraguayen.','Le lac Nicaragua et les îles Ometepe : Le lac Nicaragua est le plus grand lac d\'Amérique centrale, abritant des îles fascinantes telles qu\'Ometepe. Cette île est formée par deux volcans et est réputée pour sa beauté naturelle, ses plages et ses communautés locales accueillantes.','La Réserve de biosphère de Bosawás : Bosawás est la plus grande réserve de biosphère d\'Amérique centrale, couvrant une vaste étendue de forêt tropicale. Elle abrite une diversité incroyable de flore et de faune, y compris des espèces menacées.'),('NL',52.1326,5.29127,'Pays-Bas','NLD',528,'??','U+1F1F3 U+1F1F1',0,5,16.116656284887952,'Les Pays-Bas, situés en Europe du Nord-Ouest, sont connus pour leurs canaux pittoresques, leurs champs de tulipes colorés, et leur architecture distinctive. Géographiquement, le pays est caractérisé par des plaines basses, des rivières, et un réseau étendu de polders. Culturellement, les Pays-Bas ont une histoire artistique et intellectuelle riche, avec des personnalités telles que Rembrandt et Van Gogh. La culture néerlandaise est marquée par la tolérance, la diversité, et l\'importance accordée aux valeurs démocratiques. Politiquement, les Pays-Bas sont une monarchie constitutionnelle parlementaire. Sur le plan économique, le pays est un acteur majeur dans le commerce international, avec une économie diversifiée comprenant l\'agriculture, l\'industrie manufacturière, et les services. Les Pays-Bas sont également réputés pour leur expertise dans le domaine de l\'eau et de la gestion des ressources hydriques. Bien que prospères, le pays fait face à des défis tels que la gestion de l\'espace, les changements climatiques, et des questions liées à la durabilité environnementale. Les Pays-Bas jouent un rôle actif sur la scène mondiale, tant sur le plan économique que politique.','Le pays des moulins : Les Pays-Bas sont célèbres pour leurs moulins à vent emblématiques. Kinderdijk, situé dans la province de Hollande-Méridionale, abrite un ensemble de 19 moulins à vent classés au patrimoine mondial de l\'UNESCO, représentant une partie importante de l\'histoire hydraulique du pays.','Les canaux d\'Amsterdam : Amsterdam, la capitale des Pays-Bas, est renommée pour ses magnifiques canaux. Les canaux concentriques, construits au cours du XVIIe siècle, ajoutent un charme pittoresque à la ville. Ils sont également inscrits au patrimoine mondial de l\'UNESCO.','Le Rijksmuseum : Le Rijksmuseum à Amsterdam est l\'un des musées nationaux des Pays-Bas, abritant une vaste collection d\'œuvres d\'art et d\'objets historiques. Il est particulièrement connu pour ses peintures du Siècle d\'Or néerlandais, dont l\'œuvre emblématique \"La Ronde de nuit\" de Rembrandt.'),('NO',60.472,8.46895,'Norvège','NOR',578,'??','U+1F1F3 U+1F1F4',0,5,26.89366138250908,'La Norvège, située dans le nord de l\'Europe, est un pays spectaculaire caractérisé par ses fjords majestueux, ses montagnes escarpées et ses aurores boréales. La culture norvégienne est imprégnée de traditions vikings, de folklore et d\'une forte connexion avec la nature. En tant que monarchie constitutionnelle, la Norvège est reconnue pour son modèle social avancé et sa gestion durable des ressources naturelles, en particulier dans le secteur de l\'énergie. L\'économie norvégienne prospère grâce à l\'industrie pétrolière, à la pêche et au tourisme.','Les fjords norvégiens : Les fjords norvégiens, tels que le Geirangerfjord et le Nærøyfjord, sont des merveilles naturelles. Des programmes de préservation environnementale veillent à protéger ces paysages majestueux, inscrits au patrimoine mondial de l\'UNESCO.','La vieille ville de Bergen : La vieille ville de Bergen, avec ses maisons colorées et ses ruelles pavées, est un site du patrimoine mondial de l\'UNESCO. Des projets de restauration préservent l\'histoire de cette ville hanséatique.','Le Parc national de Jotunheimen : Le Parc national de Jotunheimen est le plus grand parc national de Norvège. Des initiatives de conservation protègent la flore et la faune uniques de cette région alpine.'),('NP',28.3949,84.124,'Népal','NPL',524,'??','U+1F1F3 U+1F1F5',0,4,86.11834113124604,NULL,NULL,NULL,NULL),('NZ',-40.9006,174.886,'Nouvelle-Zélande','NZL',554,'??','U+1F1F3 U+1F1FF',0,6,49.91072458206743,NULL,NULL,NULL,NULL),('OM',21.5126,55.9233,'Oman','OMN',512,'??','U+1F1F4 U+1F1F2',0,4,91.19860258996356,'Oman, situé à l\'extrémité sud-est de la péninsule arabique, est un pays fascinant alliant histoire millénaire et modernité. Les montagnes majestueuses, les déserts étendus et les côtes bordées de fjords offrent une variété de paysages. La culture omanaise, empreinte de traditions arabes, est caractérisée par son accueil chaleureux. Le sultanat d\'Oman, dirigé par un monarque absolu, a su diversifier son économie en dehors du pétrole, développant le tourisme et d\'autres secteurs.','Les forts d\'Oman : Oman est jalonné de forts historiques, témoins de son passé tumultueux. Le Fort de Nizwa, par exemple, a été construit au XVIIe siècle. Des programmes de préservation veillent à la restauration de ces monuments, offrant aux visiteurs un aperçu captivant de l\'histoire militaire d\'Oman.','Le festival de Salalah : La région de Salalah à Oman célèbre le festival de Khareef, marqué par des pluies saisonnières transformant le désert en une mer de verdure. Ce festival souligne la beauté unique de cette région et encourage la préservation de son écosystème particulier.','Les dhow omanais : Les dhows, anciens navires traditionnels d\'Oman, représentent une part importante de l\'héritage maritime du pays. Des efforts de préservation sont déployés pour maintenir ces embarcations emblématiques, témoins d\'une longue tradition maritime omanaise.'),('PA',8.53798,-80.7821,'Panama','PAN',591,'??','U+1F1F5 U+1F1E6',0,2,6.260842276980022,NULL,NULL,NULL,NULL),('PE',-9.18997,-75.0152,'Pérou','PER',604,'??','U+1F1F5 U+1F1EA',0,3,57.70840668837391,'Le Pérou, situé sur la côte ouest de l\'Amérique du Sud, est un pays aux multiples facettes, offrant une diversité géographique allant des montagnes majestueuses des Andes à la forêt amazonienne luxuriante. La culture péruvienne est imprégnée d\'une histoire riche, avec des influences autochtones, espagnoles et africaines. Les anciennes civilisations, telles que les Incas, ont laissé des vestiges impressionnants, dont la célèbre cité de Machu Picchu. Politiquement, le Pérou est une république démocratique, avec une histoire parfois marquée par des périodes d\'instabilité politique. Sur le plan économique, le pays dispose de ressources naturelles abondantes, notamment le cuivre, l\'argent et l\'or. Le tourisme, axé sur son patrimoine culturel et naturel, joue également un rôle crucial. Cependant, des défis subsistent, notamment des inégalités sociales, des questions liées à la gestion des ressources naturelles et des problèmes environnementaux. Le Pérou travaille à promouvoir le développement durable tout en préservant son riche héritage culturel.','Machu Picchu : L\'une des merveilles du monde, Machu Picchu, est une ancienne cité inca perchée dans les montagnes des Andes. Sa construction remonte au XVe siècle, et elle est devenue un site emblématique du Pérou, attirant des millions de visiteurs chaque année.','Le lac Titicaca : Le lac Titicaca, situé à cheval sur la frontière entre le Pérou et la Bolivie, est le plus haut lac navigable du monde. Il est entouré de légendes incas et abrite des îles flottantes construites en roseaux par les habitants locaux appelés les Uros.','Le chemin de l\'Inca : Le chemin de l\'Inca est un sentier pédestre emblématique qui mène à Machu Picchu. Ce sentier de randonnée offre des vues spectaculaires sur les montagnes, les forêts tropicales et les ruines incas. Il attire les randonneurs du monde entier pour une aventure unique.'),('PF',-17.6797,-149.407,'Polynésie française','PYF',258,'??','U+1F1F5 U+1F1EB',0,6,69.759509684294,'La Polynésie française, un paradis tropical dans le Pacifique Sud, est formée de cinq archipels offrant des paysages variés, des lagons turquoise et une riche culture polynésienne. Avec Papeete comme centre, elle combine l\'influence maorie et française. En tant que collectivité d\'outre-mer française, son économie repose sur le tourisme, la pêche et la perliculture. C\'est une destination prisée pour ses plages idylliques, ses activités de plongée et son atmosphère authentique, mêlant traditions polynésiennes et modernité française','Les Tatouages Maoris : La Polynésie française, comprenant des îles comme Tahiti, est réputée pour son art traditionnel du tatouage, inspiré des motifs maoris. Ces tatouages, appelés \"tā moko,\" ont des significations culturelles profondes, représentant souvent le statut social, l\'histoire personnelle, et la connexion avec la nature.','La Danse Hula à Tahiti : La danse hula, originaire d\'Hawaï mais également pratiquée en Polynésie française, est une forme artistique qui combine mouvements gracieux et expressions narratives. À Tahiti, les danseurs traditionnels, vêtus de costumes colorés et de parures florales, enchantent les spectateurs avec des récits visuels de la mythologie polynésienne.','Les Bungalows sur l\'Eau à Bora Bora : Bora Bora est célèbre pour ses complexes hôteliers offrant des bungalows sur pilotis au-dessus des eaux cristallines du lagon. Ces hébergements emblématiques permettent aux visiteurs de vivre une expérience unique, avec un accès direct à la mer et des vues imprenables sur le mont Otemanu.'),('PG',-6.31499,143.956,'Papouasie-Nouvelle-Guinée','PNG',598,'??','U+1F1F5 U+1F1EC',0,6,75.67233142971278,NULL,NULL,NULL,NULL),('PH',12.8797,121.774,'Philippines','PHL',608,'??','U+1F1F5 U+1F1ED',0,4,69.0831311690464,NULL,NULL,NULL,NULL),('PK',30.3753,69.3451,'Pakistan','PAK',586,'??','U+1F1F5 U+1F1F0',0,4,18.398664629458136,NULL,NULL,NULL,NULL),('PL',51.9194,19.1451,'Pologne','POL',616,'??','U+1F1F5 U+1F1F1',0,5,84.74393271351599,'La Pologne, située en Europe centrale, offre un mélange captivant de richesse historique, de traditions vibrantes et de paysages variés. Varsovie, la capitale reconstruite après la Seconde Guerre mondiale, et Cracovie, avec son centre médiéval préservé, sont parmi les principales attractions. La Pologne est reconnue pour ses châteaux médiévaux, ses églises gothiques et ses places animées. Politiquement, c\'est une république démocratique qui a joué un rôle clé dans l\'histoire européenne. L\'économie polonaise est en croissance, soutenue par des secteurs tels que la fabrication, les services et les technologies de l\'information. La Pologne est également célèbre pour sa riche culture artistique, ses festivals traditionnels et sa cuisine savoureuse. Avec ses parcs nationaux, ses montagnes des Tatras et ses plages de la mer Baltique, la Pologne attire les visiteurs avec sa diversité naturelle et culturelle.','La Vieille Ville de Cracovie : La Vieille Ville de Cracovie, inscrite au patrimoine mondial de l\'UNESCO, est une merveille architecturale. Les visiteurs peuvent se perdre dans les ruelles pavées, découvrir la Place du Marché médiévale, et admirer des joyaux tels que la Basilique Sainte-Marie et le Château Royal de Wawel, témoins de l\'histoire riche de la Pologne.','La Solidarité à Gdańsk : Le mouvement Solidarność, fondé à Gdańsk en 1980, a joué un rôle crucial dans la lutte pour les droits ouvriers et la fin du régime communiste en Pologne. Le chantier naval de Gdańsk a été le lieu de manifestations importantes menées par Lech Wałęsa, figure emblématique du mouvement et futur président polonais.','Les Mines de Sel de Wieliczka : Les Mines de Sel de Wieliczka, également classées par l\'UNESCO, sont parmi les plus anciennes mines de sel encore en activité au monde. Les visiteurs peuvent explorer les galeries souterraines, ornées de sculptures en sel réalisées par les mineurs au fil des siècles, et même visiter une chapelle de sel.'),('PR',18.2208,-66.5901,'Porto Rico','PRI',630,'??','U+1F1F5 U+1F1F7',0,2,68.52367275257005,'Porto Rico, une île des Caraïbes sous souveraineté américaine, est un mélange captivant de cultures latino-américaines, africaines et espagnoles. Entourée de plages de sable doré et de forêts tropicales luxuriantes, Porto Rico offre un cadre naturel époustouflant. En tant que territoire non incorporé des États-Unis, Porto Rico a une histoire complexe et une identité culturelle unique. L\'économie repose sur le tourisme, l\'industrie pharmaceutique et le commerce.','La Fortaleza à San Juan : La Fortaleza, à San Juan, Porto Rico, est la plus ancienne résidence présidentielle en fonction dans le monde. Des projets de restauration sont en cours pour préserver ce site historique, offrant une fenêtre sur le passé colonial de l\'île.','Les Plages bioluminescentes : Les baies bioluminescentes de Porto Rico, comme Mosquito Bay, offrent un spectacle naturel fascinant de lueurs bleues créées par des micro-organismes. Des efforts environnementaux sont en place pour préserver ces écosystèmes fragiles et garantir une expérience unique.','Le Carnaval de Ponce : Le Carnaval de Ponce à Porto Rico est une célébration colorée avec des défilés, des costumes extravagants et de la musique festive. Des projets culturels visent à préserver cette tradition animée, reflétant la joie de vivre caractéristique de Porto Rico.'),('PT',39.3999,-8.22445,'Portugal','PRT',620,'??','U+1F1F5 U+1F1F9',0,5,88.3865686956668,'Le Portugal, situé à l\'extrémité ouest de l\'Europe, est un pays riche en histoire, en culture et en paysages variés. Géographiquement, le Portugal partage la péninsule ibérique avec l\'Espagne et est bordé par l\'océan Atlantique. Ses côtes offrent des plages magnifiques, tandis que l\'intérieur du pays est caractérisé par des collines verdoyantes, des vignobles et des oliveraies. Sur le plan culturel, le Portugal a laissé une empreinte durable grâce à son passé maritime glorieux, avec des influences arabes, africaines et brésiliennes. La fado, une musique mélancolique, et l\'azulejo, une forme d\'art décoratif en carreaux, font partie intégrante de la culture portugaise. Politiquement, le Portugal est une république parlementaire et a connu une transition démocratique pacifique en 1974. Économiquement, le pays a diversifié ses secteurs, du tourisme en pleine croissance à l\'industrie. Malgré des défis économiques, le Portugal a réussi à maintenir un équilibre entre tradition et modernité, en faisant de lui une destination prisée tant pour son patrimoine que pour sa convivialité.','Les Azulejos : Le Portugal est célèbre pour ses azulejos, des carreaux de faïence décoratifs qui ornent souvent les façades des bâtiments, les églises et les places. Ces carreaux colorés racontent souvent des histoires historiques ou des motifs artistiques complexes. Les azulejos sont une caractéristique artistique distinctive du Portugal, ajoutant une touche de beauté visuelle à son architecture.','Le Pont du 25 Avril à Lisbonne : Le Pont du 25 Avril, qui enjambe le fleuve Tage à Lisbonne, est un monument emblématique du Portugal. Il ressemble au Golden Gate Bridge de San Francisco, mais son design unique en fait une structure remarquable. Le pont offre une vue imprenable sur la ville de Lisbonne et est un site incontournable pour les visiteurs et les amateurs de photographie.','Les Fado : Le Fado est un genre musical portugais mélancolique et expressif qui exprime la saudade, un sentiment de nostalgie profonde. Souvent joué dans des bars traditionnels, le Fado est une expérience musicale authentique qui capture l\'âme et l\'émotion du Portugal. Les quartiers comme l\'Alfama à Lisbonne sont réputés pour leurs performances de Fado.'),('PW',7.51498,134.583,'Palaos','PLW',585,'??','U+1F1F5 U+1F1FC',0,6,36.36182829398832,NULL,NULL,NULL,NULL),('PY',-23.4425,-58.4438,'Paraguay','PRY',600,'??','U+1F1F5 U+1F1FE',0,3,16.649438456305713,'Le Paraguay, situé en Amérique du Sud, est un pays enclavé connu pour ses vastes espaces naturels, ses rivières, et son histoire culturelle riche. Asunción, la capitale, est le centre politique et culturel du pays. Le Paraguay est marqué par le fleuve Paraguay, le Pantanal, et les missions jésuites historiques. Politiquement, le Paraguay est une république démocratique. Son économie repose sur l\'agriculture, notamment la production de soja et de bœuf, ainsi que sur l\'industrie manufacturière. La population paraguayenne, principalement métisse, contribue à une culture influencée par les traditions indigènes guaranis et l\'héritage espagnol. Bien que le Paraguay soit un pays sans accès à la mer, sa position géographique centrale en Amérique du Sud a façonné son histoire et son rôle dans la région.','La Réserve Naturelle de l\'État de Mbaracayú : La réserve de Mbaracayú est un trésor écologique du Paraguay, abritant une biodiversité exceptionnelle. Cette réserve englobe des forêts tropicales, des savanes, et des cours d\'eau, offrant un habitat vital pour de nombreuses espèces, dont le jaguar, le tapir, et une grande variété d\'oiseaux.','La Guerre de la Triple Alliance : Le Paraguay a été le théâtre de la Guerre de la Triple Alliance (1864-1870), un conflit sanglant qui opposait le Paraguay au Brésil, à l\'Argentine et à l\'Uruguay. Cette guerre a eu des conséquences significatives sur la population paraguayenne, causant d\'importantes pertes humaines et territoriales.','La Culture Guarani : Les Guarani, un peuple autochtone, ont une présence culturelle profonde au Paraguay. Leurs traditions, leur artisanat, et leur langue ont laissé une empreinte importante sur la culture paraguayenne. La musique et la danse guarani sont également des éléments essentiels de l\'identité culturelle du pays.'),('QA',25.3548,51.1839,'Qatar','QAT',634,'??','U+1F1F6 U+1F1E6',0,4,74.16171047292809,NULL,NULL,NULL,NULL),('RO',45.9432,24.9668,'Roumanie','ROU',642,'??','U+1F1F7 U+1F1F4',0,5,20.86024006908782,'La Roumanie, nichée en Europe du Sud-Est, est caractérisée par une diversité géographique, allant des montagnes des Carpates aux plaines du Danube. Sa culture est le reflet d\'une riche histoire marquée par l\'influence romaine, l\'Empire ottoman, et l\'ère communiste. La population roumaine est réputée pour son hospitalité et sa passion pour la musique traditionnelle, la danse, et les arts folkloriques. Politiquement, la Roumanie a fait des progrès significatifs depuis la fin du régime communiste en 1989, devenant un membre de l\'Union européenne en 2007. Sur le plan économique, le pays connaît une croissance, avec l\'industrie, l\'agriculture et le secteur des technologies de l\'information jouant des rôles clés. Cependant, des défis subsistent, notamment en matière de corruption et de disparités économiques régionales.','Le château de Dracula : La Roumanie est souvent associée au personnage de Dracula, inspiré par Vlad III, également connu sous le nom de Vlad l\'Empaleur. Bien que le château de Bran soit souvent appelé le \"château de Dracula\", il n\'y a pas de preuve historique que Vlad y ait résidé. Néanmoins, le château attire de nombreux visiteurs fascinés par l\'histoire de Dracula.','La forêt des Hêtres de Ceahlău : Le Massif des Monts Ceahlău est souvent surnommé \"la Perle des Carpates\". Il abrite la Forêt des Hêtres, l\'une des dernières forêts primaires d\'Europe. La région est riche en biodiversité, avec une flore et une faune uniques.','Les gorges du Bicaz : Les gorges du Bicaz, également connues sous le nom de \"Cheile Bicazului\", offrent des paysages spectaculaires avec des parois rocheuses escarpées et une route sinueuse à travers les montagnes. Les gorges sont une destination prisée des amateurs de randonnée et des passionnés de sports de plein air.'),('RS',44.0165,21.0059,'Serbie','SRB',688,'??','U+1F1F7 U+1F1F8',0,5,81.81607200001932,'La Serbie, située dans la péninsule des Balkans en Europe du Sud-Est, est un pays au riche héritage historique et culturel. Géographiquement, elle présente des paysages variés, avec des plaines fertiles, des montagnes imposantes et des rivières sinueuses, dont le Danube. La culture serbe est marquée par l\'intersection de l\'Orient et de l\'Occident, reflétée dans sa musique traditionnelle, ses danses folkloriques et son art religieux orthodoxe. Politiquement, la Serbie est une république parlementaire, ayant émergé de l\'éclatement de l\'ancienne Yougoslavie. Le pays a traversé des périodes de transition depuis les conflits des années 1990 et cherche à renforcer ses institutions démocratiques. Sur le plan économique, la Serbie a entrepris des réformes visant à favoriser le développement et à attirer des investissements. L\'industrie, l\'agriculture et les services constituent les principaux piliers de son économie en pleine croissance. Bien que des défis subsistent, la Serbie continue de jouer un rôle clé dans la région des Balkans et aspire à renforcer ses liens avec l\'Union européenne.','Les Portes de Fer sur le Danube : La gorge des Portes de Fer, sur le fleuve Danube, marque la frontière naturelle entre la Serbie et la Roumanie. Cette région offre des paysages spectaculaires et abrite le plus grand complexe hydroélectrique d\'Europe du Sud-Est, avec les centrales hydroélectriques d\'Iron Gate I et Iron Gate II.','Ville Historique : Nis est l\'une des plus anciennes villes d\'Europe et possède une histoire riche qui remonte à l\'Antiquité romaine. La ville abrite des sites tels que la forteresse de Nis, la Tour Crâne et le site archéologique de Mediana.','Fête de la Prune : La Serbie est réputée pour sa production de rakija, une eau-de-vie de fruits, notamment de prunes. Chaque année, la ville de Osečina organise la Fête de la Prune pour célébrer cette tradition, avec des dégustations de rakija, des danses folkloriques et des événements culturels.'),('RU',61.524,105.319,'Russie','RUS',643,'??','U+1F1F7 U+1F1FA',1,5,46.49964286619765,'La Russie, le plus vaste pays du monde, s\'étend sur l\'Europe de l\'Est et l\'Asie du Nord. Avec ses immenses étendues de terres, ses montagnes, ses lacs et ses rivières, la Russie offre des paysages variés. La culture russe, riche en littérature, musique et arts visuels, a une influence mondiale. En tant que fédération, la Russie a traversé des époques clés telles que l\'Empire russe, l\'Union soviétique et la Russie moderne. Son économie, reposant sur l\'énergie, les ressources naturelles et l\'industrie, fait d\'elle une puissance mondiale.','La Place Rouge et le Kremlin à Moscou : La Place Rouge et le Kremlin de Moscou sont des sites emblématiques de la Russie. Des projets de préservation historique maintiennent ces monuments, tels que la Cathédrale Saint-Basile et le Kremlin, symboles de la puissance russe.','Le lac Baïkal : Le lac Baïkal, le plus profond et ancien lac d\'eau douce au monde, est situé en Sibérie. Des initiatives environnementales protègent la pureté de ses eaux et la biodiversité unique qui l\'entoure.','L\'Ermitage à Saint-Pétersbourg : L\'Ermitage à Saint-Pétersbourg est l\'un des plus grands musées du monde. Des projets de conservation préservent les collections artistiques et culturelles de ce complexe muséal, reflétant la richesse de l\'histoire russe.'),('RW',-1.94028,29.8739,'Rwanda','RWA',646,'??','U+1F1F7 U+1F1FC',0,1,87.05000140429475,'Le Rwanda, surnommé le \"pays aux mille collines\" en raison de son relief vallonné, est situé en Afrique de l\'Est. Malgré son histoire marquée par le génocide, le Rwanda a connu un remarquable renouveau économique et social. La culture rwandaise est influencée par les traditions ancestrales, avec une emphase sur la réconciliation et le développement communautaire. En tant que république, le Rwanda a mis en place des politiques innovantes pour stimuler la croissance économique, notamment dans l\'agriculture, les technologies et le tourisme.','Les Gorilles de montagne au Parc national des Volcans : Le Rwanda est célèbre pour ses gorilles de montagne. Des projets de conservation sont en place pour protéger ces grands singes en voie de disparition, contribuant à la préservation de la biodiversité.','Le Mémorial du génocide de Kigali : Le Mémorial du génocide de Kigali commémore les événements tragiques de 1994. Des projets mémoriaux visent à préserver la mémoire des victimes et à promouvoir la réconciliation.','Le Lac Kivu : Le Lac Kivu, l\'un des grands lacs africains, offre des paysages spectaculaires. Des programmes de préservation environnementale sont en place pour protéger la biodiversité du lac et soutenir les communautés locales.'),('SA',23.8859,45.0792,'Arabie saoudite','SAU',682,'??','U+1F1F8 U+1F1E6',0,4,95.7510814962453,NULL,NULL,NULL,NULL),('SB',-9.64571,160.156,'Salomon (Îles)','SLB',90,'??','U+1F1F8 U+1F1E7',0,6,17.605406341706782,NULL,NULL,NULL,NULL),('SC',-4.67957,55.492,'Seychelles','SYC',690,'??','U+1F1F8 U+1F1E8',0,1,0.7737902931624933,'Les Seychelles, un archipel de 115 îles situé dans l\'océan Indien, offrent un panorama tropical paradisiaque. Géographiquement, ces îles granitiques et coralliennes sont renommées pour leurs plages de sable blanc, leurs eaux cristallines et leur biodiversité marine exceptionnelle. La culture seychelloise est un mélange unique d\'influences africaines, européennes et asiatiques, reflété dans la musique, la danse et la cuisine créole. Sur le plan politique, les Seychelles sont une république présidentielle stable, avec un gouvernement multipartite. L\'économie dépend fortement du tourisme, de la pêche et de l\'industrie offshore. Le secteur du tourisme bénéficie des magnifiques plages et des parcs marins, tandis que la pêche contribue de manière significative à l\'économie. Les Seychelles ont également pris des mesures pour promouvoir la durabilité environnementale, ce qui en fait une destination prisée pour les amoureux de la nature.','Plages Paradisiaques : Les Seychelles sont célèbres pour leurs plages immaculées de sable blanc et leurs eaux cristallines. Anse Lazio à Praslin et Anse Source d\'Argent à La Digue sont parmi les plages les plus photographiées au monde, offrant des paysages dignes d\'une carte postale.','Vallée de Mai : Située sur l\'île de Praslin, la Vallée de Mai est une réserve naturelle inscrite au patrimoine mondial de l\'UNESCO. Elle abrite le coco de mer, une espèce de palmier unique produisant la plus grande graine du règne végétal. La forme suggestive de cette graine lui a valu le surnom de \"coco-fesses\".','Aldabra, le plus grand atoll corallien : Les Seychelles abritent Aldabra, le plus grand atoll corallien du monde. Cette île éloignée est un site classé au patrimoine mondial de l\'UNESCO et abrite une population importante de tortues géantes, ainsi que des espèces marines diverses.'),('SD',12.8628,30.2176,'Soudan','SDN',729,'??','U+1F1F8 U+1F1E9',4,1,51.05273551405662,'Le Soudan, situé en Afrique du Nord-Est, est un pays vaste et diversifié tant sur le plan géographique que culturel. Géographiquement, il englobe des déserts, des montagnes, des plaines et des zones bordant la mer Rouge. Le Soudan a une histoire complexe, avec des influences arabes, africaines et islamiques marquées. La diversité culturelle se manifeste à travers les traditions, les langues et les coutumes des nombreux groupes ethniques. Politiquement, le Soudan a connu des périodes d\'instabilité, mais récemment, des changements significatifs ont eu lieu, y compris la séparation avec le Soudan du Sud en 2011 et un changement de régime en 2019. Le pays a entamé des transitions politiques et économiques pour répondre aux aspirations de la population. Sur le plan économique, le Soudan est confronté à des défis liés à la dépendance aux ressources naturelles, mais il a également un potentiel agricole et minier important. Les défis économiques, sociaux et politiques demeurent, et le Soudan travaille à surmonter ces obstacles pour réaliser un développement durable et une stabilité accrue.','Les Pyramides de Méroé : Le Soudan est le site des pyramides de Méroé, un ensemble impressionnant de pyramides construites entre 300 av. J.-C. et 300 ap. J.-C. par le royaume koushite de Méroé. Ces pyramides se distinguent par leurs structures plus étroites et plus pointues que celles d\'Égypte.','Le Nil Bleu : Le Soudan est traversé par le Nil Bleu, l\'un des principaux affluents du Nil. La ville de Khartoum, la capitale, est le point de confluence du Nil Bleu et du Nil Blanc, formant le Nil principal. Le Nil a joué un rôle central dans l\'histoire et le développement de la région.','Le Royaume de Koush : Le royaume de Koush, également connu sous le nom de Koushite, a joué un rôle important dans l\'histoire ancienne de la région. Ses relations avec l\'Égypte ancienne, notamment pendant la période des pharaons, ont laissé une trace significative dans l\'histoire régionale.'),('SE',60.1282,18.6435,'Suède','SWE',752,'??','U+1F1F8 U+1F1EA',0,5,52.942309764160136,'La Suède, située dans le nord de l\'Europe, est un pays aux multiples facettes. Géographiquement, elle est caractérisée par des paysages variés, comprenant des lacs étendus, des forêts denses et un littoral pittoresque le long de la mer Baltique. La Suède a une culture riche, influencée par son histoire viking, ses traditions folkloriques et son engagement envers l\'égalité sociale. Politiquement, la Suède est une monarchie constitutionnelle avec un système parlementaire, caractérisée par une politique sociale progressiste et une neutralité dans les affaires internationales. Sur le plan économique, la Suède a réussi à combiner un modèle de bien-être solide avec une économie de marché dynamique. Elle est reconnue pour son innovation, son secteur technologique florissant, et ses entreprises mondialement compétitives, contribuant ainsi à son statut de l\'un des pays les plus prospères d\'Europe.','Les Aurores Boréales de l\'Abisko : La Suède offre des opportunités uniques d\'observer les aurores boréales. La région d\'Abisko, située au-delà du Cercle Arctique, est réputée pour ses cieux clairs et offre aux visiteurs des chances exceptionnelles d\'admirer ce spectacle naturel magique.','Le Musée Vasa : À Stockholm, le Musée Vasa abrite le seul vaisseau de guerre presque entièrement intact du XVIIe siècle. Le Vasa a coulé lors de son voyage inaugural en 1628 et a été récupéré en 1961. Le musée présente le navire, ainsi que des expositions sur la vie maritime de l\'époque.','Le Palais Royal de Stockholm : Le Palais Royal, situé à Stockholm, est l\'un des plus grands palais royaux d\'Europe encore en usage. Les visiteurs peuvent assister à la relève de la garde, explorer les magnifiques salles d\'apparat, et visiter les musées situés dans le complexe, y compris le musée des antiquités.'),('SG',1.35208,103.82,'Singapour','SGP',702,'??','U+1F1F8 U+1F1EC',0,4,11.55334535199529,NULL,NULL,NULL,NULL),('SI',46.1512,14.9955,'Slovénie','SVN',705,'??','U+1F1F8 U+1F1EE',0,5,98.93980054086056,NULL,NULL,NULL,NULL),('SK',48.669,19.699,'Slovaquie','SVK',703,'??','U+1F1F8 U+1F1F0',0,5,60.03896972168141,'La Slovaquie, nichée au cœur de l\'Europe centrale, est un pays d\'une grande diversité culturelle et naturelle. Bordée par les Carpates, elle offre des paysages montagneux pittoresques et des vallées verdoyantes. La Slovaquie a une riche histoire marquée par des influences austro-hongroises, et sa culture est imprégnée de traditions folkloriques. En tant que république parlementaire, elle a connu des changements significatifs depuis son indépendance au XXe siècle. L\'économie slovaque, en croissance, est caractérisée par des secteurs tels que l\'industrie automobile et le tourisme, attirant les visiteurs avec ses châteaux médiévaux et ses stations thermales.','Le Château de Spiš : L\'un des plus vastes châteaux d\'Europe centrale, le Château de Spiš, situé en Slovaquie, date du XIIe siècle. Il offre un témoignage remarquable de l\'architecture médiévale et a été inscrit au patrimoine mondial de l\'UNESCO. Malgré des périodes d\'abandon, des efforts de préservation ont été entrepris pour maintenir l\'intégrité de cette forteresse historique.','La Grotte de glace de Dobšinská : Nichée dans les montagnes slovaques, la Grotte de glace de Dobšinská est une merveille souterraine. Découverte au début du XXe siècle, elle abrite des formations de glace uniques. Bien que fragile, des initiatives de préservation sont en place pour préserver cette beauté naturelle et offrir aux visiteurs une expérience captivante.','Le folklore slovaque : La Slovaquie célèbre son riche patrimoine culturel à travers son folklore coloré. Les danses traditionnelles, les costumes folkloriques et les festivals animent les villes et villages slovaques. Des projets de préservation culturelle visent à transmettre ces traditions aux générations futures, faisant du folklore slovaque une source de fierté nationale.'),('SL',8.46056,-11.7799,'Sierra Leone','SLE',694,'??','U+1F1F8 U+1F1F1',0,1,3.37545005918988,NULL,NULL,NULL,NULL),('SM',43.9424,12.4578,'Saint-Marin','SMR',674,'??','U+1F1F8 U+1F1F2',0,5,36.76034420426967,'Saint-Marin, une enclave entourée par l\'Italie, est l\'un des plus petits États indépendants du monde. Ce micro-État est imprégné d\'une riche histoire remontant à l\'Antiquité romaine. Le mont Titano offre des vues pittoresques sur la campagne environnante. Saint-Marin est une république parlementaire avec une stabilité politique notable. Son économie, bien que petite, repose sur le tourisme, les services financiers et l\'artisanat.','Les Trois Tours de Saint-Marin : Saint-Marin, la plus ancienne république du monde, est caractérisée par ses Trois Tours emblématiques. Des projets de préservation veillent à maintenir ces tours, symboles de l\'indépendance et de la longue histoire de la république.','Le Mont Titano et la vieille ville : Le Mont Titano, où se trouve la vieille ville de Saint-Marin, est un site du patrimoine mondial de l\'UNESCO. Des initiatives de restauration préservent les ruelles pavées, les églises et les places de cette ville médiévale pittoresque.','La tradition de la Torta Tre Monti : La Torta Tre Monti, un gâteau à la noisette, est une spécialité de Saint-Marin. Des projets culturels cherchent à préserver cette tradition culinaire, offrant un délicieux lien avec l\'histoire gastronomique du pays.'),('SN',14.4974,-14.4524,'Sénégal','SEN',686,'??','U+1F1F8 U+1F1F3',0,1,73.6753739171432,NULL,NULL,NULL,NULL),('SR',3.91931,-56.0278,'Suriname','SUR',740,'??','U+1F1F8 U+1F1F7',0,3,58.09584004627153,NULL,NULL,NULL,NULL),('SV',13.7942,-88.8965,'Salvador','SLV',222,'??','U+1F1F8 U+1F1FB',0,2,69.45308155329253,'Le Salvador, situé en Amérique centrale sur la côte du Pacifique, est un petit pays riche en histoire et en diversité géographique. Géographiquement, il offre des plages magnifiques, des volcans imposants et des montagnes pittoresques. La culture salvadorienne est influencée par son passé précolombien, colonial et son héritage autochtone. La musique, la danse et l\'artisanat traditionnel font partie intégrante de l\'identité culturelle du pays. Politiquement, le Salvador est une république présidentielle, ayant surmonté des décennies de conflits civils pour devenir une démocratie en développement. L\'économie salvadorienne repose sur le commerce, les services et les envois de fonds des Salvadoriens vivant à l\'étranger, notamment aux États-Unis. Malgré des défis économiques et sociaux, le Salvador poursuit des réformes visant à stimuler la croissance et à améliorer les conditions de vie de sa population. Le pays est également connu pour son adoption récente du bitcoin comme monnaie légale, marquant une initiative unique dans le paysage financier mondial.','Les Ruines de Joya de Cerén : Souvent appelées la \"Pompéi d\'Amérique\", les ruines de Joya de Cerén sont un site archéologique exceptionnel qui a été préservé sous des cendres volcaniques pendant des siècles. Ces vestiges offrent un aperçu unique de la vie quotidienne de la civilisation maya, figée au VIe siècle','Le Parc National de Montecristo : Situé à la frontière entre El Salvador, le Honduras et le Guatemala, le Parc National Montecristo est une réserve de biosphère qui abrite une biodiversité extraordinaire. Les visiteurs peuvent découvrir des forêts nuageuses, des cascades, et une variété d\'espèces animales et végétales.','Le Parc National de Montecristo : Situé à la frontière entre El Salvador, le Honduras et le Guatemala, le Parc National Montecristo est une réserve de biosphère qui abrite une biodiversité extraordinaire. Les visiteurs peuvent découvrir des forêts nuageuses, des cascades, et une variété d\'espèces animales et végétales.'),('SY',34.8021,38.9968,'Syrie','SYR',760,'??','U+1F1F8 U+1F1FE',3,4,72.97789070101258,NULL,NULL,NULL,NULL),('TC',21.694,-71.7979,'Îles Turques-et-Caïques','TCA',796,'??','U+1F1F9 U+1F1E8',0,2,56.53021191854981,'Les Îles Turques-et-Caïques, territoire britannique des Caraïbes, sont célèbres pour leurs plages immaculées, leurs eaux cristallines et leur atmosphère détendue. Composé de plus de 40 îles, cet archipel attire les visiteurs avec des destinations prisées comme Providenciales. L\'économie repose sur le tourisme, les services financiers et la pêche, faisant de ces îles une escapade tropicale idyllique.','Les Plages de Sable Blanc de Grace Bay : Grace Bay Beach, située sur l\'île de Providenciales, est souvent classée parmi les plus belles plages du monde. Ses eaux turquoise, son sable fin et ses récifs coralliens font de cette plage un véritable paradis tropical, attirant les voyageurs du monde entier.','La Réserve de la Biosphère de l\'île de la Grand Turk : L\'île de la Grand Turk abrite la première réserve de biosphère des Caraïbes, désignée par l\'UNESCO. Cette réserve englobe une variété d\'écosystèmes, des marais salants aux forêts de pins, offrant un habitat essentiel pour la faune locale, y compris des oiseaux migrateurs.','La Culture Conch à Middle Caicos : La pêche à la conque (conch) est une partie intégrante de la culture des Îles Turques-et-Caïques. Sur l\'île de Middle Caicos, les visiteurs peuvent découvrir les méthodes traditionnelles de pêche à la conque, ainsi que déguster des plats locaux délicieux tels que la salade de conque.'),('TD',15.4542,18.7322,'Tchad','TCD',148,'??','U+1F1F9 U+1F1E9',0,1,63.717390563075796,NULL,NULL,NULL,NULL),('TG',8.61954,0.824782,'Togo','TGO',768,'??','U+1F1F9 U+1F1EC',4,1,48.99632013309404,NULL,NULL,NULL,NULL),('TH',15.87,100.993,'Thaïlande','THA',764,'??','U+1F1F9 U+1F1ED',0,4,53.82943204960733,NULL,NULL,NULL,NULL),('TJ',38.861,71.2761,'Tadjikistan','TJK',762,'??','U+1F1F9 U+1F1EF',0,4,22.158202922119017,NULL,NULL,NULL,NULL),('TM',38.9697,59.5563,'Turkménistan','TKM',795,'??','U+1F1F9 U+1F1F2',0,4,49.30272153513759,'Le Turkménistan, situé en Asie centrale, est un pays désertique bordé par la mer Caspienne à l\'ouest. Ses vastes étendues de désert abritent des sites uniques tels que la porte de l\'Enfer. La culture turkmène, influencée par les traditions nomades, est caractérisée par l\'hospitalité et les tapis colorés. En tant que république présidentielle, le Turkménistan a consolidé son indépendance après la dissolution de l\'Union soviétique. Son économie repose principalement sur les ressources naturelles, en particulier le gaz naturel.','La Porte de l\'Enfer : Le cratère de Darvaza, surnommé la \"Porte de l\'Enfer\", est un site unique au Turkménistan. Des mesures de préservation écologique sont prises pour étudier et protéger cette curiosité géologique, créant un équilibre entre la recherche scientifique et la conservation.','La Route de la Soie à Merv : Merv, ancien centre de commerce sur la Route de la Soie, est aujourd\'hui une ville fantôme. Des projets de préservation archéologique visent à protéger les vestiges de cette cité historique, offrant aux visiteurs un aperçu de la richesse culturelle du Turkménistan.','Le Turkménistan indépendant : Depuis son indépendance, le Turkménistan a connu des développements modernes. Des initiatives culturelles encouragent la préservation des coutumes traditionnelles tout en favorisant le progrès économique et technologique du pays.'),('TN',33.8869,9.5375,'Tunisie','TUN',788,'??','U+1F1F9 U+1F1F3',4,1,80.03900198269542,'La Tunisie, située au nord de l\'Afrique, est un pays riche en histoire, en culture et en diversité géographique. Ses côtes longent la mer Méditerranée, offrant des plages ensoleillées, tandis que l\'intérieur du pays est caractérisé par des plaines fertiles, des montagnes et des déserts. La culture tunisienne est le résultat d\'une fusion entre les influences arabes, berbères, africaines et européennes. La population tunisienne est majoritairement arabophone et musulmane, avec une tolérance religieuse et une coexistence culturelle bien établies. Politiquement, la Tunisie est une république avec un système parlementaire, ayant connu des transitions politiques depuis la révolution de 2011 qui a initié le Printemps arabe. Sur le plan économique, le tourisme, l\'agriculture et l\'industrie manufacturière sont des secteurs importants. Le pays cherche à diversifier son économie et à attirer des investissements pour promouvoir un développement inclusif. La Tunisie continue de jouer un rôle clé dans la région en tant que modèle de transition démocratique en Afrique du Nord.','Carthage, une ancienne métropole : La Tunisie abrite les ruines de Carthage, l\'une des grandes métropoles de l\'Antiquité. Fondée par les Phéniciens, Carthage a joué un rôle majeur dans l\'histoire méditerranéenne et a été le rival de Rome lors des guerres puniques.','Le désert du Sahara : Une partie du désert du Sahara s\'étend sur le sud de la Tunisie, offrant des paysages désertiques spectaculaires. Les oasis telles que Tozeur et Douz attirent les visiteurs avec leurs palmeraies, leurs marchés traditionnels et leurs expériences de conduite de chameaux.','Les plages de la côte méditerranéenne : La Tunisie offre une belle côte méditerranéenne avec des plages de sable doré. Des stations balnéaires populaires comme Hammamet attirent les visiteurs en quête de soleil, de mer et d\'une ambiance détendue.'),('TO',-21.179,-175.198,'Tonga','TON',776,'??','U+1F1F9 U+1F1F4',0,6,52.28684838142884,'Le Royaume des Tonga, un archipel polynésien situé dans le Pacifique Sud, est un pays insulaire doté d\'une beauté naturelle exceptionnelle. Composé de 169 îles, dont seulement 36 sont habitées, le pays offre des plages de sable blanc, des lagons cristallins et des récifs coralliens spectaculaires. La culture tongienne est profondément enracinée dans la tradition, avec des danses, des chants et des cérémonies qui célèbrent l\'héritage polynésien. Sur le plan politique, les Tonga sont une monarchie constitutionnelle, marquée par la stabilité politique relative. Le roi actuel, Tupou VI, est le chef d\'État. Le pays a entrepris des réformes démocratiques au cours des dernières années, évoluant vers une monarchie parlementaire. L\'économie des Tonga repose principalement sur l\'agriculture, la pêche et le tourisme. Les visiteurs sont attirés par la beauté naturelle des îles, ainsi que par la possibilité de plongée, de surf et d\'explorer la culture locale unique. Cependant, l\'économie reste relativement petite, et les Tonga sont confrontés à des défis tels que la vulnérabilité aux catastrophes naturelles, y compris les cyclones tropicaux. Malgré ces défis, les Tonga préservent avec fierté leur identité culturelle et leur environnement naturel, faisant de cet archipel un trésor préservé dans le Pacifique Sud.','Les Îles Ha\'apai : Le royaume de Tonga, situé dans le Pacifique Sud, comprend un groupe d\'îles appelé Ha\'apai, réputé pour ses plages immaculées, ses eaux cristallines et ses récifs coralliens préservés. Ces îles offrent une escapade tranquille et préservée, idéale pour les amoureux de la nature et les plongeurs cherchant à explorer la vie marine diversifiée.','La Pierre de la Trinité (Ha\'amonga \'a Maui) : Tonga abrite une structure ancienne connue sous le nom de la Pierre de la Trinité. Ce monument en pierre massive, appelé Ha\'amonga \'a Maui, est constitué de trois énormes blocs de corail dressés verticalement. On pense qu\'il a été érigé au XIIIe siècle en l\'honneur du roi Tu\'i Tonga Tu\'itatui, marquant des événements astronomiques importants.','Les Tombes de Lapaha : L\'île de Tongatapu abrite le site archéologique de Lapaha, où l\'on peut trouver d\'impressionnantes tombes royales. Ces tombes, marquées par des pierres dressées appelées langi, remontent à des centaines d\'années et reflètent l\'importance culturelle et historique de la région.'),('TR',38.9637,35.2433,'Turquie','TUR',792,'??','U+1F1F9 U+1F1F7',0,4,21.317239032422414,NULL,NULL,NULL,NULL),('TT',10.6918,-61.2225,'Trinité-et-Tobago','TTO',780,'??','U+1F1F9 U+1F1F9',0,2,49.72565309119006,'Trinité-et-Tobago, un pays insulaire situé dans la mer des Caraïbes, se compose des îles de Trinité et Tobago, situées au large de la côte nord-est du Venezuela. Géographiquement, Trinité-et-Tobago est caractérisée par des plages de sable blanc, des forêts tropicales luxuriantes et des collines pittoresques. Culturellement, le pays est un melting-pot dynamique avec des influences africaines, indiennes, créoles et européennes, reflétées dans la musique, la danse, la cuisine et les festivals animés tels que le carnaval de Trinité. Politiquement, Trinité-et-Tobago est une république indépendante et membre du Commonwealth. Son système politique est basé sur le modèle parlementaire britannique. Sur le plan économique, le pays a traditionnellement dépendu du secteur de l\'énergie, en particulier du pétrole et du gaz naturel. Cependant, il cherche à diversifier son économie en développant d\'autres secteurs tels que le tourisme, l\'agriculture et les services financiers. Malgré ses ressources naturelles abondantes, Trinité-et-Tobago fait face à des défis économiques et sociaux.','Carnaval de Trinité-et-Tobago : Le carnaval de Trinité-et-Tobago est l\'un des plus grands et des plus animés au monde. Il a lieu chaque année avant le Carême et est connu pour ses costumes élaborés, ses défilés colorés, ses danses entraînantes comme le calypso et la soca, et son atmosphère festive qui attire des visiteurs du monde entier.','Pitch Lake, le plus grand lac de bitume au monde : Trinité abrite le Pitch Lake, le plus grand lac de bitume naturel au monde. Il est souvent appelé \"La Houdini of Asphalt\" en raison de ses propriétés élastiques uniques. Les visiteurs peuvent faire des visites guidées autour du lac pour en apprendre davantage sur son origine géologique.','Scarlet Ibis à Caroni Swamp : Trinité-et-Tobago abrite le Caroni Swamp, un habitat naturel riche en biodiversité. L\'une des attractions les plus emblématiques est le rassemblement spectaculaire des ibis rouges (Scarlet Ibis) au crépuscule. Les oiseaux volent vers leurs aires de repos, créant un tableau vivant de couleurs vives dans le ciel.'),('TV',-7.10954,177.649,'Tuvalu','TUV',798,'??','U+1F1F9 U+1F1FB',0,6,84.67655143204755,'Tuvalu, un État insulaire situé dans le Pacifique, est l\'un des plus petits pays du monde en termes de superficie et de population. Composé de neuf atolls coralliens, Tuvalu est reconnu pour ses plages de sable blanc, ses lagons turquoise et ses cocotiers. Funafuti, la capitale, est le principal centre administratif et économique du pays. Politiquement, Tuvalu est une monarchie constitutionnelle, bien que membre du Commonwealth. L\'économie repose sur la pêche, la coprahiculture et les transferts financiers internationaux. En raison de sa faible altitude, Tuvalu est confronté aux défis du changement climatique, notamment la montée du niveau de la mer. Malgré sa petite taille, Tuvalu a attiré une attention mondiale en raison de son rôle dans les discussions sur les changements climatiques et le développement durable.','L\'Église de la Sainte-Trinité de Funafuti : La petite île de Funafuti abrite l\'Église de la Sainte-Trinité, un exemple intéressant d\'architecture locale. Construite en bois de cocotier tressé, cette église offre une représentation unique de l\'artisanat traditionnel de Tuvalu et est un lieu de culte important pour la communauté locale.','La Danse Fātele : La danse Fātele est une expression artistique traditionnelle à Tuvalu. Exécutée lors de célébrations et de festivals, cette danse implique des mouvements gracieux des mains et des pieds, souvent accompagnée de chants. La Fātele est un moyen important de préserver la culture et les traditions de Tuvalu.','Les Atolls et la Montée du Niveau de la Mer : Tuvalu est constitué principalement d\'atolls bas, ce qui le rend particulièrement vulnérable à la montée du niveau de la mer. L\'archipel est devenu un symbole mondial des défis posés par le changement climatique. Les habitants locaux travaillent activement pour sensibiliser aux impacts du réchauffement climatique et aux efforts de conservation.'),('TZ',-6.36903,34.8888,'Tanzanie','TZA',834,'??','U+1F1F9 U+1F1FF',4,1,74.2058009600321,NULL,NULL,NULL,NULL),('UA',48.3794,31.1656,'Ukraine','UKR',804,'??','U+1F1FA U+1F1E6',1,5,16.999353577382262,'L\'Ukraine, située en Europe de l\'Est, est un pays vaste et diversifié connu pour son histoire riche, sa culture vibrante, et ses plaines fertiles. Kiev, la capitale, est un centre politique et culturel majeur, tandis que d\'autres villes comme Lviv et Odessa sont réputées pour leur architecture et leur vie culturelle. L\'Ukraine est caractérisée par les Carpates à l\'ouest et les vastes steppes à l\'est. Politiquement, l\'Ukraine est une république avec une histoire complexe et des enjeux géopolitiques actuels. Son économie repose sur l\'agriculture, l\'industrie, et l\'énergie. La population ukrainienne, majoritairement d\'origine slave, a une culture riche en traditions folkloriques, littérature, et musique. L\'Ukraine a joué un rôle clé dans l\'histoire européenne, mais a également fait face à des défis politiques et économiques, notamment avec les événements liés à la Russie au 21e siècle.','Le Monastère de Kievo-Petcherska Lavra : Situé à Kyiv, le monastère de Kievo-Petcherska Lavra est un site historique majeur. Fondé au XIe siècle, il abrite des grottes où des moines ont vécu et sont enterrés. Le complexe comprend également de magnifiques églises, des musées, et des panoramas pittoresques sur la ville.','Le Taras Shevchenko National Park : Le parc national de Taras Shevchenko, dans les Carpates, est une réserve naturelle spectaculaire. Ses forêts denses, ses rivières cristallines, et ses sommets de montagnes offrent un cadre idéal pour la randonnée, le ski et l\'observation de la faune.','La Place de l\'Indépendance à Kyiv : La Place de l\'Indépendance, également connue sous le nom de Maidan Nezalezhnosti, a été le site de manifestations historiques, dont la Révolution orange en 2004. La place est entourée de bâtiments emblématiques, de boutiques et de cafés, en faisant un point central pour les événements culturels et sociaux.'),('UG',1.37333,32.2903,'Ouganda','UGA',800,'??','U+1F1FA U+1F1EC',4,1,62.37936808017955,NULL,NULL,NULL,NULL),('US',37.0902,-95.7129,'United States','USA',840,'??','U+1F1FA U+1F1F8',0,2,60.898782742115465,'The United States, located in North America, is a vast and diverse nation known for its cultural influence, economic power, and varied landscapes. Washington, D.C., the capital, reflects the nation\'s political center, while New York City, Los Angeles, and Chicago are major cultural and economic hubs. The U.S. has a federal system with a democratic government. Its economy is one of the largest globally, driven by diverse sectors like technology, finance, and manufacturing. The American population is ethnically and culturally diverse, contributing to a rich tapestry of traditions, languages, and cuisines. The U.S. is celebrated for its contributions to science, entertainment, and innovation, and its natural wonders range from the Grand Canyon to the Yellowstone National Park. Despite its strengths, the country faces challenges related to social issues, politics, and economic inequality.','Le Parc National de Yellowstone : Yellowstone, le premier parc national du monde, est situé principalement dans l\'État du Wyoming. Il est célèbre pour ses geysers, en particulier Old Faithful, et sa faune variée, notamment des bisons, des ours, et des loups. Le parc offre des paysages spectaculaires avec des sources chaudes colorées et des formations géologiques uniques.','La Route 66 : La Route 66, surnommée la \"Mother Road,\" était l\'une des premières routes principales à travers les États-Unis. Elle s\'étendait de Chicago à Santa Monica en Californie, devenant emblématique de la culture automobile américaine. Bien que la Route 66 ne soit plus une route fédérale, de nombreux tronçons historiques subsistent, invitant les voyageurs à revivre l\'histoire.','La Statue de la Liberté : La Statue de la Liberté à New York est l\'un des symboles les plus emblématiques des États-Unis. Offerte par la France en 1886, elle représente la liberté et l\'amitié entre les deux nations. Les visiteurs peuvent monter à l\'intérieur de la statue et profiter d\'une vue imprenable sur la ville de New York depuis la couronne.'),('UY',-32.5228,-55.7658,'Uruguay','URY',858,'??','U+1F1FA U+1F1FE',0,3,17.355812543403182,'L\'Uruguay, situé en Amérique du Sud entre le Brésil et l\'Argentine, est un petit pays caractérisé par ses vastes plaines, ses plages pittoresques et ses villes cosmopolites. Géographiquement, l\'Uruguay est dominé par des prairies, ce qui en fait un important producteur de bœuf et un lieu propice à l\'agriculture. Culturellement, l\'Uruguay est influencé par son héritage européen, avec des éléments espagnols et italiens prédominants. La culture uruguayenne est également marquée par une longue tradition de démocratie politique et de stabilité sociale. Politiquement, l\'Uruguay est une république présidentielle démocratique. Sur le plan économique, l\'agriculture, l\'élevage, l\'industrie manufacturière et les services sont des secteurs importants. Bien que le pays ait une économie relativement diversifiée, il est confronté à des défis tels que le chômage, les inégalités sociales et la nécessité de stimuler la croissance économique. L\'Uruguay est également connu pour son engagement en faveur des droits de l\'homme, de l\'éducation et de la durabilité environnementale. Malgré ses défis, l\'Uruguay demeure un pays progressiste en Amérique du Sud.','La plage de Punta del Este : Punta del Este est l\'une des stations balnéaires les plus célèbres d\'Uruguay. Connue pour ses plages de sable blanc, son atmosphère glamour et son emblématique sculpture \"La Mano\" (La Main) émergeant de la plage, la ville attire des visiteurs du monde entier.','Le carnaval de Montevideo : Le carnaval d\'Uruguay, en particulier à Montevideo, est l\'un des plus longs et des plus festifs au monde. Il débute généralement fin janvier et se prolonge pendant plusieurs semaines, avec des défilés colorés, des danses, des costumes extravagants et des célébrations animées.','La vieille ville de Colonia del Sacramento : Colonia del Sacramento, inscrite au patrimoine mondial de l\'UNESCO, est une ville portuaire préservée avec des rues pavées, des bâtiments coloniaux et des remparts. Elle offre une atmosphère charmante et une fenêtre sur le passé colonial de l\'Uruguay.'),('UZ',41.3775,64.5853,'Ouzbékistan','UZB',860,'??','U+1F1FA U+1F1FF',0,4,4.082717564034013,'L\'Ouzbékistan, situé en Asie centrale, est un pays caractérisé par un mélange captivant de richesses historiques, de patrimoine culturel et de paysages diversifiés. Le pays abrite d\'anciennes cités de la Route de la Soie, telles que Samarcande, Boukhara et Khiva, qui témoignent de la grandeur de l\'histoire islamique et de l\'architecture médiévale. La culture ouzbèke est influencée par des traditions millénaires, avec des arts, une musique et une danse riches et variés. Politiquement, l\'Ouzbékistan a connu des changements significatifs ces dernières années, avec des réformes économiques et des ouvertures vers l\'extérieur sous la direction du président Shavkat Mirziyoyev. Sur le plan économique, le pays s\'efforce de diversifier son économie en développant des secteurs tels que le tourisme, l\'agriculture et l\'industrie. Les défis incluent la nécessité de promouvoir le développement durable et de surmonter des questions liées aux droits de l\'homme. L\'Ouzbékistan émerge comme une destination touristique prisée tout en cherchant à équilibrer modernité et préservation de son riche patrimoine culturel.','Le lac d\'Aral : L\'Ouzbékistan partage une partie du lac d\'Aral avec le Kazakhstan. Malheureusement, le lac d\'Aral a subi une réduction dramatique de sa taille en raison de la surexploitation de ses affluents pour l\'irrigation. C\'est devenu un exemple frappant des conséquences environnementales de certaines pratiques agricoles.','La Route de la Soie : L\'Ouzbékistan est souvent associé à la légendaire Route de la Soie, une ancienne voie commerciale qui reliait l\'Est et l\'Ouest. Les villes ouzbèkes de Samarcande, Boukhara et Khiva étaient autrefois des centres prospères de commerce, d\'échange culturel et de savoir le long de cette route.','L\'architecture islamique : L\'Ouzbékistan est réputé pour son architecture islamique magnifique. La place du Registan à Samarcande, avec ses majestueuses madrasas et son minaret, est un exemple emblématique de l\'art islamique. Les coupoles turquoise et les carreaux de céramique ornent de nombreux édifices historiques.'),('VC',12.9843,-61.2872,'Saint-Vincent-et-les-Grenadines','VCT',670,'??','U+1F1FB U+1F1E8',0,2,68.34615326332502,NULL,NULL,NULL,NULL),('VE',6.42375,-66.5897,'Venezuela','VEN',862,'??','U+1F1FB U+1F1EA',0,3,29.482616697887533,'Le Venezuela, situé en Amérique du Sud, est caractérisé par une géographie diversifiée comprenant des plaines, des montagnes et des forêts tropicales. Le pays est riche en ressources naturelles, notamment le pétrole, qui joue un rôle central dans son économie. Sur le plan politique, le Venezuela a connu des défis au cours des dernières années, avec des tensions politiques et économiques marquées par des débats sur la gouvernance. La culture vénézuélienne est imprégnée d\'une riche histoire autochtone, espagnole et africaine, reflétée dans la musique, la danse et la cuisine. Cependant, ces aspects culturels sont parfois confrontés à des défis en raison des bouleversements politiques et économiques. L\'économie vénézuélienne a été fortement touchée par des problèmes tels que l\'inflation élevée, la pénurie alimentaire et la migration de nombreux citoyens en quête de conditions de vie meilleures.','Angel Falls : Le Venezuela abrite Angel Falls, la plus haute cascade du monde. Du haut de ses 979 mètres, cette merveille naturelle est située dans le parc national Canaima et attire des visiteurs du monde entier. Elle doit son nom à Jimmy Angel, un aviateur américain qui a survolé la région dans les années 1930','Le Salto Ángel : Angel Falls a inspiré la création du paradis des chutes du film d\'animation de Disney-Pixar, \"Up\". Les réalisateurs ont puisé dans la majesté et la grandeur d\'Angel Falls pour créer la cascade fictive du \"Paradise Falls\" dans le film.','Les Tepuys : Le Venezuela est connu pour ses Tepuys, des formations géologiques uniques en forme de plateaux rocheux isolés. Ces formations sont particulièrement visibles dans le parc national Canaima. Le mont Roraima, l\'un des Tepuys les plus célèbres, a inspiré le roman \"The Lost World\" de Sir Arthur Conan Doyle.'),('VG',18.4207,-64.64,'Vierges britanniques (Îles)','VGB',92,'??','U+1F1FB U+1F1EC',0,2,42.37462677282712,'Les Îles Vierges britanniques, situées dans les Caraïbes, forment un archipel d\'environ 50 îles, dont une quinzaine sont habitées. Ces îles offrent des plages de sable blanc, des eaux cristallines et des paysages tropicaux enchanteurs. La culture des Vierges britanniques est influencée par une histoire maritime complexe, avec des traces d\'influences africaines, européennes et caribéennes. Les habitants accueillants célèbrent leur patrimoine à travers la musique, la danse et les festivals locaux. Politiquement, les Vierges britanniques sont un territoire britannique d\'outre-mer, avec un gouvernement local et un statut d\'autonomie. Économiquement, le tourisme est un pilier majeur, attirant les visiteurs avec ses plages idylliques, ses sites de plongée et son ambiance décontractée. Le secteur financier offshore est également un contributeur significatif à l\'économie locale. Bien que prospère, l\'archipel fait face à des défis tels que la préservation de l\'environnement marin et la résilience aux tempêtes tropicales. Les Îles Vierges britanniques demeurent une destination prisée pour les voyageurs en quête de détente sous les tropiques.','La beauté naturelle des plages : Les Îles Vierges britanniques sont renommées pour leurs plages paradisiaques au sable blanc et leurs eaux cristallines. Les plages de White Bay à Jost Van Dyke, The Baths à Virgin Gorda et Cane Garden Bay à Tortola sont parmi les plus célèbres, attirant les amoureux de la nature et les amateurs de sports nautiques.','Norman Island et les légendes de pirates : Norman Island, souvent associée à l\'île au Trésor de Robert Louis Stevenson, est entourée de mystères et de légendes de pirates. On dit que Norman Island aurait inspiré le roman \"L\'île au trésor\". Les visiteurs peuvent explorer les grottes marines réputées pour être des caches de pirates.','La culture festive des Îles Vierges britanniques : Les Îles Vierges britanniques sont connues pour leur ambiance festive, en particulier pendant le carnaval annuel de Tortola. Ce festival coloré met en vedette des défilés, des danses, de la musique, des costumes flamboyants et des festivités qui attirent des visiteurs du monde entier.'),('VI',18.3358,-64.8963,'Vierges américaines (Îles)','VIR',850,'??','U+1F1FB U+1F1EE',0,2,23.425286843837505,'Les Vierges américaines, un territoire des États-Unis dans les Caraïbes, sont un paradis tropical composé de trois îles principales. Avec des plages de sable blanc et des eaux cristallines, les Vierges américaines attirent les amateurs de soleil et de sports nautiques. En tant que territoire non incorporé, elles bénéficient de l\'influence culturelle américaine tout en préservant leur identité locale. L\'économie dépend principalement du tourisme, du commerce et de la finance offshore.','Les plages de Saint John : L\'île de Saint John dans les Vierges américaines est réputée pour ses plages immaculées, dont Trunk Bay. Des programmes environnementaux sont en place pour protéger les récifs coralliens et la vie marine, offrant des expériences de plongée inoubliables.','Charlotte Amalie à Saint Thomas : Charlotte Amalie, la capitale de Saint Thomas, est connue pour son architecture coloniale danoise. Des projets de préservation restauratrice sont en cours pour préserver les bâtiments historiques de cette ville portuaire.','Le Carnaval des Vierges américaines : Le Carnaval des Vierges américaines est une célébration annuelle colorée avec des défilés, des costumes festifs et des événements culturels. Des projets culturels visent à préserver cette tradition animée, reflétant la diversité des îles.'),('VN',14.0583,108.277,'Viêt Nam','VNM',704,'??','U+1F1FB U+1F1F3',0,4,90.00255697407067,'Le Viêt Nam, situé en Asie du Sud-Est, est caractérisé par une géographie diversifiée comprenant des montagnes, des plaines côtières et des rivières. Le pays a une riche histoire influencée par des civilisations anciennes et des périodes coloniales. La culture vietnamienne est profondément enracinée dans la tradition bouddhiste, avec des influences chinoises et françaises perceptibles dans la cuisine, l\'architecture et les coutumes. Politiquement, le Viêt Nam est une République socialiste, avec un système politique dirigé par le Parti communiste vietnamien. Sur le plan économique, le pays a connu une croissance rapide au cours des dernières décennies, avec une économie en transition vers l\'industrialisation et les services. L\'industrie manufacturière, l\'agriculture et le tourisme jouent un rôle clé dans l\'économie vietnamienne en pleine expansion.','La Baie d\'Halong : La Baie d\'Halong est l\'un des sites naturels les plus emblématiques du Viêt Nam. Elle est parsemée de milliers de formations karstiques spectaculaires émergeant des eaux. Classée au patrimoine mondial de l\'UNESCO, la baie offre une croisière inoubliable avec ses paysages marins pittoresques.','Les Rizières en Terrasses de Sapa : Les rizières en terrasses de Sapa, situées dans les montagnes du nord, sont une merveille d\'ingénierie agricole. Les tribus ethniques locales cultivent le riz en terrasses sculptées à flanc de colline, créant un paysage pittoresque et étonnant.','Hôi An, Ville Ancienne : Hôi An, classée au patrimoine mondial de l\'UNESCO, est une ville ancienne avec une architecture bien préservée, des lanternes colorées, et une atmosphère envoûtante. Les rues étroites de Hôi An regorgent de boutiques, de restaurants, et de l\'histoire maritime du Viêt Nam.'),('VU',-15.3767,166.959,'Vanuatu','VUT',548,'??','U+1F1FB U+1F1FA',0,6,79.7369274122053,'Le Vanuatu, un archipel situé dans le Pacifique Sud, est composé de 83 îles volcaniques éparpillées dans l\'océan. Cette nation insulaire a une géographie diversifiée, allant de plages de sable blanc à des volcans actifs, offrant un paysage naturel spectaculaire. La population, principalement composée de groupes mélanésiens, contribue à la richesse culturelle du pays avec ses langues autochtones variées. Le Bislama, une langue créole, est la langue nationale. Le Vanuatu est connu pour sa tradition kastom, qui englobe les coutumes, les danses et la musique traditionnelles. Sur le plan politique, le pays est une république parlementaire indépendante depuis 1980. Bien que le Vanuatu soit politiquement stable, il doit faire face à des défis tels que la vulnérabilité aux catastrophes naturelles, notamment les cyclones tropicaux. L\'économie repose sur l\'agriculture, le tourisme et les services financiers offshore. Le Vanuatu attire les voyageurs en quête de beauté naturelle préservée, de plongée sous-marine et d\'expériences culturelles uniques.','Le Village de Yakel à Tanna : Sur l\'île de Tanna, le village de Yakel offre une expérience immersive dans la culture traditionnelle du Vanuatu. Les habitants préservent les coutumes ancestrales, portent des vêtements traditionnels en feuilles de bananier, et pratiquent des danses et rituels traditionnels. C\'est une occasion unique de plonger dans la vie quotidienne des communautés autochtones.','Le Volcan Yasur : Tanna abrite également l\'un des volcans les plus accessibles au monde, le Yasur. Les visiteurs peuvent s\'approcher du cratère en éruption et observer les explosions de lave, créant une expérience spectaculaire. Le Yasur est considéré comme un lieu sacré par les habitants, et la visite offre une combinaison unique de nature sauvage et de spiritualité.','La Musique Naghol (Land Diving) : Sur l\'île de Pentecôte, le Naghol, ou saut sur terre, est une pratique traditionnelle qui a inspiré le saut à l\'élastique moderne. Les participants attachent des lianes aux chevilles et plongent depuis des structures en bois, touchant presque le sol avant d\'être rattrapés par les lianes. Cette cérémonie a lieu chaque printemps et est un rituel pour assurer une bonne récolte.'),('WS',-13.759,-172.105,'Samoa','WSM',882,'??','U+1F1FC U+1F1F8',0,6,28.676969212179042,NULL,NULL,NULL,NULL),('XK',42.6026,20.903,'Kosovo','XKX',153,'??','U+1F1FD U+1F1F0',0,5,4.174066897643793,'Le Kosovo, situé dans les Balkans en Europe du Sud-Est, a déclaré son indépendance de la Serbie en 2008. Bien que cette déclaration ne soit pas universellement reconnue, le Kosovo fonctionne comme un État indépendant avec sa propre constitution et gouvernement. La géographie du Kosovo est caractérisée par des montagnes, des vallées et des rivières. La population est majoritairement composée d\'Albanais ethniques, avec des minorités serbes, roms et d\'autres groupes. La diversité culturelle est évidente dans la langue officielle, l\'albanais, et dans l\'influence historique ottomane. Politiquement, le Kosovo a progressé dans la construction de ses institutions depuis son indépendance, bien que des défis subsistent, notamment la question des relations avec la Serbie. Sur le plan économique, le pays est en développement, mais il fait face à des défis tels que le chômage et la corruption. Le Kosovo cherche à attirer des investissements étrangers et à renforcer son infrastructure pour favoriser le développement économique.','Le Monument de la Bataille de Kosovo Polje : Sur le champ de bataille de Kosovo Polje, où s\'est déroulée la célèbre Bataille du Kosovo en 1389, se dresse le monument du Nouveau-né. Ce monument coloré symbolise la naissance du Kosovo en tant qu\'État indépendant. Chaque année, le jour de l\'indépendance du Kosovo, le monument est repeint avec de nouvelles couleurs et des messages artistiques.','La vieille ville de Prizren : Prizren, l\'une des villes les plus anciennes du Kosovo, est réputée pour son charme médiéval. Les ruelles pavées, les mosquées historiques, et les églises orthodoxes créent une atmosphère unique. Le pont en pierre du XVIIe siècle, reliant les deux rives de la rivière Bistrica, est une icône de la ville.','La Fête de la Truite de Brod : Chaque année à Brod, un petit village kosovar, a lieu la Fête de la Truite. Cette célébration met en avant la culture locale, la musique, et bien sûr, les délices culinaires à base de truite pêchée localement. Les habitants et les visiteurs se réunissent pour déguster des plats traditionnels, participer à des activités festives, et profiter de la beauté naturelle des environs.'),('YE',15.5527,48.5164,'Yémen','YEM',887,'??','U+1F1FE U+1F1EA',3,4,34.839429925046325,'Le Yémen, situé à l\'extrémité sud de la péninsule arabique, est un pays riche en histoire ancienne et en traditions culturelles. Ses paysages comprennent des montagnes spectaculaires, des déserts vastes et des côtes le long de la mer Rouge et du golfe d\'Aden. Malgré sa beauté naturelle, le Yémen a été confronté à des défis politiques et humanitaires, notamment des conflits internes. La société yéménite conserve un fort attachement à ses coutumes, à sa musique et à son artisanat. L\'économie du Yémen est principalement agricole, avec une histoire liée au commerce historique et à la production de café.','La vieille ville de Sanaa : La vieille ville de Sanaa, la capitale du Yémen, est un site du patrimoine mondial de l\'UNESCO. Des projets de préservation architecturale sont en cours pour maintenir les maisons en torchis et les minarets anciens, témoignant de la riche histoire du Yémen.','L\'île de Socotra : L\'île de Socotra, située au large des côtes yéménites, est renommée pour sa biodiversité unique. Des initiatives environnementales protègent cette île, abritant des plantes et des animaux endémiques.','Le qat, tradition sociale : La consommation de qat, une plante stimulante, est une tradition sociale importante au Yémen. Des projets de préservation culturelle cherchent à maintenir cette pratique tout en abordant ses implications sociales.'),('ZA',-30.5595,22.9375,'Afrique du Sud','ZAF',710,'??','U+1F1FF U+1F1E6',0,1,61.67495200566477,NULL,NULL,NULL,NULL),('ZM',-13.1339,27.8493,'Zambie','ZMB',894,'??','U+1F1FF U+1F1F2',0,1,3.856473326549375,'La Zambie, située dans le sud de l\'Afrique, est un pays caractérisé par ses vastes étendues sauvages, ses parcs nationaux et ses rivières majestueuses, notamment le fleuve Zambèze. Lusaka, la capitale, est un centre économique et culturel en pleine croissance. La Zambie est renommée pour les chutes Victoria, l\'une des merveilles naturelles les plus spectaculaires du monde, partagées avec le Zimbabwe. Politiquement, la Zambie est une république démocratique. Son économie dépend de l\'agriculture, de l\'exploitation minière (cuivre) et du tourisme. La population zambienne, composée de divers groupes ethniques, contribue à une riche mosaïque culturelle avec des traditions musicales vibrantes et des danses colorées. Malgré des défis socio-économiques, la Zambie attire les visiteurs avec sa beauté naturelle, sa faune diversifiée et son hospitalité chaleureuse.','Les Chutes Victoria : Les Chutes Victoria, situées à la frontière entre la Zambie et le Zimbabwe, sont l\'une des merveilles naturelles les plus impressionnantes au monde. Surnommées le \"Voile de la mariée\" par les habitants locaux, ces chutes majestueuses offrent un spectacle spectaculaire avec leur débit d\'eau puissant et leurs arcs-en-ciel éclatants.','Le Parc National de South Luangwa : Ce parc national est l\'un des plus anciens et des plus diversifiés de Zambie. Il est renommé pour sa faune abondante, notamment des troupeaux d\'éléphants, des lions, et une grande variété d\'oiseaux. Les safaris dans le parc offrent une expérience unique pour les amateurs de vie sauvage','La Capitale Lusaka et le Marché de Soweto : Lusaka, la capitale de la Zambie, est un mélange dynamique de modernité et de traditions. Le marché de Soweto, l\'un des plus grands marchés d\'Afrique australe, offre une expérience authentique avec ses échoppes colorées, ses produits locaux, et son ambiance animée.'),('ZW',-19.0154,29.1549,'Zimbabwe','ZWE',716,'??','U+1F1FF U+1F1FC',0,1,34.257513689117054,NULL,NULL,NULL,NULL);
